(86,91,'YOMELは、高精度音声解析AIを用いて全発言を認識し、テキスト化することができる革新的な製品です。この製品を使用することで、議事録の作成工数を大幅に削減することができます。さらに、自動要約や議事録ビルダーなどの機能も搭載されており、データ分析や業務改善、品質・保全支援、お客様の声（VOC）分析、作業品質改善、意思決定の高度化、働き方改革、社内教育、テレワークなど様々なシーンで活用することができます。YOMELは大企業向け、中小企業向け、個人事業主向けなど幅広い層に対応しており、効率化と生産性の向上に貢献します。是非、YOMELを活用して業務効率化に取り組んでみてください。','2024-06-01 09:29:59.743390','2024-06-01 09:29:59.743390'),
