(88,116,'AIチャットボットCB3LiteEditionは、NDIソリューションズ株式会社が提供する汎用AIチャットボットです。この製品は、問い合わせ対応から業務改善、マーケティング、ユーザーエクスペリエンス向上、コミュニケーション、コールセンターなど、多岐に渡る用途で利用可能です。さらに、大企業、中小企業、個人事業主などに幅広く対応しており、全社規模での利用も可能です。そして、安価に導入が開始できるため、お客様のビジネスを効率化し、業務の効率性を向上させることができます。製品への興味を持っていただいたら、ぜひお問い合わせください。','2024-06-01 09:30:08.039131','2024-06-01 09:30:08.039131'),
