(92,96,'LegalForce株式会社LegalOnTechnologiesが提供する「LegalForce」は、AI契約審査プラットフォームとして、契約審査の品質向上と効率化を可能にします。この革新的なプラットフォームは、業務改善や作業品質の向上に貢献し、人事・総務の業務効率化をサポートします。大企業向けから中小企業向け、個人事業主向けまで幅広いニーズに対応し、業務プロセスをスムーズにし、リスクを最小限に抑えます。LegalForceは、業務効率化と品質向上を追求する企業に最適な製品です。','2024-06-01 09:30:23.691058','2024-06-01 09:30:23.691058'),
