(95,99,'株式会社豆蔵が開発した「MZbot」は、対話型AIエンジンとして、日本企業のデジタルトランスフォーメーション（DX）を強力にサポートします。このノーコードAIは、Webマーケ、レコメンド、問い合わせ対応、パーソナライズなど様々な機能を持ち、業務改善や作業品質の向上、接客、営業支援、満足度向上、ユーザーエクスペリエンスの充実、販売促進など多岐にわたるニーズに応えます。大企業から中小企業、個人事業主まで幅広い層に対応しており、DXを加速させるための頼れるパートナーとして活躍しています。是非、MZbotを導入して、ビジネスをスマートに進化させてみてください。','2024-06-01 09:30:38.335472','2024-06-01 09:30:38.335472'),
