(359,367,'BizteXcobitは、BizteX株式会社が提供する製品です。専門知識、インストール、プログラミングが不要で、全てワンクリックで自動化されます。業務改善、品質・保全支援、コスト削減、作業品質改善など様々なニーズに対応できます。大企業向け、中小企業向け、個人事業主向けなど、幅広い規模の事業に利用可能です。効率的な業務遂行や品質向上、コスト削減を実現したい方におすすめの製品です。BizteXcobitを導入することで、業務効率が向上し、生産性が飛躍的に改善されること間違いありません。','2024-06-01 09:49:41.335618','2024-06-01 09:49:41.335618'),
(360,368,'Autoジョブ名人は、PC作業の自動化からミスが許されない業務や受注データのダウンロードまで多岐にわたる自動化実績を持つ優れた製品です。1,000社以上、3,500本を超える導入実績と豊富な経験を活かし、安定性と使いやすさの向上を追求しています。業務改善や作業品質向上を実現するために設計されており、大企業、中小企業、個人事業主向けなど幅広いニーズに対応しています。自動化により効率化を図り、業務の効率性を向上させるために是非ご検討ください。','2024-06-01 09:49:45.230696','2024-06-01 09:49:45.230696'),
(361,369,'JobAuto社が提供する「JobAuto」は、業務改善に特化した製品です。多機能でありながら高機能性を備えており、導入・構築コストが低く、運用コストも削減できる点が特徴です。大企業向け、中小企業向け、個人事業主向けなど、幅広いニーズに対応しています。効率化を図りたい企業にとって、現場の業務を効率的に改善するための理想的な製品と言えるでしょう。お客様の業務環境に合わせて柔軟に対応し、生産性向上に貢献します。JobAutoは、業務改善を真剣に考えている企業におすすめの製品です。','2024-06-01 09:49:49.527837','2024-06-01 09:49:49.527837'),
(362,370,'新製品のAI清掃ロボットは、掃除できないゴミを見分けてシステムに通知する画期的なシステムです。この製品は大企業向け、中小企業向け、個人事業主向けなど幅広いニーズに対応しています。従来のロボット掃除機とは異なり、このAI清掃ロボットはゴミの種類を識別し、適切な処理を行います。仕事や家事の手助けとして、便利で効率的な清掃を実現します。AIの技術を活用したこの製品は、忙しい現代社会で生活をより快適にする一助となるでしょう。是非一度お試しください。','2024-06-01 09:49:53.638910','2024-06-01 09:49:53.638910'),
(363,371,'自動配車システム「TOMAS」は、ジェイ・ビー・クラフトが提供する画期的な製品です。TOMASは、単なる経路の最適化ではなく、スケジュールの最適化を行うことで、業務改善（効率化）、コスト削減、作業品質改善、売上アップなどさまざまな効果をもたらします。2024年問題にも完全に対応可能なTOMASは、ラストワンマイルの自動配車から幹線輸送や複雑な企業間配送まで幅広く対応しています。大企業向け、中小企業向け、個人事業主向けといった様々なニーズに対応し、お客様の配車に関するお悩み・課題を解決します。興味のある方はぜひTOMASをご検討ください。','2024-06-01 09:49:59.060231','2024-06-01 09:49:59.060231'),
(364,372,'攻撃型生産管理システムTPiCS-Xは、変化する市場環境に対応するために開発されました。このシステムは、繰り返し生産から個別生産まで幅広い製品に対応し、工場の負荷を自動的に平準化してスムーズな生産を実現します。業務改善（効率化）、作業品質改善、意思決定の高度化といった機能により、さまざまな規模の企業や個人事業主に適した生産管理ソリューションを提供しています。TPiCS-Xは大企業向け、中小企業向け、そして個人事業主向けなど様々なニーズに対応しており、幅広いユーザーに価値を提供します。','2024-06-01 09:50:04.697457','2024-06-01 09:50:04.697457'),
(365,373,'WelcomIDは、0.3秒で高速に顔認証と検温を行う複合型端末です。さらに、この端末は電子錠との連携も可能で、通過者の顔画像が日時とともに保管されるため、犯罪抑止効果も期待できます。大企業向けから個人事業主向けまで幅広いニーズに対応しており、業務改善やプロモーション、ブランディング、販売促進など様々なシーンで活躍します。顔認証技術を活用して、効率化やセキュリティ強化を図りたい方におすすめの製品です。','2024-06-01 09:50:08.487193','2024-06-01 09:50:08.487193'),
(366,374,'WelcomID無人店舗HOUSEIは、顔認証技術とドア開錠システム、Web予約システム、Web決済システムを組み合わせた革新的なソリューションです。受付業務から販売、業務効率化、プロモーション、ブランディングまで幅広いニーズに対応し、満足度向上や販売促進に貢献します。大企業、中小企業、個人事業主など幅広い規模のビジネスに対応しており、顔認証技術を活用した店舗・イベント集客や効果的なコミュニケーションを実現します。各種タグにも注目して、あなたのビジネスをさらに強化しましょう。WelcomID無人店舗HOUSEIが、あなたのビジネスに革新をもたらします。','2024-06-01 09:50:14.109870','2024-06-01 09:50:14.109870'),
(367,375,'SAPPHIRE近郊交通費は、Miletos株式会社から提供される通勤費・交通費の実費精算を自動化するシステムです。申請・承認などのワークフローを効率化し、経費データからリスクの高い経費を洗い出すことで経理処理の手間を軽減します。業務改善を目指す企業におすすめの製品で、大企業から個人事業主まで幅広く対応しています。経費精査と統制の高度化を実現し、業務の効率化に貢献します。SAPPHIRE近郊交通費は、あなたのビジネスをサポートする頼れるパートナーとなるでしょう。','2024-06-01 09:50:19.021996','2024-06-01 09:50:19.021996'),
