(5,'株式会社時空テクノロジーズ','9.4億円(J-KISS含む)','2019年4月','30名','時空テクノロジーズは、AI・IoT・XR・アバターなどの先端テクノロジーを用いて人々のコミュニケーションのあり方を変革しています。','ログミーツpoweredbyGPT-3/4','「ログミーツpoweredbyGPT-3/4」は、対面＆ウェブ両会議に対応した数少ないAI議事録・メモ作成支援機能と、誰でもワンボタンでAI要約・分析・翻訳などを行えるGPT機能を搭載している、最強会議支援ツールです。','月額',NULL,NULL,true,true,'["\n                \n                どのような業種・職種に向いたツールですか？              \nすべての業種・すべての職業でご活用いただけます。", "\n                \n                初心者でも使えますか？              \n誰でも知識ゼロから簡単・安全に会議ログ作成～AIまで活用していただけます。", "\n                \n                対面会議で使えますか？              \n専用のモバイル端末を使うことで、対面会議もしっかり録音＆文字起こしされます。", "\n                \n                どのウェブ会議ツールで使えますか？              \n専用のWindowsアプリを使うことで、すべてのウェブ会議ツールの会議をしっかり録音＆文字起こしされます。特別なセットアップも不要です。", "\n                \n                セキュリティ対策はされていますか？              \nISO27001/ISO27015/Pマークのセキュリティ認証を取得しており、安心安全の管理体制となります。モバイル端末もWindowsアプリも手元にはデータが残らずにクラウドで安全にデータ管理されるため、仮に端末を紛失しても安心です。", "\n                \n                導入実績はありますか？              \n全国の自治体231以上の正式契約まで伸びており、今最も勢いのあるサービスの一つです。企業は誰もが知る大手から中小企業まで、業種や規模を問わず導入が進んでいます。"]',NULL,'2024-05-28 10:12:18.768210','2024-06-09 07:23:20.546680',NULL,NULL,'月額10,000円～','製品画像22.jpeg'),
(6,'株式会社イクシーズラボ','/','2017年1月1日','/','15年以上のAI研究と多くの商用実績で培った知見を取り入れ開発された、AI会話エンジン「CAIWA」をベースに、AIの各種技術の応用研究、サービス提供を行っています。','CAIWAServiceViii（カイワサービスヴィー）','イクシーズラボが提供するCAIWAServiceViiiは、⾔語認識精度の⾼い独⾃開発のAI会話エンジン搭載。ChatGPTAPI連携による知識データ⾃動⽣成、社内⽂書の全⽂検索、MicrosoftTeams連携など、業務効率化を実現する機能満載。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:12:18.937389','2024-06-09 07:23:20.585390',NULL,NULL,'お問合せください','製品画像13.jpeg'),
(7,'Lighthouse株式会社','-','2022年11月1日','7名','・AIチャットボット「FUNNEL」の導入支援・DXコンサルティング・マーケティング支援・新規事業開発支援','FUNNEL（ファネル）','Lighthouse株式会社が提供する「FUNNEL」は、問合せ対応を自動化するチャットボットです。ChatGPTが独自データを学習することで問合せ対応や接客を自動化します。','その他',NULL,NULL,true,true,'["\n                \n                情報漏えいの心配はないでしょうか？              \n学習データはOpenAI社の学習には一切利用されません。\r\nまたユーザーへの入力制御等、様々なセキュリティ対策を行なっております。", "\n                \n                会話のシナリオを設定することもできますか？              \n可能です。シナリオを設定したり、特定の質問には定型文を回答させる等、会話内容も柔軟に設計することができます。", "\n                \n                HP以外にも導入できますか？              \nHP以外にも社内の情報検索ツールとして活用頂くことも可能です。", "\n                \n                どのようなデータを利用できますか？              \nWebサイト、PDF、Word、ファイルサーバ等様々なデータに対応しております。", "\n                \n                学習データは都度提供する必要がありますか？              \n都度データをご提供頂く必要はございません。格納先のデータを弊社側で確認し、学習データ化することも可能です。", "\n                \n                運用負担ゼロとはどういう意味ですか？              \nシステム基盤の運用に限らず、回答精度のチューニングやプロンプト制御等、ツール導入以降の回答品質の維持向上に関する運用も弊社で行うことを意味しております。"]',NULL,'2024-05-28 10:12:19.029637','2024-06-09 07:23:20.626793',NULL,NULL,'お問合せください','製品画像3.jpeg'),
(8,'株式会社ウィット','1350万円','2007年8月','10名以下','株式会社ウィットは、BtoBのウェブマーケティング支援会社です。「BtoBのウェブマーケティングを高い確率で成功に導く」をコンセプトに、事前の計画をしっかりと練り、投資に見合うプランニングが企画・推進できるかを重視して、ウェブマーケティングの実行支援を行っています。ウェブマーケティングの推進に当たり、ChatGPTの活用が不可欠になり、2023年4月よりクライアントと実験プロジェクトを複数開始。ウェブサイトやメールマガジンの文章作成、補助金の申請書類の作成、採用向けの応募文言のバリエーション展開、広告入稿のコピー作成、資料ダウンロードの骨子及び内容作成などさまざまな実装を手掛けてきました。その中で、社員全員がChatGPTを使いこなす重要性を強く認識し、誰でもChatGPTを使いこなせるようになるためのトレーニングプログラムを開発。AI活用の全社的な底上げをトレーニングプログラムで図りながら、ChatGPTベースのシステム開発やプロンプト開発なども手掛けております。','初心者向けChatGPTトレーニング研修','20×20コマのオンライン動画研修で好きな時間に受講可能。計8時間以上で1人30,000円～のコストパフォーマンス。ChatGPTは使いこなしに大きな差が出るAIです。そのため、社員全員が使いこなせるようになるためのトレーニングが重要です。本トレーニングでは、初心者から業務活用まで目指せることを目標に、会社内での業務を想定した実践を通じてChatGPT活用法を学びます。','ユーザー',30000,'なし',true,true,'["\n                \n                ChatGPTトレーニング研修にはChatGPT有料版（ChatGPT Plus）が必要ですか？              \nChatGPTトレーニング研修では、ChatGPTの無料版であるGPT-3.5を基本として学習を進めるため、有料契約は不要です。有料の契約がなくても学習をすべて完了することができますが、有料版を活用することでChatGPTの回答精度が上がるため、より効果的な実践を進められる可能性が上がります。", "\n                \n                研修期間は決まっていますか？              \n1～2ヶ月の間で、参加メンバーごとに自由に設定が可能です。", "\n                \n                研修はオンラインの動画の閲覧のみですか？              \n学習サイトにアクセスいただき、教材をダウンロードの上、オンライン動画を見ながら、受講者ご自身のChatGPTを活用して実践を行います。20コマの講義のうち、5回の課題提出(※)があり、受講者自身がプロンプト（AIへの命令文）を書き添削を受けることで実践的な学びとセットになっています。※・・・課題提出はプロンプト添削あり研修のみになります。", "\n                \n                対象となる業種や業務は限定されていますか？              \nメールや会議、資料作成などあらゆる業種・業務を想定した学習内容になっています。新人からマネージャーまでそれぞれの立場で学びがある研修構成となっており、さまざまな業種・業務で活用いただけます。", "\n                \n                自社専用のオリジナルトレーニングを作ってもらえますか？              \n可能です。別途ご相談ください。"]',NULL,'2024-05-28 10:12:19.117631','2024-06-09 07:23:20.664678',NULL,NULL,'【添削なし研修】1人30,000円 【添削あり研修】1人50,000円','製品画像9.jpeg'),
(9,'ソーバル株式会社','214百万円','1983年1月','連結：889名（2024年2月29日現在）','ソーバルは、1983年創業以来「技術で社会に貢献する」という理念のもと、主にＩＴソリューションの提供を主たる事業としつつ、近年では、AIやIoT技術にも取り組み実績を上げております。','生成AI活用エンジニアリングサービス','ソーバル株式会社が提供する「生成AI活用エンジニアリングサービス」は、お客様の課題を聞かせて頂き、生成AIを活用したシステム開発によって、課題解決を支援させて頂くサービスです。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:12:19.214345','2024-06-09 07:23:20.707875',NULL,NULL,'お問合せください','製品画像26.jpeg'),
(10,'株式会社サテライトオフィス','7,000万円','1998年7月','160名','サテライト環境で企業様をビジネス支援するサービスを展開しています。Google社@GoogleWorkspace、マイクロソフト社＠Microsoft365、LINEWORKS、DropboxBusiness、Facebook社＠WorkplacebyFacebookなどのクラウドコンピューティングに特化し、SaaS型サービスのビジネス支援を展開しております。また、オフショア拠点として、ベトナムに、現地100％子会社（サテライトオフィス・ベトナム）を設立し、オフショア開発の業務を推進！AI（ChatGPT関連）・ロボット・IoTビジネスも拡大中です。','サテライトAI','サテライトオフィスが提供する「サテライトAI」は、企業内でOpenAI社のChatGPTやGoogle社のGemini、Microsoft社のAzureOpenAIService等の導入支援をいたします。様々な場面で生成AIを活用して企業の業務改善をサポートいたします。法人向けの生成AIの導入はサテライトオフィスにご相談ください。','月額',100,'なし',NULL,true,'["\n                \n                外部ツールと連携可能でしょうか？              \nGoogleWorkspace、Microsoft365、LINEWORKSと連携可能です。"]',NULL,'2024-05-28 10:12:19.307452','2024-06-09 07:23:20.746882',NULL,NULL,'1ユーザー月額100円～　+　利用回数課金','製品画像19.jpeg'),
(11,'ナイル株式会社','3,632百万円  ※資本準備金等含む','2007年1月15日','238名 ※2023年12月末日現在','ナイルは「日本を変革する矢」というビジョンを掲げる東証グロース上場企業です。独自のDX・生成AIなどのノウハウと卓越した実行力で、課題を鋭く射抜き、ビジネスに変革をもたらす”産業DXカンパニー”です。','ナイルの生成AIコンサルティングサービス','ナイルが提供する「ナイルの生成AIコンサルティング」は、最新の生成AIで売上向上・コスト削減のご支援をするサービスです。どの業務に使えるかわからない、費用対効果が見えづらいといった悩みを解決します。','その他',NULL,'なし',NULL,NULL,'["\n                \n                生成AIの導入による主なメリットは何ですか？              \n生成AIの導入によるメリットには、作業の効率化、コスト削減、イノベーションの促進、顧客体験の向上などがあります。特に、繰り返し行われる作業の自動化、高速なデータ処理、個別化された顧客対応の実現が可能となり、ビジネスの競争力を高めることができます。", "\n                \n                生成AIのビジネスへの活用例は何がありますか？              \n生成AIは、マーケティング、カスタマーサービス、コンテンツ制作、データ分析など、さまざまなビジネス領域で活用されています。例えば、顧客に合わせたパーソナライズされた広告の生成、サポートチャットボット、市場動向の分析、クリエイティブなコンテンツの生成などが挙げられます。貴社に合わせた活用方法をご提案します。", "\n                \n                まずは社員教育などからスタートも可能ですか？              \nもちろん可能です。お客様の中には全社員対象で生成AIの導入研修を行ったことにより、会社全体が生成AI活用に非常に前向きになったというケースもございます。", "\n                \n                生成AIの導入に際して考慮すべきリスクは何ですか？              \n生成AIの導入には、データのプライバシーやセキュリティの問題、不正確な結果によるリスク、倫理的な懸念が含まれます。また、技術の急速な進化に伴い、適切なトレーニングや管理が必要となります。これらのリスクを理解し、対策を講じることが重要です。"]',NULL,'2024-05-28 10:12:19.408677','2024-06-09 07:23:20.783877',NULL,NULL,'お問合せください','製品画像2.jpeg'),
(12,'SELF株式会社','3億7,600万円（資本準備金含む）','2014年11月','-','SELFは、自社独自の会話型コミュニケーションAIにより、ユーザー特性を理解し、各ユーザーに対して最適化した情報を提案・伝達することを使命としています。','SELFBOTBuiltwithGPT社内対応','ChatGPT+社内データの本格活用ドキュメント構造把握で高い精度を実現','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:12:19.497160','2024-06-09 07:23:20.831290',NULL,NULL,'お問合せください','製品画像28.jpeg'),
(13,'株式会社コムニコ','18,000,000円（資本準備金含む）','2008年11月5日','140名','コムニコの生成AI活用支援サービスは、ChatGPT、MicrosoftCopilot、Gemini、DALL・E3など主要生成AIに対応！生成AI活用の戦略策定からガイドラインやマニュアルの作成、活用開始後の伴走支援まで、手頃な価格でサポートを行っています。','生成AI活用支援','株式会社コムニコが提供する「生成AI活用支援」はChatGPT、MicrosoftCopilot、Gemini、DALL・E3など主要生成AIに対応！生成AI活用の戦略策定からガイドラインやマニュアルの作成、活用開始後の伴走支援まで、手頃な価格でサポートを行っています。','月額',NULL,'なし',true,NULL,'["\n                \n                生成AIに全く知見がないのですが、大丈夫でしょうか？              \n全く問題ありません。専門用語や難しい言葉は使わず、初心者の方でも理解しやすいご支援を心がけています。", "\n                \n                導入に必要なコストはどれくらいですか？              \n支援内容によりますが、月額30万円～発注可能です。", "\n                \n                最短でいつから導入支援が可能でしょうか？              \n初回お打合せ（ヒアリング）後、2週間後以降を目処にお考えください"]',NULL,'2024-05-28 10:12:19.580362','2024-06-09 07:23:20.874747',NULL,NULL,'月額30万円～','製品画像20.jpeg'),
(14,'株式会社neoAI','5,600万円（資本準備金を含む）','2022年8月','-','株式会社neoAIは、「時代のうねりを日本の成長に転換する」をVisionに掲げる東京大学松尾研究室発の生成AIスタートアップです。','neoAIChat','東京大学の松尾研究室発の生成AIスタートアップである、neoAIが提供する法人向けChatGPTシステム。金融機関レベルの高セキュリティや運用の容易さはもちろん、社内チャットボットなど各業務に最適化した機能の追加も可能です。','月額',NULL,NULL,NULL,true,'["\n                \n                導入までどれぐらいかかりますか？              \n最短で2ヶ月で検証から導入まで行います。\r\nneoAIの提供する生成AIコンサルティングサービスと組み合わせることで、neoAIChatを足がかりとした「実務で使える生成AI」の高速導入を実現いたしました。", "\n                \n                ChatGPT等のLLMのセキュリティが心配です。              \nMicrosoftAzure上で検証・開発・提供をいたします。弊社Azure環境でなく、クライアント様のAzure環境での構築も可能となっております。（オプションプラン）\r\nさらに、AzureOpenAIServiceが提供する高度なエンタープライズコンプライアンス、セキュリティ制御だけでなく、追加で複数のセキュリティ対策を実施しているため、金融機関やインフラ業界などのセキュリティ要件が厳しい企業様でも安心してお使いいただけます。\r\nまた、マイクロソフト社のスタートアップ支援プログラム「MicrosoftforStartups」にも弊社は採択されており、マイクロソフト社の担当者と密なコミュニケーションをもとにした対応が可能です。", "\n                \n                外部ツールとの連携はできますか？              \nLINE・Slack・Googleのサービス(スプレットシートなど)との連携が可能です。\r\n貴社システムやMicrosoftTeamsなどへの連携についてもお気軽にご相談ください。", "\n                \n                neoAI Chatの特徴は何ですか？              \nクライアント様と伴走しながら業務に最適化されたChatGPTの導入支援を行い、活用フェーズや現場のニーズに合わせてカスタマイズも可能である点が、neoAIChatの特徴です。\r\n松尾研究室をバックグラウンドとした確かな技術力と、スタートアップ特有のスピード感を持つneoAIならではのご支援パッケージとなっております。", "\n                \n                無料トライアルがしたいのですが可能ですか？              \nneoAIChatの無料デモ体験会を実施しております。\r\nお打ち合わせにてご案内いたします。"]',NULL,'2024-05-28 10:12:19.666882','2024-06-09 07:23:20.939701',NULL,NULL,'月額10万円~  従量課金なし','製品画像2.jpeg'),
(15,'株式会社三菱総合研究所','63億3624万円','1970年（昭和45年）5月8日','4428名','シンクタンク・コンサルティング・ITサービスをワンストップで提供し、お客様や社会の課題解決に貢献します','ロボリサ','株式会社三菱総合研究所が提供する「ロボリサ」は、AI／ChatGPT技術を活用しWebからの情報収集を自動化し、業務の効率化とリサーチ業務のクオリティ向上に貢献します。','その他',NULL,NULL,true,NULL,'["\n                \n                ChatGPTのAPIや各社が提供しているツール類と異なる点は何ですか？              \nロボリサは情報の信頼性にこだわっています。まず最初の設定で自身で情報源とするサイトを登録することにより、信頼性を担保することが可能です。また、誤情報検出機能を搭載することにより、生成AI特有の現象である「ハルシネーション」を抑制することができます。", "\n                \n                ChatGPT技術を利用することで、検索や生成したレポートの情報が流出することはありませんか？              \nいいえ。ロボリサで利用している生成AIでは、入力した情報が外部に流出したり、生成AIの学習に利用されたりすることはありません。", "\n                \n                海外の情報源も日本語で要約されますか？              \nはい。ロボリサは海外の情報源も多言語対応で日本語に要約可能です。"]',NULL,'2024-05-28 10:12:19.753258','2024-06-09 07:23:20.998437',NULL,NULL,'お問合わせください。','製品画像2.jpeg'),
(16,'株式会社E9Technologies','100万円','2023年2月','10名','株式会社E9Technologiesは、AI分野のアカデミックレベルの深い専門知識を武器に様々な業界へ最先端の研究開発をサポートしております。','生成AI研究開発コンサルティング・アドバイザリー','株式会社E9Technologiesが提供する「生成AIの研究開発支援」は、アカデミックレベルの深い知見をもとにした支援サービスです。産学連携や論文・特許などの知財戦略も得意としています。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:12:19.888065','2024-06-09 07:23:21.041772',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(17,'西安スターティアソフト株式会社','1000万円','2013年7月','35名','開発受託全般をワンストップで対応します。AI受託開発／XR受託開発／プロダクト・サービス開発の企画・設計・開発・運用サポート／業務システム受託開発、リプレイス／デジタル領域における新技術実証実験','Enterprise-AI','「Enterprise-AI」は、法人向けAI導入サービスです。学習流用を防ぐセキュアな環境を構築し、学習機能、アカウント発行、管理画面など、法人向けの基本機能をセットで提供します。','その他',NULL,'1000000',true,true,'["\n                \n                外部ツールと連携可能でしょうか？              \nAPI提供しているツールとの連携は可能です。", "\n                \n                社内システムを変更せずに導入できますか？              \nAI専用のDBとシステムを別途構築するため可能です。", "\n                \n                自社DBと連携することは可能ですか？              \nオプションで対応可能です。自動連携にするとDB更新の手間が省けます。", "\n                \n                AIエンジンは選べますか？              \nご希望のAIエンジンを導入することが可能です。", "\n                \n                学習は実施してくれますか？              \nシステム導入だけなく、初回学習は実施します。"]',NULL,'2024-05-28 10:12:19.980396','2024-06-09 07:23:21.079563',true,1000000,'10万円〜','製品画像25.jpeg'),
(18,'アースアイズ株式会社','5,950万円','2015年9月16日','-','人工知能搭載カメラ（防犯、事故防止）の開発及び販売ソフトウェアの開発及び販売コンピューターの電子情報の管理及び保管コンピューターの電子情報の解析、分析及び加工電気通信事業','生成AI開発受託/事業化コンサルティング','アースアイズ株式会社が提供する「生成AI開発受託/事業化コンサルティング」は、自社のサービスとして生成AIサービスを提供したくても、リソースやノウハウがない企業様に対して、AIの専門家である弊社が下請けとなって事業化を支援する受託サービスです。','その他',NULL,'150000',true,NULL,'["\n                \n                事業化コンサルティングの具体的な事例はどのようなものでしょうか？              \n例えば「AzureOpenAIの導入に向けた構築支援」「社内向けのセミナーやウェビナー開催」「生成AIを用いた社内システムの効率化支援」「その他生成AIに関する総合アドバイス」などリーズナブルな価格で対応していますので是非ご相談ください。", "\n                \n                一般企業ですが、AI構築をしてもらえますか？              \nはい", "\n                \n                御社の名前を一切出さずに商談を支援をしてもらうことはできますか？              \nはい", "\n                \n                アフターサポートは行っていますか？              \n導入後一カ月は無償対応します。その後はサポート見積もりをお出しします。"]',NULL,'2024-05-28 10:12:20.073213','2024-06-09 07:23:21.125646',true,150000,'都度見積もり','製品画像1.jpeg'),
(19,'TIS株式会社/澪標アナリティクス株式会社','100億円　/　ー','2008年4月　/　2014年6月','連結：21,946名　単体：5,695名　/　142名','データ分析特化型コンサルティングサービス','生成AI導入支援サービス','生成AIのビジネスでの活用方法、運用管理のポイントをAIのプロが伝授します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:12:20.168400','2024-06-09 07:23:21.168298',NULL,NULL,'お問合せください','製品画像29.jpeg'),
(20,'KIYOラーニング株式会社','8億316万円','2010年1月4日','94名','「学びを革新し、誰もが持っている無限の力を引き出す」というミッションのもと、ビジネスパーソン向け教育コンテンツおよび教育サービスの企画、制作、販売、運営しております。','AirCourseAIナレッジ','-月額500円/名～契約したその日からすぐに使える-KIYOラーニング株式会社が提供する「AirCourseAIナレッジ」はナレッジ共有のできる法人向け生成AIサービスです。社員が作成したプロンプトや最終的な出力結果が出るプロセスも社内共有でき、生成AIの社内促進を実現します。','月額',NULL,'0',true,true,'["\n                \n                「AirCourse AIナレッジ」を利用するには、eラーニングサービスの\r\n「AirCourse」の契約が必要になりますか？              \n「AirCourseAIナレッジ」のみご契約いただけます。\r\nなお、eラーニングサービス「AirCourse」を同時契約することもできます。eラーニングサービス「AirCourse」と合わせてご利用いただく場合は、同じ管理画面で利用状況などを一元管理することができます。", "\n                \n                ライセンス毎に利用制限はありますか？              \nライセンス毎に利用制限はございませんが、ご契約のライセンス数に応じて、ご契約いただく法人(企業)単位で利用上限を設定させて頂きます。なお、本サービスはポイント制度を採用していますので、利用上限はポイント数で管理いただけます。詳しくは、「お問い合わせ」ください。", "\n                \n                利用可能なGPTモデルは限定されていますか？              \n「GPT-4Turbo(プレビュー版)（gpt-4-1106-preview）」、「GPT-4-32k」、「GPT4-8k」、「GPT-3.5Turbo（gpt-3.5-turbo-1106）」を利用できます。生成AIを利用する都度、モデルを選択できるようにデザインされています。", "\n                \n                プロンプトのテンプレートはどのようなものがありますか？              \n全社員が利用可能な「文章の要約」や「メール返信文の作成」など汎用的なテンプレートから、業務や部門に特化したテンプレートまでご用意しています。また、オリジナルのテンプレートを作成して、保存・共有する機能も搭載しています。", "\n                \n                ナレッジの共有範囲は設定できますか              \nナレッジを共有するフォルダは、ユーザ・グループ・組織などの単位で設定できます。また、ナレッジは個人フォルダに保存することもできます。"]',NULL,'2024-05-28 10:12:20.304171','2024-06-09 07:23:21.208902',NULL,NULL,'月額500円/名～（年間契約1,000名ご利用の場合）','製品画像27.jpeg'),
(21,'ホリエモンAI学校株式会社','100万円','2024年2月','~5名','ホリエモンAI学校は、AI人材育成のためのオンライン学習プラットフォームの運営を行なっています。','ホリエモンAI学校','ホリエモンAI学校は、AI・ChatGPTに関する講義が月額定額制で「選び放題」「受講し放題」のハイコストパフォーマンスの法人向けオンラインスクールです。自社のビジネスパーソンは24時間好きなタイミングにスマホからでも動画を視聴してAIを学ぶことができます。','ユーザー',NULL,'なし',true,true,'["\n                \n                受講できる期間は？              \n１年間の受講期間を提供する仕組みになります。退会後のサポートはございませんので、必要に応じてご継続ください。", "\n                \n                補助金・助成金についてよくわからないのですが大丈夫でしょうか？              \nご安心ください。弊社提携の社労士よりサポートを受けれますので、まずはお気軽にご相談くださいませ。", "\n                \n                動画の視聴はPCのみの対応ですか？              \nパソコンだけでなく、スマホやタブレットから24時間いつでも講義を受けることができます。"]',NULL,'2024-05-28 10:12:20.402576','2024-06-09 07:23:21.254623',NULL,NULL,'44万円/年×人数 最大75%(44万円-30万円)の助成金がありますので、まずはご相談ください。','製品画像16.jpeg'),
(22,'Daedalus株式会社','1000万円','2020年8月7日','-','弊社はAIを世の中に浸透させ、人々がより自分らしく生きる「余裕」を持てる世界を創造することをミッションとして、機械学習を軸とした企業のプロダクト開発・運用のご支援をしています。','Daedalus(ダイダロス)の検索拡張生成(RAG)構築サービス','Daedalus(ダイダロス)の検索拡張生成(RAG)構築サービスは、御社に合わせた生成AIをカスタマイズし提供いたします。課題・悩みに沿ってコンサルティングから開発まで一気通貫で行うことができるので、単なるChatGPT/生成AIの導入支援でなく、RAG（検索拡張生成）の構築が可能なので、幅広いソリューションで業務改善いたします。','その他',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:12:20.523059','2024-06-09 07:23:21.302237',NULL,NULL,'ご要件に応じて要御見積もり','製品画像15.jpeg'),
