(25,'株式会社調和技研','資本金 169,964,650円、資本準備金 169,964,650円','2009年11月','90名','DX/AIコンサルティングから、AI受託開発・導入支援、ChatGPT/LLM導入支援、AI人材育成まで、企業・団体におけるAI活用全般を支援しています。','AIを熟知するエキスパートによる「ChatGPT/LLM導入支援」','調和技研が提供する「ChatGPT/LLM導入支援」は、普段使用している業務ツールとの連携、実用に耐えうる回答精度の実現など、AI受託開発で培った技術開発力を活かして企業の業務で”本当に使える”ChatGPT/LLMの導入をご支援します。','その他',NULL,NULL,NULL,NULL,'["\n                \n                発注から導入までの期間はどれくらいかかりますか？              \n3ヶ月〜を想定しておりますが、詳細はお客様のご要望・ご要件等をヒアリングさせていただいたのちにご提案させていただきます。", "\n                \n                費用はどれくらいかかりますか？              \n初期費用300万円〜、月額費用30万円〜を基準としておりますが、詳細はお客様のご要望・ご要件等をヒアリングさせていただいたのちにご提案させていただきます。", "\n                \n                AIやChatGPTに関する一般的な知識から教えていただけますか？              \nAIやChatGPTに関するセミナーやコンサルティングもご提供しておりますので、お気軽にご相談ください。", "\n                \n                セキュリティは担保されますか？              \nMicrosoftAzure環境で構築するため、投入データは学習に利用されません。その他データ保全などについては、MicrosoftAzure規約に準拠した形でサービスをご提供します。詳しいデータ処理とセキュリティ対策に関しては、MicrosoftAzure規約をご参照ください。ChatGPTを利用できないお客様に対しては、OSS版LLMを利用したクローズな環境での構築も検討させていただきます。"]',NULL,'2024-05-28 10:12:22.491878','2024-06-09 07:23:21.450632',NULL,NULL,'お問合せください','製品画像15.jpeg'),
(26,'jinius株式会社','5,460万円（資本準備金含む）','2022年1月11日','～10名','・人事ソリューションシステムの開発・販売・サポート事業・戦略人事サポート事業','yomitoki','「yomitoki」で普段の面接をするだけ。AIが面接をサポートし、見極めの質を落とすことなく選考業務を効率化します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:12:25.037596','2024-06-09 07:23:21.505689',NULL,NULL,'お問合せください','製品画像25.jpeg'),
(27,'株式会社Helpfeel','1億円','2020年12月','100名','知識を届けるエンタープライズサーチ「Helpfeel」、知識を磨き上げるアイディエーションツール「Scrapbox」、情報を知識にするメディアキャプチャー「Gyazo」の開発運用','HelpfeelGenerativeWriter','ChatGPTを活用したFAQ作成支援ツールで、エンドユーザーからのお問い合わせに基づくFAQコンテンツの作成業務の工数軽減を実現！FAQ記事の作成や更新に手間がかかってお困りの方におすすめです。','その他',NULL,NULL,true,NULL,'["\n                \n                うちの会社はFAQをウェブサイトに公開していないのですが              \nHelpfeelはFAQのウェブサイトとしてご利用いただけます。\r\n御社でFAQの回答文をご準備いただけましたら、Helpfeelのセットアップは弊社にて行います。", "\n                \n                別のFAQシステムを使っていますが、乗り換えは可能ですか？              \nHelpfeelは、検索ヒット率向上に特化したモジュールとして既存のFAQシステムに組み込んでいただくことが可能です。\r\n実際、他社FAQシステムと併用する形で導入いただいている企業様も少なくありません。\r\n", "\n                \n                うちの業界は専門用語ばかりだから、FAQページを改善するのも難しいでしょうか              \n専門用語が多用されている金融・医療の業界での導入事例もございます。\r\nHelpfeelは業界を問わずFAQページの劇的な改善を実現できるFAQシステムです。", "\n                \n                FAQページだけではなく、カスタマーサポート全体を見直したいのですが              \nFAQページのみならず、電話やメールによる問い合わせへの対応を行うカスタマーサポートセンターへの\r\n導線も含めて、専門チームが最適なご提案を致します。"]',NULL,'2024-05-28 10:12:26.321219','2024-06-09 07:23:21.543676',NULL,NULL,'要相談','製品画像30.jpeg'),
(28,'株式会社QuackShift','100万円','2023年11月','2名（業務委託を除く）','株式会社QuackShiftはAI活用セミナーや伴走型AIソリューション開発を提供し、AI導入の疑問解消から具体的な業務改善、新事業創出までを全面サポート。お客様のAI活用の道を拓きます。','伴走型AI/LLMソリューション','Quackshiftは、テキスト情報や画像情報などのデータを活用し、AI導入を通じて現場の業務プロセス改善や新規価値創出を実現するスタートアップ企業です。AIサービス構築や社内サービス等に迅速にAI技術を組み込むことができます。','その他',NULL,'なし',true,true,'["\n                \n                費用はどれくらいでしょうか？              \nコンサルティング・開発費用は1プロジェクトあたり200万円~700万円ほどで利用していただくケースが多いです。\r\n工数によって大きく変動いたしますので、一度お気軽にお問い合わせくださいませ。", "\n                \n                対応可能な技術はどのようなものがありますか？              \n生成AI活用をはじめ、OCR（文字認識技術）や物体/異常検知などの画像技術、アプリ内のレコメンド機能開発など幅広くAI技術に対応可能です。\r\nお客様の課題に適したビジネスプロセス改善と技術選定を実施いたします", "\n                \n                他の会社との違いは何ですか？              \n1.ビジネスデザイン担当者/AIエンジニアが在籍している点\r\n2.スピード感のあるコミュニケーション&開発体制\r\nが強みでございます。\r\n顧客の業務内容を深く理解した上で、最適な提案をさせていただきます。"]',NULL,'2024-05-28 10:12:28.747255','2024-06-09 07:23:21.602507',NULL,NULL,'70万円/月〜','製品画像18.jpeg'),
(29,'株式会社ヒューマンサイエンス','3,000万円','1985/3/1','137名','・マニュアル作成・翻訳・教育・eラーニング・AI・アノテーション・人材派遣','MTransforOffice','MicrosoftOfficeプラグインMicrosoftOffice製品（Word・Excel・PowerPoint・Outlook）をワンクリックで翻訳します。自動翻訳で翻訳の納期やコストの削減を実現可能。「ワンクリックで簡単操作​」「Outlook対応」「レイアウト維持」「定額制​」で、誰でも素早く簡単に翻訳できます！ChatGPT連携機能も搭載！','月額',NULL,'100000',true,true,'["\n                \n                Officeに標準でついている自動翻訳機能とはどう違うのですか？              \n翻訳エンジンが異なります。MicrosoftOffice製品に標準搭載されている自動翻訳機能ではMicrosoftの翻訳エンジンが使われます。\r\n\r\nヒューマンサイエンスのMTransforOfficeは、DeepL、Google、Microsoft、ChatGPTなどから選択可能です。\r\n独自にトレーニングしたエンジンを接続することも可能です（カスタマイズ費用がかかります）。\r\nまた、Office2016までの翻訳エンジンは「統計的機械翻訳（SMT）」と呼ばれる古い⽅式の⾃動翻訳です。\r\nMTransforOfficeであれば、Officeのバージョンに関係なく、AIを活用した精度の高い「ニューラル機械翻訳（NMT）」を使用できます。", "\n                \n                Officeのバージョンに制限はありますか？              \nWindowsデスクトップ版のOffice2016/2019、Windowsデスクトップ/Macデスクトップ/Web版のMicrosoft365に対応しています。", "\n                \n                一度に翻訳できる文章量に制限はありますか？              \nありません。", "\n                \n                各翻訳エンジンのセキュリティは？              \nDeepL、Google、Microsoft、ChatGPTはセキュリティが担保されており、情報流用のリスクはありません。", "\n                \n                SSO対応は可能ですか？              \nはい。\r\nSAMLに対応しています。\r\nAzureActiveDirectoryの対応実績はございます。それ以外の方式については別途お問い合わせください。"]',NULL,'2024-05-28 10:12:31.024885','2024-06-09 07:23:21.649636',true,100000,'月額9,000円～','製品画像12.jpeg'),
(30,'インダストリアル・ドリーム株式会社','100万円','2023年5月','1名','国内で初めてLLMを取り入れたwebサービスである創作支援アプリAIBunChoを開発・運営しています。テキスト生成領域の開発を得意としており、概念実証〜デモアプリの構築まで高速に行うことで、素早くAIの効果を測ることができます。','生成AI活用コンサル・受託開発','インダストリアル・ドリーム株式会社が提供する「生成AI活用コンサル・受託開発」はあらゆる企業が最先端の生成AIをビジネスに取り入れ、活用できるようカスタマイズしたサービスをご提供しております。業務の効率化を実現するだけでなく、新たなビジネスチャンスの発掘にも貢献いたします。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:12:33.653143','2024-06-09 07:23:21.705297',NULL,NULL,'お問合せください','製品画像29.jpeg'),
(31,'株式会社スマートアックス','1000万円','2023年3月13日','-','AIシステム受託開発・導入支援法人向け生成AI基盤サービス「TrustyGPT」提供研究・開発活動','TrustyGPT','社内データを学習した、全社員が気軽に使えるChatGPTを実装','その他',NULL,'1000000',NULL,NULL,'["\n                \n                TrustyGPTに入力した情報は漏洩しませんか？              \nはい、ご安心ください。\r\n弊社が提供するサービスはすべて、AIの学習に一切利用されない形でご提供しております。さらに、OpenAI社サーバではなく実績豊富なMicrosoft社Azureを利用することにより金融機関レベルのセキュリティを実現しております。", "\n                \n                外部ツールとの連携は可能ですか？              \nはい、可能です。\r\nSlackやTeams、LINE等の一般的な社内連絡ツールは勿論、Googleサービス（スプレッドシート）等との連携も可能となっております。貴社システムやその他使用ツールへの連携に関しましてもお気軽にご相談ください。", "\n                \n                導入までどれぐらいかかりますか？              \n最短1ヶ月で導入いたします。\r\n導入内容や用途によっては、ヒアリングから最短一ヶ月で導入頂けます。\r\n導入後に貴社のニーズに沿ったカスタマイズを別途行う等も可能であるため、お気軽にご相談ください。", "\n                \n                社外向けのお問い合わせ対応も可能ですか？              \nTrustyGPTは社内向けを想定したチャットボットとなっております。\r\nTrustyGPT単体でのご提供は難しいですが、弊社が行っている「AzureOpenAIService導入支援」サービスとしてご相談頂ければ別途社外向けツールの検証・開発を行うことも可能でございます。"]',NULL,'2024-05-28 10:12:34.998374','2024-06-09 07:23:21.768680',true,1000000,'お問合せください','製品画像13.jpeg'),
