(33,'株式会社ギブリー','1000万円','2009年4月28日','従業員数 120名','ギブリーは「すべての人が物心豊かな社会を実現する」をビジョンに掲げ、OperationDX／MarketingDX／HRTechの3事業を柱に、「世界で必要とされる、本質価値を生むテクノロジー企業体」として、“世界標準”のサービスを生み出し続け、日本の再生に寄与します。','DECAカスタマーサポート','生成AIで顧客対応を自動化するAI-FAQ/AI-チャットボット','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:12:38.701449','2024-06-09 07:23:21.892667',NULL,NULL,'お問合せください','製品画像17.jpeg'),
(34,'JTP株式会社','7.9億円','1987年10月31日','435名','JTP株式会社は、日本に進出する海外のITベンダーやライフサイエンスメーカー向けに、テクニカルサポート、トレーニングなどの技術サービスを提供する会社として、1987年に設立されました。ミッションに「ConnecttotheFutrue」を掲げ、幅広い企業のニーズに対してITシステム設計・構築・運用・保守サービスや、サイバーセキュリティサービス、人材育成コンサルティングサービスのほか、人工知能の導入によりビジネスにおける顧客接点の最適化を実現するソリューション「ThirdAI」を提供しています。','ThirdAI生成AIソリューション','JTPが提供する「ThirdAI生成AIソリューション」はセキュアな環境において生成AIを直感的なUIで利用できるサービス。社内データと連携し活用いただくオプションも提供しています。','その他',NULL,'3000000',true,NULL,'["\n                \n                どんな業界への導入実績がありますか？              \n自治体、金融、製造、商社など国内大手企業を中心に、多岐にわたるお客様に採用いただいております。\r\n業種問わずさまざまな企業・団体様に活用いただけるサービスです。"]',NULL,'2024-05-28 10:12:41.179762','2024-06-09 07:23:21.954461',true,3000000,'200,000円～ （データ連携を利用する場合は追加料金が発生します）','製品画像18.jpeg'),
(35,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','SalesforceServiceAI','Salesforceが提供する「ServiceAI」は信頼できるCRMデータを活用した生成AIの提供によりサービス業務を自動化、エージェントの生産性を高め、迅速な問合せ解決を促進します','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:12:43.568301','2024-06-09 07:23:22.021046',NULL,NULL,'お問合せください','製品画像4.jpeg'),
