(37,'株式会社Kiei','-','2023年3月','-','Kieiは"日本を「気鋭」の国に"をミッションとするAIカンパニーです。各産業へのAI技術の実装を通じて日本の競争力を引き上げ、国としてのモメンタムを取り戻します。','AI・DXコンサルティング事業LLM・ChatGPT','株式会社Kieiが提供する「AI・DXコンサルティング事業」は多数のプロジェクトを成功させてきたコンサルタントをアサインし、AI・DX戦略の立案から実行推進まで泥臭く伴走します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:12:48.980865','2024-06-09 07:23:22.205617',NULL,NULL,'お問合せください','製品画像29.jpeg'),
(38,'株式会社リベルクラフト','500,000円','2021年12月','1〜10名','インターネット、データ、データ分析、人工知能（AI）に関するコンサルティング、設計、開発、教育','AI・データ活用コンサルティング・受託開発支援','AI開発・導入からビジネスコンサルティング、書籍出版まで幅広い領域での実績があるデータサイエンティストが、AI・データ活用に関して川上から川下までフルラインナップでご支援いたします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \n月に数回のアドバイザリから毎月のAIモデル開発・データ解析など多岐に渡りご支援させていただいておりますため、支援内容によって費用感は異なります。大変お手数をおかけいたしますが、一度ご面談の上で概算のお見積りをお出しします。", "\n                \n                まだ明確な要件は決まってないのですが、相談しても良いのでしょうか？              \n要件が未確定の段階のお客様がほとんどとなりますため、お気軽にお問い合わせください。弊社の専門家が壁打ち相手となり、素早く要件検討をご支援いたします。"]',NULL,'2024-05-28 10:12:51.309103','2024-06-09 07:23:22.263720',NULL,NULL,'お問合せください','製品画像12.jpeg'),
(39,'株式会社スニフアウト','100万円','2022年11月','10名','株式会社スニフアウトは「科学で世界をビルドする」をPurposeに掲げ、⽣成AIをはじめとする学術研究の知⾒を持つサイエンティスト集団によってイノベーションを創⽣するスタートアップです。','PromptCamp','ChatGPTをはじめとする生成AIの普及をリードするプロ人材へ様々な生成AIの活用やプロンプトエンジニアリングについて基礎から応用まで幅広く学習可能！','月額',NULL,'なし',NULL,true,'["\n                \n                法人向けプランはありますか？              \nございます。法人様に合った内容を個別にご提案いたしますのでお問い合わせください。", "\n                \n                お試しは可能ですか？              \n可能です。無料会員登録で１章を無料で観ることができます。", "\n                \n                いつでも解約は可能ですか？              \n可能です。次回の月会費の支払日の「前日までに」退会の申請をお願いいたします。"]',NULL,'2024-05-28 10:12:53.536560','2024-06-09 07:23:22.312554',NULL,NULL,'月額19,800円','製品画像7.jpeg'),
(40,'DXHR株式会社','-','2014年7月','-','人材事業（人材紹介、派遣、業務委託）事業開発・コンサルティング事業M&A支援事業（FA・仲介）','SEC-AI','SEC-AI（セカイ）は、「研修後すぐに業務に活かせる実践力が身に付く」AIとセキュリティのトレーニングセンターです。中でも生成AI研修は、幅広い業種・職種で業務改善や生産性向上につながる、とてもニーズが高い研修です。当サービスではChatGPT等の生成AI活用に向けた研修を、1000以上のカリキュラムを組み合わせ、業種・職種・レベルに合わせて提供しています。国の人材開発支援助成金や東京都のDXリスキリング助成金を活用し、企業の負担を75～50％軽減して受講することが可能です。昨年2023年下半期で3000名超の受講生を輩出し、満足度は94.7％（自社アンケート調べ）でした。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:12:55.978392','2024-06-09 07:23:22.355613',NULL,NULL,'お問合せください','製品画像15.jpeg'),
