(42,'株式会社グラファー','1,544,977,927円','2017年7月','61名','グラファーは「プロダクトの力で行動を変え社会を変える」をミッションに掲げ、生成AIのビジネス活用を実現する「GrafferAISolution」や、市民と行政職員の利便性を追求したデジタル行政プラットフォームを提供。','GrafferAISolution','株式会社グラファーが提供する「GrafferAISolution」は、これまで170以上の行政機関へのサービス提供実績をふまえた安心の環境でChatGPTを活用できるプロダクトのほか、導入・活用伴走支援や研修・人材育成を提供しています。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:13:00.880869','2024-06-09 07:23:22.445650',NULL,NULL,'プランによるためご相談ください。','製品画像26.jpeg'),
(43,'株式会社スクーティー','2,898万円','2015年11月25日','-','・ベトナムオフショア開発・ラボ型開発サービス・生成AIコンサルティングサービス・ベトナム視察ツアーアテンドサービス・安全な環境でChatGPT「セキュアGAIforenterprise」・AIが接客「バーチャルアシスタント」','セキュアGAI','セキュアGAIforenterpriseで、安全にChatGPTを使用できます。AzureOpenAIAPIserviceを使用して、Azureのプライベートな環境内で完結するChatGPTと同様の機能を提供します。','その他',NULL,NULL,NULL,NULL,'["\n                \n                最低契約期間はどのくらいですか              \n最低契約期間は６ヶ月となっております。途中解約による払い戻しは行なっておりませんので、予めご了承ください。", "\n                \n                最低利用人数はどのくらいですか              \n10名以上からのご契約となっております。ご利用の目的に合わせた最適なプランをお見積りいたしますので、お気軽にご相談ください。", "\n                \n                初期費用は、ユーザーアカウントを追加発行する度にかかりますか              \nいいえ。利用開始月末締め翌月末払いで、1回のみかかります。", "\n                \n                ベーシックプランからプロプランにアップグレードする際には初期費用がかかりますか              \n初期費用の差分のみ頂きます。ただし、プロプランからベーシックプランへのダウングレード時には初期費用の払い戻しは行なっておりませんので、予めご了承ください。", "\n                \n                チャットの履歴はどれくらいの期間保存されますか？              \n3ヶ月保存されます。"]',NULL,'2024-05-28 10:13:02.162348','2024-06-09 07:23:22.491628',NULL,NULL,'お問合せください','製品画像19.jpeg'),
(44,'株式会社スクーティー','2,898万円','2015年11月25日','-','・ベトナムオフショア開発・ラボ型開発サービス・生成AIコンサルティングサービス・ベトナム視察ツアーアテンドサービス・安全な環境でChatGPT「セキュアGAIforenterprise」・AIが接客「バーチャルアシスタント」','ChatGPTラボ型開発サービス','ChatGPTとのシステム連携をお考えでしたら、ChatGPTラボ型開発サービスをご利用ください！ベトナムの優秀なエンジニアチームを即座に組成し、PoCを開始できます。ヒアリングは無料実施！','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:13:04.659279','2024-06-09 07:23:22.535993',NULL,NULL,'お問合せください','製品画像17.jpeg'),
(45,'株式会社GFLOPS','300万円','2023年11月','~10名','GFLOPSは「情報を加速させること」が「時間を大切にする」ことに繋がると信じており、最新のAI技術を用いたプロダクトを作り、グローバルに展開しています。','ChatWidgetGPT','ChatWidgetGPTは、生成AIを用いたチャットツールです。たった1つのコードを自社サイトに埋め込むだけで導入できます。あなたがアップロードした資料のみをデータソースとして回答させます。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:13:07.008623','2024-06-09 07:23:22.584033',NULL,NULL,'要お問い合わせ','製品画像2.jpeg'),
(46,'株式会社ワントゥーテン','資本金253百万円（資本準備金289百万円）','1997年創業','-','先端テクノロジーによる社会課題解決をテーマに、AI技術を駆使したサービス開発やプロジェクションマッピングとXRを活用した数々のプロジェクトを日本国内及び世界各国で展開する。大阪・関西万博デザインシステム、京都二条城やシンガポールでの巨大ランドプロジェクションマッピング、パラスポーツをデジタルでアップデートした「サイバーボッチャ」など先進的なプロジェクト多数。','QURIOSAGENT｜働く人をアシストする多言語対応AIエージェント','インバウンド接客でも活躍。働く人と、多言語対応AIエージェントが共に創る次世代の営業・接客アプローチです。事前に設定した業務マニュアルや商品情報などの資料を基に、AIエージェントがスタッフからの質問に即時に適切な回答を提供したり、さまざまな状況に合わせた最適な対応策を提案します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:13:09.491522','2024-06-09 07:23:22.650821',NULL,NULL,'お問合せください','製品画像7.jpeg'),
(47,'KICKZAISSUE株式会社','1000万円','2022年3月','5名','KICKZAISSUE株式会社は「テクノロジーとコンサルティングをもっと身近に」をミッションに掲げ、各種ITコンサルティング・ITアドバイザリー・IT教育・コンサルタントマッチングサービスの運営・メディア事業を行っております。','KICK　SEARCH','KICKZAISSUE株式会社が提供する「KICKSEARCH」は対話形式で社内に蓄積されたナレッジを無制限に検索し回答を生成することができる、次世代のナレッジ検索サービスです。','月額',NULL,'1000000',NULL,true,'["\n                \n                GPT4を利用することはできますか？              \nはい、可能です。2023年12月現在、Azure環境で利用できるGPTモデルは3.5/3.5turbo/4になります。今後OpenAI社によるアップデートにより、GPT4turbo以降が利用できる可能性があります。", "\n                \n                料金はどのような条件で変わりますか？              \n初期構築費用は、お客様の構築環境（ファイルサーバーの種類やチャットルーツの種類）、標準機能以外の追加要望有無により変動します。\r\n月額費用は、従量課金による環境利用料、弊社のサポート費用により成り立っており、月間の検索回数やサポート内容によって変動します。", "\n                \n                契約形態について教えてください              \nKICKSEARCHはお客様環境で構築されるサービスです。構築されたサービスの使用権のみをお客様へ契約期間中貸与する契約となり、お客様による複製/改変はできません。契約期間満了後、構築させていただいた環境を破棄させて頂きます。", "\n                \n                契約期間後のデータはどうなりますか？              \n契約期間中に発生した検索履歴は構築された環境内に保管されます。この検索履歴の所有権はお客様に帰属するため、契約期間が終了し環境が破棄される場合でも検索履歴はお客様にて引き続き保持することが可能です。検索対象のデータに関しても同様です。", "\n                \n                継続サポートにはどのような内容がありますか？              \n継続サポートはお客様の社内定着を支援させていただく目的で実施致します。具体的には、利用方法に対する問い合わせ対応・データやモデルのチューニングが主なサポート内容です。お客様のご利用目的に合わせたサポートを柔軟に提案することが可能ですので、お気軽にお問い合わせください。", "\n                \n                構築された開発物の所有権を主張することはできますか？              \n基本的に出来ません。弊社が所有権を持ち、お客様には使用権のみ与えられます。検索対象データと検索履歴データの所有権はお客様に帰属されます。", "\n                \n                GPTによる回答を社内のデータに限定することはできますか？              \n可能です。回答生成元を社内データに限定するか、外部情報も含めるかを選択することが可能です。ユースケースに応じて使い分けることをお勧めしています。", "\n                \n                最低利用期間はありますか？              \n最低利用期間は6ヶ月です。"]',NULL,'2024-05-28 10:13:11.763774','2024-06-09 07:23:22.719264',true,1000000,'月額費用 10万円〜','製品画像13.jpeg'),
(48,'ソフトバンク株式会社','204,309百万円（2023年3月31日現在）','1986年（昭和61年）12月9日','/','移動通信サービスの提供、携帯端末の販売、固定通信サービスの提供、インターネット接続サービスの提供その中でTASUKIAnnotationサービスは、ソフトバンクの注力分野であるAIの開発を加速・支援するアノテーション事業・生成AI用データ構造化事業を行っています。','TASUKIAnnotation','ソフトバンク株式会社が提供する「TASUKIAnnotation」は社内データの構造化の代行により、RAGの検索精度向上の支援を行います。特に、ChatGPT等のLLMが解釈を苦手としている図表などの情報も回答させることが可能になります。','その他',NULL,'なし',true,NULL,'["\n                \n                どのような種類のデータを構造化できますか？              \nWord、Excel、pdf、html等、様々な形式のデータの構造化が可能です。", "\n                \n                セキュリティが心配です。データはどのような形で管理されていますか？              \n高いセキュリティ基準でお客様のデータを守りながら、データ構造化の代行を行わせていただきます。", "\n                \n                zoom等のオンラインでの打ち合わせは可能でしょうか？              \n可能です。ZoomやGoogleMeetなどのツールを使用し、オンラインでのお打ち合わせを実施させていただきます。\r\n初回のご相談時もご発注後の定期的な打ち合わせもオンラインでの対応が可能です。"]',NULL,'2024-05-28 10:13:14.408564','2024-06-09 07:23:22.789089',NULL,NULL,'案件詳細を伺ってお見積りいたします。','製品画像20.jpeg'),
(49,'株式会社AIイノベーションズ','650万6,000円','2017年11月','5名（パート等含む）','株式会社AIイノベーションズは、生成AIに特化した人材育成サービスの企業です。生成AIの研修やeラーニング、そして導入・利活用コンサルティングをご提供します。','生成AI研修・eラーニングサービス','eラーニングや研修・ワークショップ等によって、企業によるAI活用・DXのための人材育成を徹底サポートします。その後の実際の活用フェーズにおいてもコンサルティングサービスも提供します。','ユーザー',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:13:16.875006','2024-06-09 07:23:22.848659',NULL,NULL,'eラーニング：1000円/名 研修：1万円/名  ※最低価格がございます。また人数によってボリュームディスカウントとして割引をご案内しております。','製品画像29.jpeg'),
(50,'株式会社調和技研','資本金 169,964,650円、資本準備金 169,964,650円','2009年11月','90名','DX/AIコンサルティングから、AI受託開発・導入支援、ChatGPT/LLM導入支援、AI人材育成まで、企業・団体におけるAI活用全般を支援しています。','オーダーメイドAI開発・運用支援','調和技研が提供する「オーダーメイドAI開発・運用支援」は、15年に渡り積み重ねてきた幅広いAI開発ノウハウと、独自開発のAIエンジン群を活用して、お客様の課題を解決する独自AIをスピーディに開発します。','その他',NULL,NULL,true,NULL,'["\n                \n                オーダーメイドAIの開発にはどれくらいの期間がかかりますか？              \n開発内容によって要する時間は大きく変動しますが、PoCに2～6ヶ月、システム構築とAI実装に4ヶ月程度かかるケースが多いです。\r\n詳しくはご相談ください。", "\n                \n                AIに関する知識がまったくないですが大丈夫でしょうか？              \nAI自体がまだ新しい領域であり、AIを初めて開発・導入されるお客様が大半です。\r\n当社はDX/AIコンサルティングサービスによりAI活用の初歩からご提案が可能です。\r\nご不明点や懸念点等を丁寧にクリアにしながらプロジェクトを進めていきますので、どうぞご安心ください。", "\n                \n                開発したAIはクラウドで提供されるのですか？              \nクラウドだけでなくオンプレミス、エッジデバイス等、ご要望に応じた形で開発・提供しますので、まずはAIで実現されたいことをお聞かせください。", "\n                \n                開発完了後、AIの利用に対して継続的に費用がかかりますか？              \n当社が保有するAIエンジンのライセンス利用料を頂戴しております。詳しくはお打ち合わせにてご説明させていただきます。"]',NULL,'2024-05-28 10:13:19.206033','2024-06-09 07:23:22.913955',NULL,NULL,'お問合せください','製品画像30.jpeg'),
(51,'株式会社わさび','500万円','2020年2月','70名(正社員)','CX（カスタマーエクスペリエンス）を軸に生成AIを活用したアプリケーション開発やデータ分析、コンサルティング事業を行っております。','WASABIGenAI','わさびが提供する生成AIの開発支援サービス「WASABIGenAI」はどの企業様でも最新の生成AIを業務活用していただけるように作られたサービスです。業務効率化だけでなく新しいビジネス機会の創出をサポートいたします。','月額',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:13:21.604458','2024-06-09 07:23:22.986066',NULL,NULL,'月額15万円から','製品画像5.jpeg'),
(52,'株式会社AIdeaLab','3690万円(資本準備金を含む)','2021年1月14日','/','「AI×Idea」圧倒的技術で、いまだかつてないプロダクトを0から生み出すエンジニア集団。','オンプレミス対応社内ChatAI','社内データやナレッジをセキュアに活用し、その会社に特化したChatGPTを構築することで、組織の生産性アップに繋がります。','月額',NULL,NULL,NULL,NULL,'["\n                \n                ChatGPTとは何が違いますか？              \nChatGPTはOpenAI社が提供する生成AIチャットツールです。ChatGPTではチャットの内容が言語モデルの学習に使用されるため、情報漏洩リスクやセキュリティ上の懸念がございます。一方で、社内CAIはOpenAIのAPIを活用したサービスで、チャットの内容が外部に送信されないのが最大の特徴です。", "\n                \n                セキュリティ対策はどのようになっていますか？              \n学習データとしての利用阻止・禁止ワード登録・ユーザーログ確認・機密情報ブロック機能など、安心して使っていただけるためのセキュリティ対策機能を用意しています。また希望があれば、オンプレやそれぞれのクラウド環境で使えるようにすることができます。", "\n                \n                業界特化のAIモデルはどのような仕組みですか？              \n会計や法務に関する正確な知識を、質問に応じて自動で参照することで、より正確で専門的な回答を作成できるようにしたものです。"]',NULL,'2024-05-28 10:13:24.030745','2024-06-09 07:23:23.046491',NULL,NULL,'ビジネス｜月額980円 / 人 ~エンタープライズ｜お見積りください','製品画像16.jpeg'),
(53,'Advancy株式会社','1500万円','2023年3月','10人程度','Advancyは、AIとデジタルトランスフォーメーションの統合ソリューションを提供し、各種ビジネスプロセスの強化と新たな価値創造をサポートしています。データ分析とAI開発を通じて、企業のデジタル変革を加速させることを目指しています。','AdvancyAIチャットボット','東大発AIスタートアップが、お客様用にカスタマイズされたAIチャットボットを開発・導入いたします。Advancy株式会社が提供するAIチャットボットは、お客様の社内データをもとにして目的に沿った回答を正確に生成します。個別開発だからこそ、正確性と機動性、安全性が実現できます。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:13:26.341634','2024-06-09 07:23:23.092497',NULL,NULL,'お問合せください','製品画像11.jpeg'),
(54,'株式会社Helpfeel','1億円','2020年12月','100名','知識を届けるエンタープライズサーチ「Helpfeel」、知識を磨き上げるアイディエーションツール「Scrapbox」、情報を知識にするメディアキャプチャー「Gyazo」の開発運用','Helpfeel','株式会社Helpfeelが提供する「Helpfeel」は、圧倒的検索ヒット率を誇る革新的FAQシステム。AIと人の力で従来FAQの50倍に拡張された質問予測パターンで、曖昧な言葉の表現やスペルミスにも対応し、正しい回答記事に導きます。','その他',NULL,NULL,true,NULL,'["\n                \n                うちの会社はFAQをウェブサイトに公開していないのですが              \nHelpfeelはFAQのウェブサイトとしてご利用いただけます。\r\n御社でFAQの回答文をご準備いただけましたら、Helpfeelのセットアップは弊社にて行います。", "\n                \n                別のFAQシステムを使っていますが、乗り換えは可能ですか？              \nHelpfeelは、検索ヒット率向上に特化したモジュールとして既存のFAQシステムに組み込んでいただくことが可能です。\r\n実際、他社FAQシステムと併用する形で導入いただいている企業様も少なくありません。", "\n                \n                うちの業界は専門用語ばかりだから、FAQページを改善するのも難しいでしょうか              \n専門用語が多用されている金融・医療の業界での導入事例もございます。\r\nHelpfeelは業界を問わずFAQページの劇的な改善を実現できるFAQシステムです。", "\n                \n                FAQページだけではなく、カスタマーサポート全体を見直したいのですが              \nFAQページのみならず、電話やメールによる問い合わせへの対応を行うカスタマーサポートセンターへの\r\n導線も含めて、専門チームが最適なご提案を致します。"]',NULL,'2024-05-28 10:13:28.884847','2024-06-09 07:23:23.138020',NULL,NULL,'要相談','製品画像21.jpeg'),
(55,'株式会社GFLOPS','300万円','2023年11月','~10名','GFLOPSは「情報を加速させること」が「時間を大切にする」ことに繋がると信じており、最新のAI技術を用いたプロダクトを作り、グローバルに展開しています。','AIkotoba','AIkotobaは生成AIを用いた多言語翻訳チャットです。相手がどんな言語でメッセージを送っても、あなたは滑らかな日本語でメッセージを受け取り、あなたの日本語メッセージは相手の言語に翻訳されます。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:13:31.144638','2024-06-09 07:23:23.183843',NULL,NULL,'お問合せください','製品画像11.jpeg'),
(56,'株式会社カトルセ','100万円','2019年12月','～10名','株式会社カトルセが提供する「ネクストAI」はChatGPT・生成AIに特化した企業研修を提供しています。知識だけでなく、業務にどう活かすかを開発経験を元にレクチャーし、企業と一緒に伴走していきます。','ネクストAI','株式会社カトルセが提供する「ネクストAI」は生成AI/ChatGPTに特化した企業研修です。日本トップレベルのプロンプトエンジニアから「ChatGPTを基礎から学べ」、「実践・添削でプロンプト力を高められ」、「業務改善やオリジナルツール開発のコンサルティングを受けて成果を出せる」サービスです。情報収集フェーズから開発運用フェーズまで伴走します。','その他',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:13:32.245153','2024-06-09 07:23:23.235657',NULL,NULL,'1名あたり36,000円（税抜）～','製品画像9.jpeg'),
(57,'株式会社ファースト・オートメーション',' 6,850万円',' 2020年9月1日','-','AIクラウドサービスの開発・運営工場自動化支援サービスの運営','SPESILL','Word・Excel文書の作成/RAG搭載/複数のLLMと連携','その他',NULL,NULL,NULL,NULL,'["\n                \n                AIの学習データが外部に提供されることはありますか？              \n企業様毎にクローズドな環境を構築しております。また、GPTとはAPI連携をしており、そこでやり取りされるデータは学習されません。\r\n上記のことからAIが学習したデータが外部に提供されることは一切ございません。", "\n                \n                どのような環境で使用できますか？              \nインターネット環境さえあればどこでも利用が可能です。\r\nブラウザはGoogleChromeおよびMicrosoftEdgeを推奨しております。", "\n                \n                ソフトウェアのインストールは必要ですか？              \n必要ありません。ブラウザでお使いいただけます。", "\n                \n                費用感を教えてください              \n企業様の規模によって都度お見積りをさせて頂いております。\r\nまずはお気軽にお問い合わせくださいませ。", "\n                \n                自社仕様にカスタマイズすることは可能ですか？              \nご要望をいただけましたら貴社仕様にカスタマイズしご提供することは可能です。OEM提供も取り組んでいます。\r\nまた、技術を応用して、貴社のご要望に応えるサービスの開発提供も可能です。\r\nまずはお気軽にお問い合わせくださいませ。"]',NULL,'2024-05-28 10:13:34.982689','2024-06-09 07:23:23.284875',NULL,NULL,'お問合せください','製品画像22.jpeg'),
(58,'株式会社AVILEN','5176万円','2018年8月','正社員：54名 (2023年12月末時点) AVILEN DS-Hub：237名 (2023年12月末時点)','「データとアルゴリズムで、人類を豊かにする」を掲げ、「テクノロジー活用アビリティ強化」と「AI搭載ソフトウェアによる課題解決」をはじめとしたAIソリューションを提供しています。','ChatGPT活用1day研修','「ChatGPT活用1day研修」は、ChatGPTの基礎知識から実践までを短時間で学べるオンライン講座。ライブ講座形式で実施し、個社向けのプロンプト例など導入効果を最大限に引き出すヒントを提供します。','ユーザー',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:13:37.410864','2024-06-09 07:23:23.343774',NULL,NULL,'講座準備・実施・テキストの3費用構成となっており、実施回数・参加人数に応じて最終的な金額をお見積致します。 ・講座準備費用：20万円〜/社（プロンプト例の作成などカスタマイズ費用。ご希望される難易度に応じて別途お見積） ・講座実施費用：40万円/回（1回あたりの最大参加人数は20名様まで。ご希望に応じた回数をご提供致します） ・テキスト費用： 1万円/人（講座で使用する資料は事前配布致します）  その他、別途ご要望がございます際も柔軟にご対応しますので、お気軽にお問い合わせください。','製品画像24.jpeg'),
(59,'株式会社AVILEN','5176万円','2018年8月','正社員：54名 (2023年12月末時点) AVILEN DS-Hub：237名 (2023年12月末時点)','「データとアルゴリズムで、人類を豊かにする」を掲げ、「テクノロジー活用アビリティ強化」と「AI搭載ソフトウェアによる課題解決」をはじめとしたAIソリューションを提供しています。','ChatGPTビジネス研修','株式会社AVILENが提供する「ChatGPTビジネス研修」はChatGPTの活用を「学ぶ〜試す〜思考」まで実務に結びつけながら1日で学習できるサービスです。日本e-Learning大賞2023にて「生成AI特別部門賞」を受賞しました。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:13:38.496788','2024-06-09 07:23:23.412514',NULL,NULL,'1名あたり11,000円（税込）／最低50名以上から受講可能。 その他、カスタマイズによるオフライン講義など柔軟にご対応しますので、お気軽にお問い合わせください。','製品画像23.jpeg'),
(60,'株式会社EastgateSoftwareJapan','150名','2014年','-','当社はベトナムをはじめ、ドイツ、オーストラリア、日本に拠点を持つソフトウェア開発企業で、ドイツの大手電機メーカーのシーメンス様をはじめ、世界15カ国、50社以上の企業様へ開発した実績があります。','生成AI開発　自然言語処理　画像/映像解析','株式会社EastgateSoftwareJapanが提供する「生成AI開発　自然言語処理　画像/映像解析」はドイツ大手電機メーカー(シーメンス社)をはじめ、世界15カ国、製造や物流、金融など50社以上の企業様へ開発した実績があり、特に生成AIや自然言語処理、画像/映像解析等の開発を得意としております。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:13:40.762911','2024-06-09 07:23:23.539735',NULL,NULL,'お問合せください','製品画像25.jpeg'),
(61,'モビルス株式会社','438,827,039円（2023年8月31日現在）','2011年9月','/','モビルスは、テクノロジーでサポートを新しくする、TheSupportTechCompanyです。コンタクトセンター向けSaaSプロダクト（モビシリーズ）などのCXソリューションを提供しております。','MOBIAGENT','コールセンターでの高度なチャットサポートを実現する「MOBIAGENT（モビエージェント）」。チャットボットとのスムーズな連携、Salesoforce・CRM連携により、電話対応に比べ、大幅なサポートコストの削減、業務の効率化、顧客満足度の向上が可能になります。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:13:43.164860','2024-06-09 07:23:23.583542',NULL,NULL,'詳細はお問い合わせください','製品画像28.jpeg'),
(62,'株式会社キカガク','20,499,140 円','2017年1月','86 名','株式会社キカガクは、「教育」を軸に人材領域で企業のDXを支援しています。','デジタルスキル標準対応「DX人材育成研修」','株式会社キカガクが提供する「DX人材育成研修」は、デジタルスキル標準に準拠した人材育成を提供しています。人材育成計画の策定から内製化までを一気通貫でサポートいたします。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:13:44.298543','2024-06-09 07:23:23.628492',NULL,NULL,'要相談','製品画像12.jpeg'),
(63,'株式会社キカガク','20,499,140 円','2017年1月','86 名','株式会社キカガクは、「教育」を軸に人材領域で企業のDXを支援しています。','AIコンサルティングサービス','株式会社キカガクが提供する「AIコンサルティングサービス」は、DX・AIでビジネス成果を支援します。AIシステム開発、データ分析・活用、データ分析基盤構築、ChatGPT/AzureOpenAI導入支援といった様々なソリューションをご用意しています。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:13:46.691453','2024-06-09 07:23:23.730525',NULL,NULL,'要相談','製品画像28.jpeg'),
(64,'株式会社SalesMarker','1億円','2021年7月','116名（取締役4名+業務委託を含む）','セールスインテリジェンスSalesMarkerの開発・運用','SalesMarker','〜これからの営業は、ニーズが顕在化された企業だけにアプローチする時代〜　株式会社SalesMarkerが提供する「SalesMarker」は、新時代の営業手法「インテントセールス」の実現を可能にするBtoB向けセールスインテリジェンスです。約500万法人の企業データベースとインテントデータ（興味関心データ）を活用し、ニーズのある企業を的確にターゲティングし、キーマンへの自動アプローチを実現し、商談獲得成功率を劇的に向上させます。','その他',NULL,NULL,NULL,NULL,'["\n                \n                インテントデータとは？（興味関心データとは？）              \nインテントデータとは、顧客が何に興味や関心を持っているのかを知ることができる行動データのことです。", "\n                \n                セールスインテリジェンスとは？              \nセールスインテリジェンスとは、自社の潜在顧客とそのニーズを分析し効率的にアプローチするのに役立つソリューションのことです。主にセールスチームやマーケティングチームが、インターネットの行動履歴データから潜在顧客のニーズを分析し、自社製品やサービスのニーズを持つターゲット顧客に的確なアプローチをするために活用します。", "\n                \n                うまく使えるか不安です。サポート体制を教えてください              \nご安心ください。セールスの実績のある弊社カスタマーサクセスが、導入から実運用開始、定着まで1〜3ヶ月間サポート致します。その後サービスのご利用期間中は、お問い合わせで対応をさせていただきます。", "\n                \n                最短、いつから使用可能ですか？              \n資料のご請求・お打ち合わせ後、最短3日後にご利用が開始できます。"]',NULL,'2024-05-28 10:13:47.720822','2024-06-09 07:23:23.780217',NULL,NULL,'詳しくはお問い合わせください。','製品画像11.jpeg'),
(65,'株式会社マルジュ','1,000万円','1999年11月17日','25名','各種パッケージ商品企画・開発・販売・保守ホームページ制作、Webサービスの企画・運営Webモバイル・アプリケーションの受託開発','ANDASU','人材ビジネス業界向けAIライティングサポートツール株式会社マルジュが提供する「ANDASU（アンダス）」は、ChatGPTを利用した求人情報や自己PR文に肉付けして「ええ感じ」にした案を出す、AIライティングサポートツールです。','月額',NULL,'0',true,NULL,'[]',NULL,'2024-05-28 10:13:49.941255','2024-06-09 07:23:23.834717',NULL,NULL,'完全従量プラン　200円/件  ベーシックプラン　月額10,000円　チケット50枚　追加チケット150円/件','製品画像17.jpeg'),
(66,'パーソルプロセス＆テクノロジー株式会社','3億1千万円','1977年9月','5,727名（2023年3月1日時点）','業務プロセスコンサルティング、システム企画・開発、システム運用・保守、パッケージソフト導入及び保守運用、インフラ設計構築、クラウドサービス、ICT・エネルギー・セールスアウトソーシング等','AzureOpenAIService導入サポート','パーソルプロセス＆テクノロジー株式会社が提供する「AzureOpenAIService導入サポート」はChatGPTの機能を活用し、社内業務を効率化するための環境構築から導入、活用支援までをワンストップで支援します。お客様の目的や課題に応じて支援内容はカスタマイズが可能です。','その他',NULL,NULL,true,NULL,'["\n                \n                OpenAIとAzure OpenAIの違いは？              \nOpenAIはChatGPTの開発元会社です。公式サイトからの登録でChatGPTのブラウザ利用やAPI利用が可能です。登録や決済は個人ごとに行う必要があります。\r\nAzureOpenAIはMicrosoftのAzure環境内でChatGPTを利用できるサービスです。組織で環境開発を行い、アカウント発行や決済ができること、セキュアな環境構築ができる点がメリットとしてあります。"]',NULL,'2024-05-28 10:13:51.002383','2024-06-09 07:23:23.885981',NULL,NULL,'お問合せください','製品画像19.jpeg'),
(67,'株式会社ベルテクス・パートナーズ','4,000万円','2015年7月1日','69名（2023年7月現在）','戦略策定／実行支援・新規事業創出・ビジネスプロセス・テクノロジー・先進ソリューション活用等に関するコンサルティングサービス事業共創・新規事業プロデュース','生成AI活用支援サービス','成果を迅速に。プロフェッショナルが伴走サポート　株式会社ベルテクス・パートナーズが提供するクイックに成果を生み出す「生成AI活用支援サービス」は、生成AIを活用した「新規事業」や「業務効率化」の、テーマ検討から本格展開までを一気通貫でご支援します。「定額支援パック」では、定額制で包括的にご支援も可能です。','その他',NULL,'1000000',true,NULL,'["\n                \n                【サポート内容】\r\nサービスを利用する場合、どのようなサポートができるか？              \n生成AI活用の企画アイデア出し、具体化、プロトタイプ開発、ルール作成、リテラシー研修など、一気通貫でのサポートが可能です。\r\nプロトタイプ開発後は、精度を高めるためのチューニングや活用高度化のためのコンサルティングサービスも提供致します。\r\n貴社業界やテーマに精通したコンサルタントをアサインして進行致しますので、ご安心ください。", "\n                \n                【セキュリティ】\r\n自社の機密情報を利用したいが、セキュリティな環境で利用できるか？              \nMicrosoft社が提供するAzureOpenAIServiceで構築することで、セキュアな環境を実現します。\r\n（パブリック空間だけではなく、プライベート空間での利用も可能となります）", "\n                \n                【費用】\r\nどのくらい成果が見込めるかわからないため、費用の妥当性がわからない              \n費用は実現されたい内容や規模に応じて異なりますので、ご要件をお伺いしてお見積りを致します。\r\n早期にトライアルを進めたい場合は、「生成AI活用定額支援パック」をオススメします。\r\n企画、効果試算、プロトタイプ開発、ルール作成などを、定額制で包括的にご支援致します。"]',NULL,'2024-05-28 10:13:53.566044','2024-06-09 07:23:23.927341',true,1000000,'100万円～','製品画像29.jpeg'),
