(69,'株式会社ニュウジア','94,500,000円','2008年12月1日','3名','ニュウジアは、“世界最高峰のAIテクノロジー”を、日本市場向けにカスタマイズして提供します！AIモデル訓練と改善には大量かつ質の高いデータが必要です。そして、研究開発と人材においては、世界中から集まるようなトップクラスの投資と人材が必要です。さらには、規模の経済も重要です。私たちは海外の優れた最先端のAIテクノロジーを、いち早く日本市場にカスタマイズして提供してまいります。','NiumanAI','海外にて多数の導入実績があることでサービスの安定性が高く、導入企業の経営の合理化や売上の増加などへの寄与を実現しています。株式会社ニュウジアが提供する「NiumanAI」は様々なビジネス分野での活用が可能です。・多言語対応・ショップアシスタント・企業の広報、観光案内・モデルやイメージキャラクターAIデジタルヒューマンには病気もケガもなく、24時間365日稼働し続けます。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:13:58.195967','2024-06-09 07:23:24.051597',NULL,NULL,'1分500円～','製品画像24.jpeg'),
(70,'NDIソリューションズ株式会社','４億円','1994年10月1日','397名（2023年4月）','ＤＸ（デジタルトランスフォーメーション）支援ならびにIT関連製品販売および当製品をプラット・フォームとするシステム開発と、アプリケーション・パッケージを活用したトータル・ソリューションの提供','ChatGPT連携チャットボットCB3','新たなユーザーインターフェースCB3／CB3LiteEditionから業務システムへつながります。NDIソリューションズが提供するCB3は社内外の問い合わせ対応などでご利用いただけるAIチャットボットです。ChatGPT連携により質問に対する回答機能の強化や、質問文の自動生成機能を実現しています。','月額',300000,'36000003250000',true,true,'["\n                \n                導入のための支援サービスはありますか？              \nAIチャットボットの運用では、質問者の意図に対して、より適切に回答を返せるように調整・改善するチューニング作業が必要になります。\r\nチューニング作業を行う時間やリソースが足りない場合は、弊社にて再評価シートの作成と、チューニング方針のアドバイスを行うことのできる「チューニング支援サービス」をご用意しております。", "\n                \n                社内と社外の問い合わせどちらに使えますか？              \n社内・社外のお問い合わせどちらでも使えます。\r\nただし、サイト数が２つ必要となるため、社内外両方で使う場合は、CB3の契約が必要です。", "\n                \n                質問文のパターンは自社で作成しなければなりませんか？              \nいいえ、一つの質問文さえあれば、データセットジェネレーター機能を使うことで質問文のパターンを１クリックで増やすことが可能です。", "\n                \n                NDISのCBxシリーズを導入するメリット教えてください。              \n当社では、ショールームポリシーの元、自社活用しているサービスをご提供します。\r\nもちろんCBxシリーズも自社で活用しており、外部システム連携などのノウハウもございますので、効果的な使い方や運用の仕方も併せてご提案できます。"]',NULL,'2024-05-28 10:14:00.898886','2024-06-09 07:23:24.106553',NULL,NULL,'月額料金 CB3　300,000円 CB3LiteEdition　75,000円','製品画像28.jpeg'),
(71,'株式会社Algoage','1,000,000 円','2018年2月1日','130名','Algoageは、最先端のテクノロジーを活用して、未来の当たり前になるサービスを作る会社です。2018年に当時東京大学で機械学習の研究をしていたメンバーで創業され、以来、AIを活用したサービス開発、研究開発を行ってきました。Algoageでは、人の意思決定支援の領域に注力し、AIが一人一人のパートナーとして人のあらゆる意思決定をサポートする未来の実現を目指しています。そうした未来を作る第一歩となる新規事業として、個別の消費者のニーズを把握し、パーソナライズされた最適な消費意思決定を支える、チャットボット事業「DMMチャットブーストCV」を運営しています。','1日でわかる生成AI研修','当サービスは、さまざまな業界へ生成AIサービスを提供してきた当社ならではの強みを生かし、業界・企業に応じたカスタマイズが可能です。生成AIに触れたことがない方でも、研修終了後、すぐに業務活用いただけます。','その他',NULL,'50000',true,NULL,'[]',NULL,'2024-05-28 10:14:03.305712','2024-06-09 07:23:24.167402',true,50000,' 生成AI理解コース 1名 20,000円 生成AI活用コース 1名 25,000円 生成AIカスタマイズコース 1名 30,000円','製品画像16.jpeg'),
