(81,'DAILabs株式会社','1000万円','2023年1月26日','6名','DAILabsは、全ての企業がAIで業務効率を改善できるよう、人工知能（AI）コンサルティングサービスとソフトウェア開発をおこなっています。','CustomAIChatbot','DAILabsが提供するCustomAIChatbotは各企業向けにカスタマイズが可能。顧客ごとのチャット履歴で補強することができます。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:14:24.143415','2024-06-09 07:23:24.751547',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(82,'ホープリヴス株式会社','500万円','2014年6月4日','19名（業務委託含む）','ホープリヴスは、世界を変える"キッカケ"を創造することをビジョンに掲げ、画像生成AIおよびメタバースをメインとした事業を展開しています。','AIキャスティ','ホープリヴス株式会社が展開する「AIキャスティ」は、仮想人物のインフルエンサーを創り上げ、オリジナルAIインフルエンサーとして商品・商材の集客、購買率UPをサポートいたします。','その他',NULL,'なし',true,NULL,'["\n                \n                事前に用意するものはありますか？              \n画像を融合させる場合はその画像をご用意ください", "\n                \n                依頼から納品までどの程度かかりますか？              \n時期や他の生成状況にもよりますが、最短当日～可能です", "\n                \n                定期生成は可能ですか？              \n問題ございません", "\n                \n                スポットでも対応可能ですか？              \n対応可能でございます。", "\n                \n                納品媒体は何ですか？              \n画像はJpeg　動画はMP4となります。"]',NULL,'2024-05-28 10:14:26.381531','2024-06-09 07:23:24.802661',NULL,NULL,'¥10.000～','製品画像30.jpeg'),
(83,'株式会社Algomatic','500万円','2023年4月','約30名','Algomaticは、生成AIの価値を広めるために、生成AIネイティブなプロダクトを複数開発・提供しています。','シゴラクAI','Algomaticが提供する「シゴラクAI」は誰もが安全かつ簡単にChatGPTを活用できるように作られたWebサービスです。豊富なプロンプトテンプレートやユーザー利用状況の管理で、組織での生成AI活用を促進します。','月額',NULL,'100000',true,true,'["\n                \n                ChatGPTとは何が違いますか。              \nChatGPTはOpenAI社が提供する生成AIチャットツールです。ChatGPTではチャットの内容が言語モデルの学習に使用されるため、\r\n情報漏洩リスクやセキュリティ上の懸念がございます。\r\n一方で、シゴラクAIはOpenAIのAPIを活用したサービスで、チャットの内容が外部に送信されないのが最大の特徴です。", "\n                \n                最低契約期間はどのくらいですか              \n最低契約期間は半年となっております。途中解約による払い戻しは行なっておりませんので、予めご了承ください。", "\n                \n                最低利用人数はどのくらいですか              \nシゴラクAIは10名以上からのご契約となっております。ご利用の目的に合わせた最適なプランをお見積りいたしますので、お気軽にご相談ください。", "\n                \n                初期費用は、ユーザーアカウントを追加発行する度にかかりますか              \nいいえ。利用開始月末締め翌月末払いで、1回のみかかります。"]',NULL,'2024-05-28 10:14:28.931788','2024-06-09 07:23:24.848738',true,100000,'月額1,000円〜/1ユーザー ※利用ユーザー数をもとにカウント','製品画像13.jpeg'),
(84,'JTP株式会社','7.9億円','1987年10月31日','435名','JTP株式会社は、日本に進出する海外のITベンダーやライフサイエンスメーカー向けに、テクニカルサポート、トレーニングなどの技術サービスを提供する会社として、1987年に設立されました。ミッションに「ConnecttotheFutrue」を掲げ、幅広い企業のニーズに対してITシステム設計・構築・運用・保守サービスや、サイバーセキュリティサービス、人材育成コンサルティングサービスのほか、人工知能の導入によりビジネスにおける顧客接点の最適化を実現するソリューション「ThirdAI」を提供しています。','ThirdAIコンタクトセンターソリューション','最新チャットボットが業務効率化をサポート★ChatGPTをセキュアに利用できるAzureOpenAIServiceを導入ThirdAIコンタクトセンターソリューションは、AIの活用で顧客満足度と業務効率化の両立を実現','その他',NULL,'1000000',true,NULL,'["\n                \n                外部ツールと連携可能でしょうか？              \nLINE,Teams,GoogleChat,Slackなどのチャットツールと連携可能です。\r\n対応後ログデータのCRM連携なども可能です。"]',NULL,'2024-05-28 10:14:31.411747','2024-06-09 07:23:24.902952',true,1000000,'200,000円～','製品画像15.jpeg'),
(85,'株式会社エクスプラザ','-','2020年7月3日','-','エクスプラザは、「プロダクトの力で豊かな暮らしをつくる」というミッションのもと、企業様の生成AI活用のコンサルティングから開発まで一気通貫のご支援、業務効率化のための生成AIを活用したプロダクト開発をしています。','EXPLAZA生成AIPartner','エクスプラザが提供する「生成AIPartner」は、AI活用のコンサルティングから開発まで一貫支援するサービス。経験豊富なメンバーが高品質な開発、DX推進を実現し、プロジェクトを成功に導きます。','月額',NULL,NULL,NULL,NULL,'["\n                \n                具体的な利用想定や構想はないが相談可能か？              \n生成AIのコンサルタントによる無料のヒアリング（壁打ち）も行っております。お気軽にご相談ください。", "\n                \n                コンサルティングや開発などを切り離して契約可能か？              \nコンサルティングのみや開発のみ、といった個別支援での契約も可能です。", "\n                \n                契約形態に縛りはあるか？              \n特にございません。\r\n案件特性や企業様のご都合に応じて、請負・準委任などフレキシブルにご相談可能です。"]',NULL,'2024-05-28 10:14:33.777590','2024-06-09 07:23:24.955701',NULL,NULL,'※ご利用のアプローチで異なります。詳細はお問い合わせください。  ・生成AI Partner  　　　　   ：　お問い合わせください。 ・生成AI SmartAssistant　：　月額 780円〜/ユーザ ・生成AI 研修　　　　　　 ：　お問い合わせください。','製品画像11.jpeg'),
(86,'株式会社スニフアウト','100万円','2022年11月','10名','株式会社スニフアウトは「科学で世界をビルドする」をPurposeに掲げ、⽣成AIをはじめとする学術研究の知⾒を持つサイエンティスト集団によってイノベーションを創⽣するスタートアップです。','PromptAgent','PromptAgentは生成AI専門のコンサルタントによる導入・開発支援サービスです。生成AIのプロジェクトでありがちな失敗を防ぎながらプロジェクト進行を伴走します。','その他',NULL,NULL,true,true,'["\n                \n                コンサルティングには具体的にどういったサービスが含まれますか。              \n生成AI利用のご相談/プロンプトエンジニアリング/セキュリティ対策/受託開発などが可能です。", "\n                \n                相談に乗っていただくだけでも良いでしょうか？              \nはい。1時間の無料相談や定期的なお打ち合わせを行うプランもご用意しております。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。\r\n弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                コンサルティング以外の依頼は可能ですか?              \nはい可能です。生成系AIをサービス内で使用するためにAPIの開発や社内システムの実装などを行った実績がございます。", "\n                \n                開発期間は？              \n機能開発の場合2-4ヶ月で行います。"]',NULL,'2024-05-28 10:14:36.547927','2024-06-09 07:23:25.005391',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(87,'株式会社Hi-STORY','200万円','2019年3月','11名','「日本のITを前進させる」をビジョンに掲げるテックカンパニーです。企業へChatGPTの導入支援をする「社内GPT」、CTO人材を育成して企業の開発内製化を支援する「CTOSTART」、企画力を強みにする「受託開発事業」により、日本のデジタル化を推進します。','社内GPT','株式会社Hi-STORYが提供する「社内GPT」では、法人が安心してChatGPTを業務に利用できるよう、Slackのボット設定を代行します。社内GPTを利用して、AIによる業務改革を推進しましょう。','その他',NULL,'200000',true,NULL,'["\n                \n                社内GPTは本当に安全？              \n社内GPTで利用するAPIについては「OpenAPI社のAPIdatausagepolicies（APIデータ利用規約）」にモデルの訓練に利用されることがない旨が明記されています。ただし、OpenAI社にデータが送信され、30日間は保存されます。ChatGPTのリスク管理については、最終的には各社でご判断ください。", "\n                \n                著作権はどうなる？              \nOpenAI社の「Sharing&publicationpolicy（共有と公開のポリシー）」に記載の通り、ChatGPTが生成した内容の権利は生成者に帰属し、商用利用が可能です。\r\nただし、AIによって生成されたことを示す必要があるので、ご注意ください。", "\n                \n                ChatGPTの利用料金は？              \n1000トークンあたり0.002ドルで、安価に利用できます。\r\nトークンについて、英語の場合は1単語=1トークンと計算され、日本語のひらがなは1トークン、漢字は2,3トークンにカウントされることが多いです。スレッドの文脈に沿って回答を得るには、トークンの消費量が増えるので、ご注意ください。", "\n                \n                ChatGPTのモデルは何？              \n2023年4月現在、「gpt-3.5-turbo」のモデルを採用しています。\r\ngpt-4やAzureOpenAIServiceにも対応可能です。利用承認されるまでに時間がかかる可能性があるので、早めにご連絡下さい。", "\n                \n                どんなカスタマイズができますか？              \n個人情報の検知、独自情報や最新インターネット情報の読み込み、画像生成AI、他のOSSへの対応など幅広くカスタマイズ可能です。", "\n                \n                Slack以外にも対応できますか？              \nSlack以外のチャットツールはもちろん、独自のWeb画面構築にも対応できます。まずはお気軽にご相談ください。", "\n                \n                テキスト情報以外も読み取れる？              \n現在はテキスト情報のみに対応しています。画像ファイルなどに対して回答することはできません。"]',NULL,'2024-05-28 10:14:39.431931','2024-06-09 07:23:25.052579',true,200000,'初期費用200,000円','製品画像19.jpeg'),
(88,'カサナレ株式会社','2000万円','2022年8月','16人','カサナレ株式会社は、「顧客体験から新たな価値を生み出す」をミッションに、GenerativeAIを用いた業務特化型クラウドサービスの開発を行なっています。','Kasanare(カサナレ)','Kasanareは、回答の質や正確性が求められる高精度なLLM活用に特化したサービスです。生成AIに「人間と同等の推論力」を与えるための、「環境構築/能力の向上/RAGの運用」がセットになったオールインワンSaaSです。','その他',NULL,NULL,true,NULL,'["\n                \n                費用はどれぐらいですか              \n開発費用は200万円〜、運用費用は30万円ほどで利用していただく事が多いです、しかし、あくまでも工数によって大きく変動いたします。具体的なお話をお聞きして費用感をお伝えいたしますので、一度お気軽にお問い合わせください。", "\n                \n                情報漏洩の心配はないでしょうか？              \nはい、ご安心ください。学習データはOpenAIに学習されないオプトアウトと呼ばれる方式を採用しています。また、ユーザーが質問した際に個人情報が出力されないような仕組みづくりを行い、情報漏洩に細心の注意を払って進めます。", "\n                \n                実績はどれぐらいありますか？              \n2023年の6月からサービス展開を開始し、既に日本トップクラスの開発実績があります。また、AIsmilyAIPRODUCTSAWARD2023・秋の生成AI部門の受賞や、日経クロストレンド「未来の市場を作る100社」に選出された実績などもございます。", "\n                \n                「精度が高い」とは具体的にどういうことですか？              \n「知識が豊富な人間だったらこう答える」に近づけることが「精度が高い」であると考えています。ビジネスで利用できる精度を実現する手段の１つとして、データをLLMに情報を読み込ませる前に加工を行う方法があります。私たちは企業様ごとに独自のロジックを定め、オーダーメイドのデータ加工実績も豊富なため、自信を持って高い精度を保証いたします。", "\n                \n                詳しい担当者が社内にいなくても導入できますか？              \nもちろん大丈夫です。生成AIのプロが導入から運用まで徹底的にサポートするのでAIの知見が全くない方でも導入の担当者となっていただけます。"]',NULL,'2024-05-28 10:14:41.862877','2024-06-09 07:23:25.094449',NULL,NULL,'30万〜','製品画像8.jpeg'),
(89,'株式会社ジーニー','1,549百万円（連結、2023年3月末現在）','2010年4月14日','566名（連結、2023年3月末現在）','「誰もがマーケティングで成功できる世界を創る」というビジネスパーパスのもと、サイト内CVR改善を可能にする各種ツールを提供しております。','GENIEEENGAGE','株式会社ジーニーが提供する「GENIEEENGAGE」は、今まで機会損失してしまっていた検討度の高いユーザーに対して再アプローチを行い、コンバージョン向上へと繋げるリマインドツールです。','その他',NULL,'0',true,NULL,'[]',NULL,'2024-05-28 10:14:44.171051','2024-06-09 07:23:25.145243',NULL,NULL,'従量課金型','製品画像23.jpeg'),
(90,'株式会社EXIDEA','1500万円','2013年5月','63名','EXIDEAはインターネット回線・生活分野を中心としたWebメディアの運営と、SEO対策・動画マーケティング・Web広告運用といったデジタルマーケティングを用いて企業にグロースハックを提供しています。','EmmaTools','株式会社ＥＸＩＤＥＡが提供する「EmmaTools」は、AIで文章作成を支援し、SEO効果の高いコンテンツ作成ができるライティングツールです。ライティング業務を一気通貫で効率化することができます。','年間',NULL,'なし',true,true,'["\n                \n                他のSEOツールと併用することはできますか？              \nはい、可能です。分析は他のツール、コンテンツ作成はEmmaToolsといった使い方をしているクライアント様もいます。", "\n                \n                SEOのコンサルティングは行っていただけますか？              \nはい、可能です。別途料金が発生しますが、弊社ではSEOコンサルティングも行っております。お気軽にご相談ください。", "\n                \n                EmmaToolsを使えば必ず検索順位は改善されますか？              \n検索順位はドメインの強さやリンクの質など、コンテンツ以外の要素も大きく関係するため、検索順位の改善を保証するものではございません。\r\nただし、EmmaToolsのスコアと検索順位には強力な相関関係がございます。", "\n                \n                AI文章生成はAIライターさんに依頼でき、記事が自動で完成するということですか？              \n違います。文章の構成作成や文章作成をあくまで支援することができる機能です。", "\n                \n                AIライティングを利用した場合、著作権の侵害にあたるリスクはありますか？              \n「リスクが無い」とは言い切れません。しかしEmmaToolsに搭載されている「コピー率チェック」という機能で既に世に出ているコンテンツとのコピー率を見ることができ、著作権法に違反するリスクを低減することができます。"]',NULL,'2024-05-28 10:14:46.529637','2024-06-09 07:23:25.194992',NULL,NULL,'Entryプラン：300,000円/年、30,000円/月 Standardプラン：600,000円/年、65,000円/月','製品画像28.jpeg'),
(91,'アーニーMLG株式会社','2億102万6523円（資本準備金含む）','令和元年10月23日','43名','AISaaSの開発および運営','YOMEL','ワンクリックで高精度音声解析AIが全発言を認識し、テキスト化。自動要約や議事録ビルダーなどの機能で議事録の作成工数を大幅に削減できます。','その他',NULL,'0',true,true,'["\n                \n                利用可能なブラウザは何ですか？              \nWindows,Macどちらもご利用いただけます。専用のアプリケーションをインストールしていただくことで、オンライン会議での相手の声も聞き取ることができるようになります。対面会議でのご利用の場合は、ブラウザのみでもご利用可能です。GoogleChrome最新版のご利用を推奨しております（Windows,Mac,iOS,Android）", "\n                \n                利用可能なマイクは限定されますか？              \nいずれのメーカーのマイクでもご利用可能ですが、ハウリング防止や認識精度向上のため、ノートパソコン標準のマイク・スピーカーでのご利用は非推奨とさせて頂いております。外付けのイヤホンマイクやヘッドセット、会議専用マイクスピーカー等のご利用を推奨しております。", "\n                \n                スマートフォンでも利用できますか？              \n対面会議の書き起こしにおいては、スマートフォンからもご利用いただけるようになっております。iPhoneやAndroidでYOMELを立ち上げて、会議テーブルの中央に置いていただくことで自動書き起こしが可能になります。", "\n                \n                どのWEBミーティングツールでも使えますか？              \nはい、Zoom,Meet,Teams,WebEX、その他、どのようなウェブ会議ツールでもご利用頂けます。各ツールとの連携作業等も一切必要ありません。", "\n                \n                サポート体制を教えてください              \n24時間365日、メール、Slack、Chatwork等での受付を行っています。緊急時を除き、基本的に平日の10時から19時の営業時間内にご返信・ご対応させていただいております。"]',NULL,'2024-05-28 10:14:49.035396','2024-06-09 07:23:25.251669',NULL,NULL,'28,000円/月〜','製品画像9.jpeg'),
(92,'株式会社ALM','1,000万円','2022年9月','5名','株式会社ALMは、AI議事録取れる君を世の中に広める為に、開発•販売•保守等をワンストップで行います。','AI議事録取れる君','株式会社ALMが提供する「AI議事録取れる君」は、超高精度の人工知能（AI）を活用し、Zoom・Teams・GoogleMeetでの会議内容を、リアルタイムで文字起こしする、議事録作成サービスです','ユーザー',NULL,'なし',true,true,'["\n                \n                利用可能なブラウザを教えてください。              \nChrome,Safari,Edgeに対応しています。（※Safariは最新のバージョン(14.1.1以降)が必要です。Edgeは古いバージョンだと動作しない可能性があります。）", "\n                \n                議事録にパスワードを設定できますか？              \n可能です。議事録作成時にパスワード入力してください。", "\n                \n                ZoomやMS Teamsなどのオンライン会議のツールと併用できますか？              \nブラウザで開くアプリのため、ZoomとMSTeams、Googlemeets、webexなどのオンライン会議ツールと併用できます。", "\n                \n                サブスクリプションはどのように更新されますか？              \n契約更新日に自動的に更新されます。サブスクリプションを中止したい場合は、契約更新日より前にアカウント情報ページの「管理」ボタンからキャンセルしてください。"]',NULL,'2024-05-28 10:14:51.423972','2024-06-09 07:23:25.302954',NULL,NULL,'個人利用: 980円/月（3時間）〜、法人利用: 5,500円/月（10時間）～','製品画像13.jpeg'),
