(109,'TokyoTechies株式会社','4150万円','2017年9月','東京　25名','TokyoTechiesはまだ見たことのないAI製品を皆様と共に研究、開発をしております。システム構築、セキュリティも事業の柱なので、ワンストップでシステム全体の構築が可能です。','TechieBot','TokyoTechies株式会社が提供する「TechieBot」は高い知識を持つスマートチャットボットです。あなたのデータを学習して、ユーザーに対して完全にパーソナライズされたフィードバック、情報、サポートを提供することができます。また、GhatGPTをはじめ、他社のエンジンとの連携も可能です。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:15:28.809794','2024-06-09 07:23:26.408770',NULL,NULL,'お問合せください','製品画像7.jpeg'),
