(112,'株式会社CIJ','22億70百万円','1976年1月7日','連結1,602名、単体887名','システム開発およびシステム開発に関連するサービスを提供しています。コンパイラやOSといったソフトウェアのコア開発からスタートし、現在ではAI、IoTを始めとする最新技術を取り込みながら、真面目に真摯に、技術を高めてお客様の期待にお答えしています。','サービスロボット「AYUDAシリーズ」','株式会社CIJが提供するAIロボット「AYUDA（アユダ）シリーズ」は、人間とロボットの共生・共存を目指して開発されたヒューマノイドです。様々なシーンにおいて、ワークサポートの新戦力として人手不足解消や高齢化社会に貢献し、人々の生活を「AYUDA※」します。※AYUDAはスペイン語で「助ける・援助する」という意味です。','月額',NULL,'698',true,true,'["\n                \n                連続稼働時間はどれくらいですか？              \n大型の自律移動型サービスロボットであるAYUDAは、バッテリーで最大8時間程度稼働します。\r\n（充電には最大3時間程度要します）\r\n小型サービスロボットであるAYUDA-MiraMeは、常時電源を要します。", "\n                \n                屋外で使用できますか？              \n屋内での使用を想定しております。\r\n防塵・防水などの対応はしておりません。", "\n                \n                ネットワークは必須ですか？              \n音声認識にクラウドサービスを利用しており、必須です。\r\n機能制限した上でのご利用を想定される場合、詳しくはご相談ください。"]',NULL,'2024-05-28 10:15:34.755033','2024-06-09 07:23:26.570933',true,698000,'【自律移動型サービスロボット AYUDA】 お問合せください 【感染症対策支援AIロボット AYUDA-MiraMe】 月額利用料：1万2千円 月額保守料：1万円','製品画像25.jpeg'),
