(117,'株式会社PKSHAWorkplace','250百万円','2016年10月','-','PKSHATechnologyが100％出資し、自然言語処理を専門で取り扱う会社として設立。対話エンジンサービスを中心に自然言語処理ソリューションをエンタープライズ企業様に提供しています。','PKSHAChatbot','株式会社PKSHAWorkplaceが提供する「PKSHAChatbot」は、企業の社内DX推進のための社内コミュニケーションの自動化/円滑化を実現する、高精度の独自AIを搭載したチャットボットです。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:15:46.155436','2024-06-09 07:23:26.890444',NULL,NULL,'詳細はお問い合わせください','製品画像8.jpeg'),
(118,'株式会社pluszero','1億円','2018年7月10日','正社員数：44名　全社員数：127名','AI・自然言語処理・ソフトウェア・ハードウェア等の各種テクノロジーを統合的に活用したソリューション提供・開発・保守・運用および販売、ならびに受託及びそれらに付帯するコンサルティング業務','チャットボット','株式会社pluszeroが提供する「チャットボット」は、サイト・アプリ上の顧客からの質問・申込対応を自動対応するチャットボットの開発・導入や、コールセンターのオペレータの質問回答をサポートするチャットボットの開発・導入を行います。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:15:48.606907','2024-06-09 07:23:26.949718',NULL,NULL,'お問合せください','製品画像10.jpeg'),
(119,'HishabLtd.','3億円','2015年8月','62名','Hishabは、インターネット環境やスマートフォン、ITリテラシーの無い人でも簡単な音声コマンドを使用することにより、誰もがソフトウェアを利用することができる世界を創ることをミッションとした、バングラデシュ発のAIスタートアップです。主な製品としては、日本市場ではコールセンター応答自動化ソリューション「Verbex」、バングラデシュやインドを始めとした南・東南アジア市場では、マイクロファイナンス機関や小売店向けの音声データ入力ソリューションや、金融機関と連携してボイスバンキングサービスなどを展開しています。2021年6月現在、バングラデシュでは、BankAsiaという大手銀行にボイスバンキングソリューションを提供、他には200万人以上のマイクロファイナンスの借り手、46万以上の小売店にHishabの音声データ入力ソリューションをご使用いただいております。','Verbex','HishabLtd.が提供する「Verbex」は、通常ヒトがマニュアルで行っているコールセンターでの応対業務を、AIにより自動化するサービスです。NLP（自然言語処理）技術を用いて人と話すような自然な対話を実現します。','その他',NULL,'10',true,true,'[]',NULL,'2024-05-28 10:15:51.111989','2024-06-09 07:23:27.000808',NULL,NULL,'1分のAI自動応対あたり25円〜50円（受付コール総数により変動）','製品画像5.jpeg'),
(120,'株式会社ワークスアプリケーションズ・システムズ','100,000千円','2003年5月','-','①SaaSサービスのHUEWorksSuite・HUEWorksSuiteDXSolutionsシリーズの開発・販売及びサポート②グループ会社および他社パッケージ製品の導入支援③開発委託業務を含むSIサービス事業④業務改善の提案をはじめとしたITコンサルティングサービス事業','HUEChatbot','株式会社ワークスアプリケーションズ・システムズが提供する「HUEChatbot」は、日本最大規模の辞書（290万語）とNLP（自然言語処理）技術の応用で、高い精度での対話を実現します。FAQや固有辞書はノーコードで登録、さらに利用状況や改善ポイントがダッシュボード化されており、自社で簡単にPDCAを廻せます。','その他',NULL,NULL,true,true,'["\n                \n                自然言語処理とは何ですか？              \n自然言語処理（NLP、NaturalLanguageProcessing）とは、日本語や英語など人間が使っている言語をコンピュータに処理させるための技術やソフトウェアです。\r\nかな漢字変換、情報検索、音声認識など様々なシーンで活用されています。", "\n                \n                スマホでも使えますか？              \nはい、以下のブラウザで動作します。\r\n・GoogleChrome\r\nただし、メンテナンス画面は画面解像度が小さいため、ご利用が困難です。PCからの利用を推奨します。", "\n                \n                アイコンは変更できますか？              \nはい、弊社側で用意しているアイコンが複数ございますので、そちらよりご変更いただけます。\r\nまた、お客様ご自身で作成した任意の画像をアイコンとして利用することも可能です。"]',NULL,'2024-05-28 10:15:53.905864','2024-06-09 07:23:27.052513',NULL,NULL,'お問合せください','製品画像4.jpeg'),
(121,'デジタルヒューマン株式会社','非公開','2020年5月','UneeQ,Inc. を含むグローバルで100名','デジタルヒューマン株式会社は、UneeQ,Inc.の関連会社で、デジタルヒューマンを日本市場へ最適化し、デジタルヒューマンの事業展開を専門に行う企業です。','デジタルヒューマン','デジタルヒューマン株式会社が提供するデジタルヒューマン（DigitalHumans）は、チャットボットやNLPと連携し、対話と感情表現で新しい顧客体験を提供するサービスです。デジタル従業員として、直感的で、インパクトがあり、競争力があるサービス創造と顧客体験が提供できます。','月額',NULL,'0',true,true,'[]',NULL,'2024-05-28 10:15:56.454136','2024-06-09 07:23:27.102695',NULL,NULL,'月額 135,000円〜','製品画像19.jpeg'),
