(125,'TDSE株式会社','8億3318万円','2013年10月17日','128名','ビッグデータ・人工知能（AI）を活用したソリューション提供及びAI製品（AIモジュールを含む）の提供','cognigy','TDSE株式会社が提供する「cognigy」は、Alexa・GoogleHomeなどのボイスユーザーインターフェース、ウェブチャット・LINEbot・Teamsbotなどのチャットボットを拡張性高く、短期間で作成できるツールです。','その他',NULL,'なし',true,true,'["\n                \n                対話型AIプラットフォームとチャットボットの違いはなんですか              \nCognigyは通常のチャットボットの単純なルールベースでの応答のみでなく、自然言語処理や音声入力、外部APIなどの高度な機能を利用したボットをGUIの操作のみで作成可能です。またLINE、Teams、Slack等の多様なエンドポイントクライアントからの利用にデフォルトで対応しています。", "\n                \n                外国語には対応していますか              \n多言語に対応しています。英語、中国語、韓国語を始め、20か国語でご利用可能です。\r\n多言語チャットボットの活用事例をこちらでご紹介しております。"]',NULL,'2024-05-28 10:16:04.780376','2024-06-09 07:23:27.305831',NULL,NULL,'-','製品画像11.jpeg'),
