(128,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','ServiceCloudEinstein','株式会社セールスフォース・ジャパンが提供する「ServiceCloudEinstein」は、カスタマーサポート業務の効率化とオペレータの生産性を向上します！','月額',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:16:13.367090','2024-06-09 07:23:27.455654',NULL,NULL,'月額 6,000円/1ユーザー','製品画像25.jpeg'),
