(130,'株式会社mofmof','200万円','2015年4月','/','社内問い合わせ対応専用AIチャットボット「My-opeoffice（マイオペオフィス）」の開発・提供。','My-opeoffice（マイオペオフィス）','株式会社mofmofが提供するMy-opeoffice（マイオペオフィス）は、社内問合せの課題を解決し、社員が抱える「探す時間」を大幅削減します。','その他',NULL,'160000',true,NULL,'["\n                \n                初期費用と月額料金の他に費用は発生しますか？              \n発生いたしません。\r\nユーザー数、QA登録数、トラフィック量などによる追加課金も一切ございません。\r\nただし、オプションメニューとして、外部チャットツールとの連携をご希望の場合は、初期設定費4.8万円、月額３万円のみ必要となります。\r\nまた、質問の登録数は無制限で追加料金も発生しません。", "\n                \n                導入までのサポート体制を教えてください。              \n営業担当が導入コンサルティングをさせて頂き、社内公開まできっちりサポートさせて頂きます。ご契約後、導入準備期間中に貴社担当者様と定例ミーティングを原則３回設けさせて頂きます。具体的なスケジューリング、タスク管理、テスト運用方法などアドバイスさせて頂きます。", "\n                \n                AIはどのように動いているのでしょうか。              \nチャットボットを使えば使うほど、チャットボットが学習して賢くなります。\r\nそして、サジェスト機能時に質問数の多い順に並ぶようになり、正答率が上がります。"]',NULL,'2024-05-28 10:16:17.564473','2024-06-09 07:23:27.550406',true,160000,'120,000円','製品画像30.jpeg'),
(131,'株式会社wevnal','2000万円','2011年4月','/','インターネット広告代理事業（各種運用型広告、クリエイティブ、メディア）／Chatbot事業','BOTCHAN（ボッチャン）','株式会社wevnalが提供するBOTCHAN（ボッチャン）は、ボットシナリオをお客様ご自身で作成できるチャットボットサービスです。自然言語処理、レコメンドエンジンといったAIエンジンと接続が可能で、ユーザとのより自然な会話を実現します。','月額',NULL,'100000',NULL,NULL,'[]',NULL,'2024-05-28 10:16:19.941623','2024-06-09 07:23:27.602455',true,100000,'月額 10,000円～','製品画像22.jpeg'),
