(133,'株式会社電話放送局','7,900万円','1996年11月','/','IVR（自動音声応答）システムを用いたクラウドサービス事業IVRを中心としたCTI機器システム販売事業ITコンサルタント事業ソフトウェア、ソリューション開発事業SMS（ショートメッセージ）送信サービス事業','ロボット自動受付サービス','人材難の今、コールセンター業務の最適化が急務！株式会社電話放送局が提供する「ロボット自動受付サービス」は、コールセンターの受電業務を半自動化・完全自動化いたします。','その他',NULL,NULL,NULL,true,'[]',NULL,'2024-05-28 10:16:23.482024','2024-06-09 07:23:27.727641',NULL,NULL,'お問合せください','製品画像30.jpeg'),
(134,'LINEWORKS株式会社',' 55億2,000万円',' 2015年6月3日','-','ビジネス版LINE「LINEWORKS（ラインワークス）」は、トーク・カレンダー・掲示板・ビデオ会議など、仕事に便利なグループウェア機能が1つのアプリにそなわったビジネスコミュニケーションツールです。トーク機能は「LINE」の使いやすさをそのままに誰でも使いやすく、豊富な仕事用スタンプで気持ちが伝わるコミュニケーションが可能です。スマートデバイスでの利用を中心に設計されており、デスクワークが少ない「現場」ではたらく社員や、仕事の取引先とのコミュニケーションがスムーズになるほか、情報共有の円滑化や、PC利用がメインのバックオフィスの業務効率化など、ビジネスを一層加速させていきます。さらにLINEWORKSは、LINEユーザーとトークがつながる唯一のビジネスチャットです。また、公開されているAPIを通じてさまざまなITシステムとの連携ができるほか、LINECLOVA（AIシステム）の実装により、AIを活用したより良いはたらき方を引き続き追求していきます。','LINEWORKSAiCall','LINEWORKS株式会社が提供する「LINEWORKSAiCall」は、LINECLOVAのAI技術である「CLOVASpeech」（音声認識）と「CLOVAVoice」（音声合成）および会話制御の仕組みを組み合わせ、AIによる自然な対話応答を実現する電話応対AIサービスです。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:16:25.925346','2024-06-09 07:23:27.773487',NULL,NULL,'お問合せください','製品画像27.jpeg'),
(135,'NuanceJapan','1,000万円（日本法人）','1992年（US本社）','約8,500人（グローバル合計）19名（日本法人）','ニュアンスは音声認識、自然言語処理、声紋認証、バーチャル・アシスタント技術を活用し、コンタクトセンター、IVR、モバイル、Web、IoTにおいて、顧客体験を向上させ企業価値を高めます。','音声認識／対話型AIのソリューション','NuanceJapanが提供する「音声認識／対話型AIのソリューション」は、音声対話に必要な「音声認識」、「意図理解」、「対話管理」、「音声合成」のすべてを取りそろえたサービスです。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:16:28.244280','2024-06-09 07:23:27.829209',NULL,NULL,'お問合せください','製品画像22.jpeg'),
(136,'株式会社NTTドコモ','9,496億7,950万円','1992年7月1日','7,884名','【通信事業】・モバイル通信サービス・光通信サービスおよびその他の通信サービス【スマートライフ事業】・コンテンツ・コマースサービス・金融・決済サービス・ライフスタイルサービス【その他の事業】・法人ソリューション・あんしん系サポート※PrimalHoldingsは、AI電話サービスにおけるNTTドコモのパートナー企業です','AI電話サービス','あらゆる電話業務を最大効率化！株式会社NTTドコモが提供する「AI電話サービス」なら、コールセンターでのサービス申込み・高齢者の見守り電話・ワクチン予約まで、自然対話できるAIで、貴社のビジネスを加速させます。','その他',NULL,'1000000',NULL,NULL,'["\n                \n                申込から導入まではどれくらいの期間がかかりますか？              \n約3か月～4か月ほどかかります。代替したい業務内容に応じて前後いたしますので、詳細はお問い合わせください。", "\n                \n                料金を教えてください。              \nご利用状況によって異なりますので、詳しくはお問い合わせフォームよりご連絡ください。", "\n                \n                資料をいただくことはできますか？              \n営業担当より送付させていただきます。送付先のご住所と宛名をご連絡ください。"]',NULL,'2024-05-28 10:16:30.734302','2024-06-09 07:23:27.884639',true,1000000,'100,000円～','製品画像7.jpeg'),
(137,'マスターピース・グループ株式会社','2億1,600万円','1992年9月1日','1180名','カスタマーサービス事業、マーケティング事業、リスクマネジメント事業ヒトによるオペレーションとAIシステムの共存による「DoubleBRAIN」によって企業の課題解決をするビジネスをグローバルで展開','スマホdeナビ','マスターピース・グループ株式会社が提供する「スマホdeナビ」は、スマートフォンからお問い合わせをしたお客様にスマートフォン画面上で見える化した案内メニューによる自己解決を促進するビジュアルIVRサービスです。','その他',NULL,'45000',true,true,'[]',NULL,'2024-05-28 10:16:33.491630','2024-06-09 07:23:27.948708',true,45000,'35,000円','製品画像15.jpeg'),
(138,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','音声感情分類モデル開発・コンサルティング','FastLabel株式会社が提供する音声の感情分類AIモデル開発・コンサルティングは、独自の感情認識AIの要件定義、PoC、AI倫理を守る権利クリアなデータセット作成・素材データ収集、学習データ・教師データ作成（アノテーション）、モデル開発までを一気通貫でサポートし、お客様のモデル認識精度改善にフルコミットします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \nご支援の範囲に応じて、数十万〜数百万のご費用感となるケースが多くなっております。\r\n要件に従い、個別にお見積りをいたしますので、お気軽にお問い合わせください。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はAI開発・コンサルティングだけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:16:36.213925','2024-06-09 07:23:28.053831',NULL,NULL,'お問合せください','製品画像12.jpeg'),
(139,'モビルス株式会社','438,827,039円（2023年8月31日現在）','2011年9月','/','モビルスは、テクノロジーでサポートを新しくする、TheSupportTechCompanyです。コンタクトセンター向けSaaSプロダクト（モビシリーズ）などのCXソリューションを提供しております。','MOBIVOICE','「電話がつながらない」をゼロに。注文や手続きの一次受付、自由なシナリオ・IVRでの電話自動応答、アウトバウンドコールを簡単、低価格で実現。コールセンターの効率化とBCP対応に最適。サービス障害・災害・コロナによる電話殺到にも対応。','その他',NULL,NULL,NULL,NULL,'["\n                \n                １つの電話番号に同時に着信があった場合、1人のエンドユーザーしか利用できませんか？              \nMOBIVOICEでは、１つの電話番号に同時に着信があっても、複数のエンドユーザー様に対して自動応対のボットシナリオを動作させることができます。エンドユーザー様をお待たせすること無く着信し、自動応答を開始することができます。同時着信が可能な上限については、別途ご相談ください。", "\n                \n                MOBI VOICEの管理画面を、複数人で同時に使用することはできますか？              \nMOBIVOICEでは、管理画面のログインユーザーを自由に増やすことができるようになっています。同時に同じシナリオを編集していた場合、後から更新した情報で上書き保存がされますので、シナリオを編集する場合は、１シナリオにつき１名様で対応されることをお勧めしております。なお、ログインユーザーには権限設定ができるため、閲覧専用と編集専用の２つの権限を利用して、ユーザーアカウントを管理してください。", "\n                \n                すでに0120のフリーダイヤル番号を取得しています。MOBI VOICEで利用することはできますか？              \nMOBIVOICEの電話番号として登録することは出来ませんが、MOBIVOICEで取得した電話番号に電話転送をすることで、お持ちの電話番号を利用してエンドユーザー様からお電話をしていただくことができます。お持ちの電話番号が、MOBIVOICEに転送することが可能なご契約かは、ご契約先の通信事業者様にご確認ください。", "\n                \n                エンドユーザーとの会話情報を、基幹システム側で自動的に取得したいです。会話情報はダウンロードできますか？              \nCSV形式のデータファイルで、通話明細（会話履歴）を管理画面からダウンロードできます。通話ログには、設問の回答内容や使用したシナリオ情報、エンドユーザー様の電話番号情報なども含まれています。テキスト化された通話ログ情報を取得し、顧客応対の分析などにご利用ください。", "\n                \n                MOBI VOICEを利用するために、予め準備しておくものは何がありますか？事前に電話番号を準備する必要はありますか？              \nインターネット回線と、ブラウジングができるパソコンをご用意ください。MOBIVOICEでは、管理画面の中で電話番号をご購入いただけます。電話番号の購入からシナリオの作成、通話ログの確認など、すべての操作が１つの管理画面の中で完了できますので、ご契約後すぐに自動電話応対の運用を始めていただけます。", "\n                \n                利用時間の設定はできますか？              \nMOBIVOICEの機能としてはオペレータ転送設定に時間指定をすることができます。例えば営業時間外はオペレータに転送をさせず、シナリオ内で完結させて後ほど折り返し電話をするという運用が可能です。MOBIVOICEの機能ではありませんが、電話転送サービスで転送時間設定をして営業時間外はMOBIVOICEに応答させるという運用もお勧めしております。", "\n                \n                ボットの音声の変更はできますか？              \n音声合成用の声質を２種からご選択いただけます。その２種からさらに男性・女性など声のキャラクター、発話速度、声の高さも自由に選択していただくことができます。企業独自の固有名詞やシナリオ文章等の発話のイントネーションが気になる場合は、個別にイントネーションの調整を承ることもできますので、別途ご相談ください。"]',NULL,'2024-05-28 10:16:38.585193','2024-06-09 07:23:28.149985',NULL,NULL,'詳細はお問い合わせください','製品画像5.jpeg'),
(140,'株式会社ソフトフロントホールディングス','10,000千円','1997年4月18日','46名','株式会社ソフトフロントジャパン関連事業音声・映像・メッセージングによるリアルタイムコミュニケーション関連プロダクト・サービスの開発・販売および関連する受託開発株式会社サイト・パブリス関連事業Web系製品・サービスの企画・開発および販売およびWebサイト構築および活用支援株式会社ソフトフロントマーケティング関連事業「ITソリューション」の媒介販売','commubo','株式会社ソフトフロントホールディングスが提供する「commubo（コミュボ）」は、やさしい音声と遅延のない反応で高い会話完了率を実現、顧客接点を大事にする事業者様に安心してご利用いただいています。','その他',NULL,NULL,NULL,true,'[]',NULL,'2024-05-28 10:16:39.756107','2024-06-09 07:23:28.229847',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(141,'伊藤忠テクノソリューションズ株式会社','21,764百万円','1979年7月11日','単体 5,019名、CTCグループ 10,120名（2023年4月1日現在）','コンピュータ・ネットワークシステムの販売・保守、ソフトウェア受託開発、情報処理サービス、科学・工学系情報サービス、サポート、その他','CTC-AICON','伊藤忠テクノソリューションズ株式会社が提供する「CTC-AICON」は、クライアントのCS向上とコスト削減に向き合い、個社別に柔軟なカスタマイズが可能！PBXとのシームレスな連携や基幹システム連携など高い拡張性があり、課題に徹底的に寄り添ったボイスボットが構築出来ます。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:16:42.956622','2024-06-09 07:23:28.303560',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(142,'株式会社FixstarsAmplify','5000万円','2021年10月','15名','FixstarsAmplifyは、自社開発した最適化クラウド「FixstarsAmplify」のサービス提供及び数理最適化・量子コンピュータに関連するソフトウェア開発業及びコンサルティング事業を行っています。','FixstarsAmplify','株式会社FixstarsAmplifyが提供する「FixstarsAmplify」は、生産計画・人員シフト・材料探索など、複雑な条件を考慮して目的に合う最適解を自動で瞬時に求めるサービスです。','月額',NULL,'なし',NULL,true,'["\n                \n                既存のシステムとの連携は可能でしょうか？              \nお使いのアプリの仕様にもよりますが、FixstarsAmplifyは既存のシステムとシームレスなデータ連携ができます。例えば、生産管理システムから必要なデータを取り出してFixstarsAmplifyで最適化計算をすることで、大規模な投資やシステム更新をせずに、高速かつ精密な生産計画の立案が実現できます。", "\n                \n                アプリ開発はどれくらいの費用が掛かりますか？              \n自社で開発する場合は、ベーシックプランを無料でスタートすることができます。受託開発をする場合もまずは無料のトイモデルで自社に導入出来そうかご判断していただけます。", "\n                \n                どのような支援を受けられますか？              \n課題の整理から最適化計算のサポート、アプリ開発まで、貴社の状況に合わせて支援させていただきます。まずはお気軽にお問い合わせください。"]',NULL,'2024-05-28 10:16:45.273815','2024-06-09 07:23:28.398183',NULL,NULL,'評価・検証用：無料 商用利用：月額10万円～','製品画像5.jpeg'),
(143,'株式会社イコヒー','1000万円','2015年3月',' 50名（海外拠点含む）','テクノロジーでお客様のビジネスの成功を支援し伴走するデジタルパートナー、イコヒー（Ekohe）。コンサルティング、UI/UXデザイン、Web・モバイルアプリ・AI開発、データ基盤構築、DX支援を行う。','Kurrant.ai','Kurrant.aiは、存在すら知らなかった企業をレコメンデーションすることで、投資家が次のビッグディールを発見する支援をします。Kurrant.aiでチャンスを掴みましょう。','月額',NULL,'なし',NULL,true,'[]',NULL,'2024-05-28 10:16:47.701964','2024-06-09 07:23:28.465976',NULL,NULL,'投資家プラン：1名あたり月額50,000円企業プラン：ご相談ください','製品画像25.jpeg'),
(144,'株式会社フライウィール','100,000千円','2018年2月','85名（2024年2月現在）','フライウィールは、データ活用を推進する企業の挑戦に伴走し、成長を約束するデータ専門のプロフェッショナル集団です。企業のニーズに応じて、データ戦略立案からシステム構築・導入、活用支援を迅速に実現します。','Conata（コナタ）','フライウィールが提供する「Conata（コナタ）™️」は、経営課題をデータの力で解決するデジタルビジネスプラットフォームです。AIとシミュレーションによってデータドリブンな事業運営を実現します。','その他',NULL,NULL,true,NULL,'["\n                \n                Conataは他社製品とどのように違いますか？              \nデータ変換・モデリングの独自技術「オントロジー化」や「統合検索技術」をベースとしている点が他社製品との違いです。それにより多様で膨大なデータを柔軟に扱うことができ、機械学習の範囲を拡大することで新しいデータパターンや傾向を明らかにできます。また、上記のように整備したデータ基盤から、売上や収益構造の改善に直結するオファリングまでがシームレスに連携可能なため、データの利活用までに時間と手間がかからないことも大きな特徴です。", "\n                \n                導入企業はConataを利用してどのようにビジネスを強化していますか？              \n専任のコンサルタントが導入企業様ごとにデータの保有状況についてヒアリング/調査させていただき、目的ごとにConataを用いたソリューションのご提案をさせていただきます。たとえば、需要予測によるコスト削減、検索やレコメンドシステムを用いたユーザーエンゲージメントの向上、新規事業の立ち上げによる新たな収益源の確立などがあります。", "\n                \n                Conataはどのようなデータを収集・蓄積・管理できますか？              \nサイト/アプリのイベントログ、商品マスタ、ID-POS、位置情報など、実現したいソリューションに必要なあらゆるデータをConata上で管理することができます。非構造化データ（表形式ではないもの等）や不揃いなデータ（カテゴリや部門ごとに保有形式が異なる等）でも、ぜひ一度ご相談ください。弊社独自のオントロジー技術を用いることで、活用可能な状態に整備いたします。", "\n                \n                Conataは、どうやって顧客の保有データを取り込みますか？              \nありのままのデータをお預けいただくだけで、あとはConataがデータ整備・統合・変換を実現します。あらゆるクラウドシステム、ファイルタイプ、データ構造に対応可能です。お客様内でのスキーマ変更などデータ加工手続きは不要です。\r\nご提供いただきましたデータを半自動的に読み解き、活用可能な状態に格納いたします。また、データの接続方式もお客様がご対応しやすい方式で実施いたします。", "\n                \n                Conata導入までどれくらいかかりますか？              \n解決したい課題と優先度に応じてスケジューリングします。標準的な進め方は現状の問題分析や実施する要件設計を行うコンサルティング期間を経て、2-3ヶ月程度です。", "\n                \n                Conataのセキュリティ対策について教えてください。              \nフライウィールでは情報セキュリティ方針を策定し、ISMSを構築・運用し、当社を取り巻く環境の変化を踏まえ、継続的改善を全社を挙げて取り組んでいます。弊社ではお客様からお預かりする個人情報を含む多くの情報資産を保管・活用しており、すべてのステークホルダーの期待に応えるために、これらの情報資産を安心安全に保護する事は、経営上の最重要課題であると認識しています。", "\n                \n                Conataはどんなツールと連携できますか？              \n必要なデータを必要な形式・頻度で連携可能です。一例として、以下がございます。\r\n・Webサイトをパーソナライズするために、レコメンドスコアや表示するアイテム情報を配信システムに連携\r\n・発注数を自動的に算出した統計データをお客様のシステムにあるダッシュボードに連携・可視化\r\nまずはお客様の活用されたい目的をお聞かせください。"]',NULL,'2024-05-28 10:16:49.215966','2024-06-09 07:23:28.521936',NULL,NULL,'お問合せください','製品画像24.jpeg'),
(145,'ソーバル株式会社','214百万円','1983年1月','連結：889名（2024年2月29日現在）','ソーバルは、1983年創業以来「技術で社会に貢献する」という理念のもと、主にＩＴソリューションの提供を主たる事業としつつ、近年では、AIやIoT技術にも取り組み実績を上げております。','AI・データ活用支援サービス（データサイエンス、AIエンジニアリング）','ソーバル株式会社が提供する「AI・データ活用支援サービス（データサイエンス、AIエンジニアリング）」は、お客様の課題を聞かせて頂き、AIエンジニアリングとデータサイエンスによって解決する支援をさせて頂くサービスです。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:16:51.788359','2024-06-09 07:23:28.580268',NULL,NULL,'お問合せください','製品画像30.jpeg'),
(146,'株式会社スカイディスク','-',' 2013年10月1日','-','AIを活用したDX支援','AIカスタマイズソリューション','株式会社スカイディスクが提供する「AIカスタマイズソリューション」は、お客様との二人三脚による多種多様なソリューション実績があり、お客様のフェーズに合わせてAI実装までワンストップでサポートします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                通常のシステム開発との違いは？              \nAIモデルの精度はデータ数だけでなく\"質\"にも依存します。AIが特徴抽出可能なデータでなければ、どれだけの数を収集しても意味がありません。\r\nまた、例えば不良品判定を行うAIモデルを開発する場合、最初から全ての不良パターンのデータを網羅できていることはほぼありません。\r\nそのためスカイディスクでは、実装ゴールを「人が最終チェックを担う」形でプロジェクト設計し、運用しながら本番環境で学習データ収集を続けて、将来的な完全自動化に繋げていくアプローチをオススメしています。", "\n                \n                どのくらいのデータ数が必要ですか？              \n必要なデータ数は解決したい課題などによって異なります。また、データ数の前に、AIが特徴抽出可能なデータであるかが重要です。\r\nスカイディスクではご提案の前に、お客様がお持ちのデータを無料診断させていただいております。お気軽にお問い合わせください。"]',NULL,'2024-05-28 10:16:53.581297','2024-06-09 07:23:28.640794',NULL,NULL,'お問合せください','製品画像12.jpeg'),
(147,'株式会社スカイディスク','-',' 2013年10月1日','-','AIを活用したDX支援','AI生産スケジューラ　最適ワークス','株式会社スカイディスクが提供する「AI生産スケジューラ　最適ワークス」は、AIが最適な生産計画をサクっと立案します！エクセル・手書きの手間から開放月額5万円から利用できる','月額',NULL,'900001500001',NULL,NULL,'[]',NULL,'2024-05-28 10:16:55.971129','2024-06-09 07:23:28.701475',true,90000,'【アカウント／月額】 ライトプラン ：50,000円 ベーシックプラン ：150,000円 ※1年契約プランの場合、すべて税抜き価格です。 ※工場・現場ごとのアカウント発行を想定、1アカウントで複数ユーザーがご利用いただけます。','製品画像30.jpeg'),
(148,'株式会社pluszero','1億円','2018年7月10日','正社員数：44名　全社員数：127名','AI・自然言語処理・ソフトウェア・ハードウェア等の各種テクノロジーを統合的に活用したソリューション提供・開発・保守・運用および販売、ならびに受託及びそれらに付帯するコンサルティング業務','KPI最適化','株式会社pluszeroが提供する「KPI最適化」は、サイト・アプリ運営や営業活動などにおける、顧客の動きを踏まえたアクションの最適化を支援します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:16:57.243554','2024-06-09 07:23:28.763407',NULL,NULL,'お問合せください','製品画像25.jpeg'),
(149,'JTP株式会社','7.9億円','1987年10月31日','435名','JTP株式会社は、日本に進出する海外のITベンダーやライフサイエンスメーカー向けに、テクニカルサポート、トレーニングなどの技術サービスを提供する会社として、1987年に設立されました。ミッションに「ConnecttotheFutrue」を掲げ、幅広い企業のニーズに対してITシステム設計・構築・運用・保守サービスや、サイバーセキュリティサービス、人材育成コンサルティングサービスのほか、人工知能の導入によりビジネスにおける顧客接点の最適化を実現するソリューション「ThirdAI」を提供しています。','ThirdAIレコメンドアイ','JTP株式会社が提供する「ThirdAIレコメンドアイ」は、画像認識AI技術を活用して、お手元の写真などから類似または同一画像を検索して目的の商品を見つけ出すことが可能です。','月額',NULL,'1000000',NULL,NULL,'[]',NULL,'2024-05-28 10:16:59.642934','2024-06-09 07:23:28.824709',true,1000000,'月額 500,000円〜','製品画像5.jpeg'),
(150,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','CRMAnalytics','株式会社セールスフォース・ジャパンが提供する「CRMAnalytics」は、AIと分析を業務アプリに組み込みデータドリブンな意思決定を促進します！','その他',NULL,NULL,NULL,true,'[]',NULL,'2024-05-28 10:17:02.125251','2024-06-09 07:23:28.904703',NULL,NULL,'お問合せください','製品画像30.jpeg'),
(151,'株式会社ブレインパッド','597百万円（連結、2023年3月31日現在）',' 2004年3月18日（決算日6月30日）','535名（連結、2023年3月31日現在）','企業の経営改善を支援するビッグデータ活用サービス、デジタルマーケティングサービス','Rtoaster','顧客理解を深め、お客様一人ひとりの心に届く接客を実現。独自のアルゴリズムやAIで、他にはない最高の顧客体験をお客様に提供できます。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:17:08.982698','2024-06-09 07:23:28.982361',NULL,NULL,'個別見積もり','製品画像24.jpeg'),
(152,'株式会社affluent','1000万円','2020年6月','25名','affluentは全国主要都市で展開する（全7版）、富裕層向けメディア「AFFLUENT」の運営・発行及び、富裕層に特化したマーケティング、プロモーションを専門とするリーディングカンパニーです。','富裕層向け購買予測AI分析サービス「ATAS（エイタス）」','affluentが提供する「ATAS（エイタス）」は、日本を代表するITサービス企業のBIPROGY株式会社(旧社名：日本ユニシス株式会社)との協業により誕生した、富裕層向け購買予測AI分析サービスです。','その他',NULL,'なし',true,NULL,'["\n                \n                具体的にどのようなグラフや分析結果が提示されるのでしょうか？              \n分析の狙いと、提供いただくデータによって、ご提示できる内容は変わります。事前に課題感や戦略目標、及び提供いただけるデータ種類や項目が分かれば、ご提示できそうな具体的なイメージの分析レポートをご提案いたします。", "\n                \n                納品までの期間はどのくらいでしょうか？              \n約2～3カ月が目安です。まずはお客さまの課題感や戦略目標、分析の狙いをお打ち合わせしたうえで分析に取りかかり、約1ヶ月半後に中間報告をいたします。そこでのご質問ご要望をもとに、さらに約1ヶ月半で分析の深掘りを行い、最終報告をさせていただきます。", "\n                \n                提供するデータに個人情報が含まれていますが問題ないでしょうか？              \n個人情報や当サービス規定の機密度高の情報はお取り扱いできません。お手数ですが、事前にお客さまにて該当の項目が含まれないよう加工の上、ご提供いただくか、簡単な加工ツールをお渡しすることは可能ですのでご相談ください。", "\n                \n                データ数はどの程度必要でしょうか？              \n場合によって異なりますが、概ね1,000件程度以上がデータ分析ができる目安となります。ただし、あくまでデータの質に依存しますので、大量でも分析に耐えうる結果が出ない場合や、少量でも分析できる場合がございます。"]',NULL,'2024-05-28 10:17:10.095356','2024-06-09 07:23:29.047481',NULL,NULL,'お問合せください','製品画像13.jpeg'),
(153,'一般社団法人　社会整備サポート協会','1000万円','2012年4月','/','「カスタマイズ」と「ホワイトボックス化」で貴社のAI推進をサポートします。・AIモデルのカスタマイズ構築・AIモデルの内製化・システム制作','人材ポートフォリオ最適化モデル','・制約条件：本人の希望部署・スキル・受入れ部署が望む最低スキルや受け入れ人数・目的変数：人事異動における社員の不満【このサービス導入で得られるメリット】・成績順に異動希望を叶えるモデルなので社員は成績を上げようと頑張りモチベーションがアップ。・受け入れ部署は必要なスキルを持つ社員を得られる。・異動による不満を最小化するので会社全体で業績を上げやすい。','月額',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:17:12.503522','2024-06-09 07:23:29.126635',NULL,NULL,'モデル構築（約３ヶ月程度）月額 400,000円～ モデル構築後の保守（約１２ヶ月程度）月額 100,000円～','製品画像2.jpeg'),
