(155,'CrimsonInteractivePvt.Ltd（クリムゾンインタラクティブ）','-','Crimson Interactive Pvt. Ltd - 2005年AI部門子会社Crimson AI - 2017年','Crimson Interactive Pvt. Ltd - 600名以上AI部門子会社Crimson AI - 50名以上','クリムゾンインタラクティブ（代表：シャラド・ミッタル（SharadMittal））は2005年の創業以来、エナゴ（https://www.enago.jp/）、ユレイタス（https://www.ulatus.jp/）、クリムゾン・ジャパン（https://www.crimsonjapan.co.jp/）、ボックスタブ（https://www.voxtab.jp/）の各ブランドを通じ、翻訳、英文校正、テープ起こしを中心としたサービスを、125か国200万人以上の学術関係者の皆様に提供してきました。現在では世界10都市にオフィスを開設しており、幅広い言語ソリューションの分野で世界をリードしています。品質マネジメントシステムの国際認証であるISO9001:2015や、情報セキュリティマネジメントシステム認証ISO/IEC27001:2013、翻訳の国際規格ISO17100:2015を取得しています。Trinkaは、すでに世界中の何十万人もの著者や様々な分野のビジネスを支援しています。Trinkaは、最新の機械学習（ML）および自然言語処理（NLP）技術を使用して英文法エラーを特定、言語の向上を提案しています。Trinkaは、言語学者、医療編集者、データサイエンティスト、エンジニアのチームによって開発され、バリアフリーコミュニケーションとともに未来を作りたいという願いを強く抱いています。','AI搭載・自動英文校正ツールTrinka','Trinkaの高度な英文校正エンジンが、微妙なニュアンスをくみ取り、技術的にも正確な文章に仕上げます。クラウド、ブラウザ、Word、あるいはワークフロー・アプリ内といった必要な場所でリアルタイムでの強力な英文法チェックを可能にします。','ユーザー',NULL,NULL,NULL,true,'[]',NULL,'2024-05-28 10:17:15.931460','2024-06-09 07:23:29.295797',NULL,NULL,'■Trinka Cloud１ユーザー｜月払い 20ドル／年払い 80ドル■Trinka API お問合せください※日本法人とのご契約、日本円でお支払いいただくことが可能です。','製品画像5.jpeg'),
(156,'株式会社ユニソンプラネット','1,000万円','2012年5月30日','/','ユニソンプラネットは、AIによるWebサイトを活用したマーケティング機能とストレスフリーの操作性を併せ持ったWebマーケティングシステム「A-BiSU」を提供しております。','A-BiSU','株式会社ユニソンプラネットが提供する「A-BiSU」は、ユーザーの閲覧履歴をもとに関心や嗜好を分析し、好みの記事をリアルタイムで表示します。','その他',NULL,NULL,true,NULL,'["\n                \n                サイト管理には専門的な知識が必要でしょうか？              \n特に必要ございません。\r\nA-BiSUは直感的な操作に加え、HTML編集も可能です。システムに詳しい方からパソコンの初心者まで対応可能な、懐の深いシステムです。", "\n                \n                管理できるサイトの規模は決まっていますか？              \n数ページから数百ページの大規模サイトまで幅広く対応しております。\r\n具体的にご検討の際には、ぜひご相談ください。", "\n                \n                デザインの制約はありますか？              \nございません。\r\n納得のいくデザインでWebサイトの作成が可能です。"]',NULL,'2024-05-28 10:17:17.016462','2024-06-09 07:23:29.383995',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(157,'Repro株式会社','2億648万円','2014年4月','/','Reproはアプリとwebの課題発見から解決までをワンストップで実現するマーケティングプラットフォームで、サービスの成長をご支援します。ツールの提供だけでなくASOや広告運用などの支援も行っています。','ReproWeb','Repro株式会社が提供する「ReproWeb」は、webサイトのユーザーの行動・属性データを取得し、マーケティングまで一気通貫で実現します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:17:18.304041','2024-06-09 07:23:29.464131',NULL,NULL,'お問合せください','製品画像29.jpeg'),
