(159,'EmotionIntelligence株式会社','274,373,134円','2011年5月','/','「瞬間を捉えるテクノロジーであらゆるビジネスを加速させる。」感情の高まりを解析するテクノロジーで、クライアントのビジネス課題を解決します。感情知能は、認知科学や行動心理学に基いて、人間の感情を察知し、行動変化を予測する技術です。','ZenClerk','EmotionIntelligence株式会社が提供する「ZenClerk」は、感情の高まりを解析する人工知能「EmotionI/O」が、サイト上で「最適なタイミングでの販促」を実現するWeb接客ツールです。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:17:23.122579','2024-06-09 07:23:29.651082',NULL,NULL,'お問合せください','製品画像14.jpeg'),
(160,'株式会社NTTドコモ','9,496億7,950万円','1992年7月1日','7,884名','【通信事業】・モバイル通信サービス・光通信サービスおよびその他の通信サービス【スマートライフ事業】・コンテンツ・コマースサービス・金融・決済サービス・ライフスタイルサービス【その他の事業】・法人ソリューション・あんしん系サポート※PrimalHoldingsは、AI電話サービスにおけるNTTドコモのパートナー企業です','ecコンシェル','株式会社NTTドコモが提供する「ecコンシェル」は、「NTTドコモ」と、ディープラーニングの最先端技術を持つ「PKSHATechnology」が共同開発したAIを搭載した、CVR改善の精度とスピードが特徴のWeb接客ツールです。2018年5月現在、導入社は5,000社を超え、市場No.1のシェアとなっています。','その他',NULL,NULL,NULL,NULL,'["\n                \n                どのような機能がありますか？              \n大きく分けて次の５つの機能がございます。\r\n\r\n・サイト分析　（サイト訪問者のアクセス情報を収集・蓄積・集計）\r\n・サイト訪問者の分類　（設定したキャンペーンを基に、施策のターゲットとなるお客様かどうかを特定）\r\n・Web接客　（ターゲットのお客様にだけオファー画像を配信することによる、顧客動線の改善）\r\n・自動最適化　（オファー画像やサイト導線のA/Bテスト→サイトのコンバージョンが上がるようにAIが自動で改善）\r\n・効果検証　（効果は可視化された売上・コンバージョン数で検証可能）", "\n                \n                どのような接客ができますか？              \n以下の接客が可能ですので、様々なキャンペーンを打つことができます。\r\n\r\n・お客様の属性情報に基づいた接客（デモグラフィック・ターゲティング）\r\n・お客様のWeb行動履歴に基づいた接客（行動ターゲティング）", "\n                \n                個人情報を管理しますか？              \n個人が特定できる情報は管理いたしません。"]',NULL,'2024-05-28 10:17:25.594941','2024-06-09 07:23:29.736584',NULL,NULL,'9,800円～','製品画像6.jpeg'),
