(162,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','ServiceCloud-FAQシステム','Salesforceが提供する「ServiceCloud」は最高のカスタマーサービスを提供できるCRMプラットフォームです。おすすめ記事や最適化された記事検索の活用で顧客を自動解決へ導きます。','月額',NULL,'0',true,true,'[]',NULL,'2024-05-28 10:17:30.406759','2024-06-09 07:23:29.888045',NULL,NULL,'参考料金（一部のみ掲載）月額料金　税別3,000円～','製品画像24.jpeg'),
(163,'株式会社クロスキャット','1,000百万円','1973年6月','849名（連結） 541名（単体）（2023年4月1日現在）','創業50年を迎えたクロスキャットは「信頼性」、「提案力」、「技術力」、「品質管理」という4つの強みをベースに、クレジットや金融、官公庁・自治体・公共企業をはじめ、製造、流通、通信などの幅広い分野において最先端のITサービスやプロダクトを提供しております。独立系のSIとして特にクラウドインフラ基盤構築サービスは近年470社以上の企業様と直接取引をさせて頂いています。そのノウハウを元にAI受託開発も行っています。','CC-DashAI','〜AI活用の最初の一歩に是非ご活用ください〜クロスキャットが提供する「CC-DashAI」は、AI技術を活用したコンサルティングサービスとPoCサービスをご提供しています。お客様のビジネス課題を解決するために、専門の技術チームがヒアリングからPoCまでの一連のプロセスをサポートいたします。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:17:33.648147','2024-06-09 07:23:30.137795',NULL,NULL,'CC Dash AI(コンサルティングサービス)　　500,000円 CC Dash AI(PoCサービス)　2,000,000円','製品画像22.jpeg'),
(164,'株式会社イコヒー','1000万円','2015年3月',' 50名（海外拠点含む）','テクノロジーでお客様のビジネスの成功を支援し伴走するデジタルパートナー、イコヒー（Ekohe）。コンサルティング、UI/UXデザイン、Web・モバイルアプリ・AI開発、データ基盤構築、DX支援を行う。','カスタムAI開発・DX戦略でスタートアップから大手企業までグローバルに支援','デジタル戦略の攻守、お任せください。株式会社イコヒーが提供する「カスタムAI開発・DX戦略」はスタートアップから大手企業まで多様な事業の成長を推進してきました。コンサルティングから開発、データ基盤構築まで、ワンストップで支援します。','その他',NULL,NULL,true,NULL,'["\n                \n                AIを活用したいのですが、何から始めればいいのか分かりません。ひとまず困っていることややりたい事を相談すれば解決方法を提案してもらえますか。              \nはい。固有の事情に合わせて、最初の一歩と未来へのロードマップを一緒に考えます。本格的なプロジェクト開始前にまず、御社のビジネスゴールやKPIについて確認し、御社が今どのような問題を抱えているのか、既存のデータやシステム、日々のワークフローはどうなっているのか等をクリアにするディスカバリーフェーズを設けています。それを基に、AI導入に向けて要件や優先度、プロジェクトの規模感を御社とすり合わせていきます。", "\n                \n                かなりアナログな組織で社内のデータも整理されていないのですが、DXの支援は可能ですか。              \nはい。FAXでのやりとりがメインでデータが紙ベースのものであっても、データ駆動型組織への道筋をご提案します。社内の意識変革のためのAIワークショップなどもご希望に応じて提供していますので、ぜひ事例をダウンロードしてご覧ください。", "\n                \n                AI活用のため初期のセットアップについては外注を検討していますが、いずれ社内で技術チームを設けたいと思っています。スムーズな引き継ぎは可能ですか。              \nはい。インハウス化の実績もありますのでご安心ください。ご要望に応じて、御社内技術チームの発足時に伴走しながらトレーニングなど別途サービス提供可能な場合がございます。一度ご相談ください。", "\n                \n                UX/UIデザインなど、AIやシステム以外の相談も可能ですか。              \nもちろんです。アプリなどのデザインから、デザインワークショップやDXを視野に入れたサービスデザインまで幅広く提供しています。また海外進出を検討中のお客様には、北米、ヨーロッパ、中国のローカルデザイナーが現地のユーザーを意識したデザインもご提案可能です。"]',NULL,'2024-05-28 10:17:36.115261','2024-06-09 07:23:30.207970',NULL,NULL,'お問合せください','製品画像8.jpeg'),
