(167,'ジーフィット株式会社','276,417,000円（資本準備金：38,858,400円）','2015年1月','-','ジーフィットは、グローバルビジネスの大きな課題の一つである為替リスクを適切にコントロールするソリューションを開発・提供するフィンテック企業です。伝統的な金融工学に基づく金融商品と高度な数理モデルやAIを含むデータサイエンス・金融システム開発に基づく技術を融合する「為替テック」の提供を通して、グローバルに挑戦する企業の成長やフィンテック業界の発展に貢献すべく事業を展開しています。','トレーダム','ジーフィット株式会社が提供する「トレーダム」は最新のマーケット情報と高度なAIにより導かれる「ヘッジガイド」機能や、外貨建取引や為替予約等を統合管理する「外貨管理」機能を含む為替業務支援ツールです。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:17:43.420618','2024-06-09 07:23:30.398006',NULL,NULL,'お問合せください','製品画像2.jpeg'),
(168,'株式会社キカガク','20,499,140 円','2017年1月','86 名','株式会社キカガクは、「教育」を軸に人材領域で企業のDXを支援しています。','AI受託開発支援','株式会社キカガクが提供する「AIコンサルティングサービス」は、DX・AIでビジネス成果を支援します。AIシステム開発、データ分析・活用、データ分析基盤構築、ChatGPT/AzureOpenAI導入支援といった様々なソリューションをご用意しています。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:17:46.144364','2024-06-09 07:23:30.457420',NULL,NULL,'要相談','製品画像7.jpeg'),
(169,'株式会社Digeon','100万円','2020年10月28日','20名','提案力と技術力でビジネス成長をサポート高い技術力と豊富な実績により、高品質かつお客様に付加価値で貢献するためのシステムを提供します。','AI受託開発（データ分析・画像認識）','高い技術力と豊富な実績により、高品質かつお客様に付加価値で貢献するためのシステムを提供します。弊社はAIを活用した事業価値の向上を、企画から実装・運用までサポートいたします。社内研究開発チームで最先端AI技術のキャッチアップとAIモジュール構築に注力し、蓄積したアルゴリズムを組み合わせることで最先端のアルゴリズムによる付加価値を迅速に提供します。','その他',NULL,NULL,true,NULL,'["\n                \n                開発期間はどのくらいになりますか？              \nシステムの規模によりますが、小規模で1~2ヶ月程度、大規模で6~10ヶ月程度になることが多いです。\r\nひとつのシステム開発に限らない基幹システムの全面リプレイスなど、数年かけたプロジェクトも対応いたします。", "\n                \n                費用はどのくらいかかりますか？              \nシステムの規模によりますが、数百万円から数千万円の規模の開発実績が多いです。\r\nお見積りについてはお気軽にご相談ください。", "\n                \n                どの言語・フレームでの開発に対応できますか？              \nディジョンのシステム開発では、フロントエンドをTypeScriptとReact、バックエンドをGoとEchoで開発することがメインです。\r\nそれ以外ではPythonとFastAPIを用いた開発にも対応しています。", "\n                \n                AIを具体的に活用する方法のブレストの段階でも相談できますか？              \nはい、AI活用のブレストから対応させていただきます。\r\n豊富な開発実績と先端技術への理解から、どのようにAIを活用するかをご提案できることがディジョンの強みのひとつです。"]',NULL,'2024-05-28 10:17:47.473016','2024-06-09 07:23:30.517549',NULL,NULL,'お問合せください','製品画像11.jpeg'),
(170,'株式会社neoAI','5,600万円（資本準備金を含む）','2022年8月','-','株式会社neoAIは、「時代のうねりを日本の成長に転換する」をVisionに掲げる東京大学松尾研究室発の生成AIスタートアップです。','需要予測AI開発・コンサルティングサービス','株式会社neoAIが提供する「需要予測AI開発・コンサルティングサービス」は、東京大学松尾研究所で共同研究に取り組むメンバー等がチームを組んでAI開発・データ分析を行います。POSデータや会計データを活用した売上予測など、貴社の課題に合ったモデル開発が可能です。','月額',NULL,'なし',true,NULL,'["\n                \n                AI開発のみをお願いしたいのですが可能でしょうか。              \n可能です。既に導入されているAIの精度向上といったご相談もお待ちしております。", "\n                \n                AI活用に十分なデータがないと思うのですが、相談可能でしょうか。              \n既存のAIモデルを用いて課題解決ができる場合もございますので、まずはお問合せください。"]',NULL,'2024-05-28 10:17:50.011403','2024-06-09 07:23:30.578947',NULL,NULL,'月額150万円〜400万円','製品画像25.jpeg'),
(171,'株式会社Liaro','952万円','2014年10月','約20名','Liaro需要予測AIでは、各社専用にカスタマイズされたアルゴリズムを用いることで高精度な予測を実現し、ジャンルを問わない幅広いソリューションを提供しております。','Liaro需要予測AI','Liaroが提供する「Liaro需要予測AI」は、大手小売企業にも導入されており欠品によるチャンスロスの最小化と同時にフードロスや衣服ロス等の削減を実現し、SDGs/ESGへの取組みやサスティナブルなビジネスの実現をサポートします。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:17:52.798604','2024-06-09 07:23:30.653919',NULL,NULL,'お問合せください','製品画像26.jpeg'),
(172,'株式会社ABEJA','１億円','2012年9月10日','82名(2022年8月末時点)','ABEJAは最先端のテクノロジーをベースにして企業のイノベーション創出に貢献する企業です。従来の産業構造を変え、ひいては社会のありようをも変えていくことで、企業理念で掲げる「ゆたかな世界を、実装する」を追い求めていきます。','AI導入/DX推進サービス','株式会社ABEJAが提供する「AI導入/DX推進サービス」は、DXの実行に必要なデータの生成・収集・加工・分析、AIモデリングまでのプロセスをご案内する「ABEJAPlatform」を基盤にして、お客様のAI導入/DX推進を、プランニングフェーズから支援します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:17:55.203611','2024-06-09 07:23:30.723229',NULL,NULL,'お問合せください','製品画像6.jpeg'),
(173,'株式会社エイゾス','1000万円','2014年8月','5名','AIZOTHは、全ての人にAI（人工知能）の力を与え、データを価値にするために、クラウド型AI統合解析プラットフォーム「Multi-Sigma®」の開発と、AIを用いたコンサルティング・研究開発支援・条件だし支援の事業を行っています。','Multi-Sigma','株式会社エイゾスが提供する「Multi-Sigma」は、必要最小限のデータから、複数の目的変数に対して、予測・要因分析・多目的最適化をシームレスに実行可能な、ノーコード型のウェブAI解析プラットフォームです。特に研究開発業務を中心に、飛躍的効率化と、革新的な解の探索にご利用頂けます。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:17:56.527806','2024-06-09 07:23:30.787896',NULL,NULL,'お問合せください','製品画像19.jpeg'),
