(175,'ニュートラル株式会社','4000万円','2000年3月24日',' 375名（2022/4/1現在）','お客様のニーズに合わせた形で「AI導入支援サービス」をご提供致します。同時に、質の高いAI導入サービスをご提供するにあたり、データ分析が必須である事を踏まえ、「データ分析サービス」もご提供させて頂きます。','NTechPredict','中小企業優秀新技術・新製品賞の優秀賞を受賞！スキル不要！予測から原因究明までこれ1つで解決AIがデータ活用を加速させる','年間',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:18:01.178484','2024-06-09 07:23:30.906242',NULL,NULL,'￥320,000～  〇永久ライセンス版標準価格：￥1,500,000年間保守：￥75,000〇サブスクリプションライセンス版（年額）標準価格：￥320,000 ※使用するPC1台あたりにライセンスが必要となります。 ※その他、導入支援、PoCサービス（有償）など対応可能ですので、お問い合わせください。','製品画像2.jpeg'),
(176,'アイフォーコム・スマートエコロジー株式会社','1千万円','平成24年1月','-','産業と技術革新の基盤をつくり、住み続けられるまちづくりを目標として、さまざまな社会課題に対応するソリューションの開発・販売を行っています。また、CPS/IoT/AIといった技術を活用し、生活をより豊かにしつつ、産業の活性化や社会問題の解決を図っていくシステム開発を行っています。・ディープラーニングを活用した「エネルギー需要予測、太陽光発電予測システム」・脱炭素、省エネ、電力コスト削減サービス「ecopro21」「eco-kaizen」・道路、交通省標識　インフラメンテナンスサービス「IRISGo」「IRISCity」・熱ストレス、一人作業の安全対策「作業者みまもりサービス」・現場のノウハウの見える化・デジタル化「伝承システムDX」','エネルギー需要予測','アイフォーコム・スマートエコロジー株式会社が提供する「エネルギー需要予測」は、様々なエネルギーの予測が可能！エネルギー需要予測・太陽光発電予測・熱量予測','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:18:03.607873','2024-06-09 07:23:30.974270',NULL,NULL,'お問合せください','製品画像5.jpeg'),
(177,'ソニーネットワークコミュニケーションズ株式会社','79億69百万円','1995年11月1日','1,823名','当社はソニーグループ唯一の通信事業会社として、IT・通信ビジネスの展開を担っています。「So-net光コラボレーション」や「NURO光」、「nuroモバイル」をはじめとするモバイルの分野や、企業向けクラウドなどの法人向けビジネスの分野においても、多様なニーズに応えるサービスを提供しています。今後は新たなビジョン「通信事業のその先へ」のもと、コアとなる通信事業を成長させるとともに、これまで培ってきたノウハウを活かし、ソニーグループの技術・製品・サービスを組み合わせることで、ソニーならではのIoT事業、その他新規事業にチャレンジしていきます。','PredictionOne','ソニーネットワークコミュニケーションズ株式会社が提供する「PredictionOne」は、専門家でなくても簡単に操作でき、データから予測を算出するソフトウエアです。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:18:06.098175','2024-06-09 07:23:31.036712',NULL,NULL,'デスクトップ版 / クラウド版それぞれプランをご用意しております。','製品画像30.jpeg'),
(178,'株式会社DATAFLUCT','4億4,712万円（資本金準備金含む）','2019年1月29日','30人','データから新たなビジネスを創出し、企業と社会の課題を解決するデータサイエンス・スタートアップスタジオ。自社サービス開発、DX支援、マルチモーダル機械学習プラットフォームの提供を中心に事業を展開。','Perswell','株式会社DATAFLUCTが提供する「Perswell」は、いちから開発不要のサービス型AI需要予測サービスで、安価に高精度の需要予測を実現します。数百商品の手動での需要予測を自動予測にすることで、業務時間を3割削減することも可能です。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:18:08.669496','2024-06-09 07:23:31.112331',NULL,NULL,'SKU数や予測頻度、商材によって異なるため、 個別見積もりとさせていただいています。','製品画像1.jpeg'),
(179,'株式会社pluszero','1億円','2018年7月10日','正社員数：44名　全社員数：127名','AI・自然言語処理・ソフトウェア・ハードウェア等の各種テクノロジーを統合的に活用したソリューション提供・開発・保守・運用および販売、ならびに受託及びそれらに付帯するコンサルティング業務','AIモデル開発','株式会社pluszeroが提供する「AIモデル開発」は、お客様の業務課題解決に即したご提案～PoC検証～AIモデル作成をワンストップでご支援します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:18:11.171259','2024-06-09 07:23:31.179375',NULL,NULL,'お問合せください','製品画像28.jpeg'),
(180,'株式会社電通国際情報サービス','81億8,050万円','1975年（昭和50年）12月11日','3,117名（2020年12月末現在）','コンサルティングサービス受託システム開発ソフトウェア製品（自社開発ソフトウェア）の販売／サポートソフトウェア商品（国内外ベンダーのソフトウェア）の販売／サポートアウトソーシング・運用保守サービス情報機器販売・その他','OpTApf','株式会社電通国際情報サービスが提供する「OpTApf」は、MicrosoftAzure上でMLOpsを実現するAIプラットフォームです。時系列データと画像データに両方対応し、これまでデータサイエンティストが担ってきた機械学習モデルの作成・運用・管理を自動化します。','月額',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:18:12.509889','2024-06-09 07:23:31.252653',NULL,NULL,'ライセンス　月額 400,000円～','製品画像28.jpeg'),
(181,'株式会社トライエッティング','382,992千円（資本準備金含む）','2016年6月6日','/','サプライチェーン領域における業務特化型拡張知能（AI）技術の研究開発およびライセンス販売事業','UMWELT','UMWELTは専門的な知識がなくても、さまざまな数量を予測でき、日常業務で使用するExcelデータと連携することによりCSVをAI化し、業務を効率化できるノーコード予測AIです。','その他',NULL,NULL,NULL,NULL,'["\n                \n                社内にAIやDXに強い人材がいなくても導入できますか？              \n可能です。ノーコードAIですのでDX・AIに対しての専門性は必要ございません。\r\n導入時に基礎的なAIについてとUMWELTの使用方法について講習会を実施しておりますのでご安心ください。\r\nまた、プロジェクトが自走するまで弊社コンサルタントが伴走するプランもご準備しております。", "\n                \n                本導入までにお試しなどのプランで検討することはできますか？              \n無料でのお試し、デモの提供は行っておりません。理由は2点ございます。\r\n1.分析結果はUMWELTの精度ではなくお客様がお持ちのデータに依存するため\r\n2.ノーコードではあるもののAIという特性上、サポート無しで製品をご利用いただいても結果が出にくいため\r\n受託開発ではないためPoCの必要がなく、業界平均よりも非常に早く安く使っていただける製品ですので、特に無料での使用期間が無くとも費用対効果がいいというお声を頂いております。", "\n                \n                アルゴリズムの精度はどの程度ですか？              \n一概に精度の良さをお示しするのは弊社だけではなく全てのAI製品において難しいです。\r\n理由はAIでの分析結果はお客さまのお持ちのデータに依存するためです。\r\n本HPに記載させていただいている大手企業様での導入実績や、各種アライアンス先にてご活用いただいている事実が全てかと考えます。\r\nご安心材料にしていただけますと幸甚です。", "\n                \n                導入にあたって、どんな準備が必要ですか？              \nデータのご準備とプロジェクトのご担当者様のアサインが必要です。\r\n・データについて：販売データや基幹システムから吐き出せる各種データ\r\n・ご担当者様について：上記のデータをご準備できる且つ現場業務にお詳しい方\r\n※事前にデータが課題解決に活用できるものか否かの確認はさせていただきます", "\n                \n                セキュリティが不安です。オンプレでの開発は可能ですか？              \n不可能です。クラウド製品のみのご提供で、GoogleChromeもしくはMicrosoftEdgeが必要です。\r\nセキュリティ対策については通常プランでも大手企業様での導入に耐えうる水準でご準備しております。\r\n高セキュリティ対応のプランのご準備もございますので詳細はお打合せ時にご相談ください。"]',NULL,'2024-05-28 10:18:15.192260','2024-06-09 07:23:31.364034',NULL,NULL,'お問合せください','製品画像28.jpeg'),
(182,'株式会社MOVER&COMPANY','1000万円','2008年8月','47名（グループ全体）2020年12月1日時点','MOVER&COMPANYは、業務・IT領域の様々な局面でのニーズに応じたコンサルティングサービスを提供します。当事者意識を強く持ったコンサルタントが、貴社の実情を踏まえた上で、地に足付いた効果的なソリューションを提案し、実現するまでとことん協働するプロフェッショナルファームです。','MAISTER™','AI化で経営課題を解決！株式会社MOVER&COMPANYが提供する「MAISTER™」は、AIで解決したい経営課題の明確化、PoCで予測モデル作成し導入効果を体感、AI本格展開の課題抽出と課題解決の推進（IoT/データ基盤刷新・RPA化・業務改善）など、製造業のDX推進をワンストップで支援する課題解決型ソリューションです。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:18:17.758932','2024-06-09 07:23:31.430208',NULL,NULL,'お問合せください','製品画像12.jpeg'),
