(186,'株式会社グリッド','/','2009/10/1','80名','「インフラ　ライフ　イノベーション」を企業理念として、2016年に日本で2番目となる深層学習ライブラリReNomを発表して以来、主に重厚長大産業・社会インフラ分野でのAI開発を行っております。','サプライチェーンの計画業務最適化サービス','サプライチェーンを運用する上で欠かせない配送・調達・生産計画。株式会社グリッドが提供する「サプライチェーンの計画業務最適化サービス」は、グリッド独自の手法を用いて計画業務を自動化・最適化し、現場で"使える"システムを提供します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:18:27.506446','2024-06-09 07:23:31.708777',NULL,NULL,'お問合せください','製品画像7.jpeg'),
(187,'株式会社MatrixFlow','/','/','/','株式会社MatrixFlowは、「誰もがAI技術を活用する社会の実現」をミッションに掲げるAIベンチャーです。大人から子供、ビジネスマンから学生、デザイナーからサイエンティストに到るまで、様々な人々がAIを活用し、素晴らしい着想を得たり、あっと言わせるクールな活動をすることを支援したいと考えています。その実現に向けた第一歩として、プログラミング不要のクラウド型AI構築プラットフォーム「MatrixFlow」を開発しております。','MatrixFlow','株式会社MatrixFlowが提供する「MatrixFlow」は、ドラッグ＆ドロップだけで機械学習・深層学習のモデルを構築することができるプログラミング不要のAI構築プラットフォームです。','その他',NULL,NULL,NULL,true,'[]',NULL,'2024-05-28 10:18:29.745610','2024-06-09 07:23:31.773152',NULL,NULL,'0円～	','製品画像22.jpeg'),
