(190,'株式会社DIVERT','-','-','-','ソフトウェア開発','ウクライナの高品質低価格なAI受託開発','完全オーダーメイドのAIプラットフォームを構築します既存のパッケージのAI製品では痒い所に手の届かなかった皆様へ企画から参画し伴走しながら、ご希望のAIプラットフォームの構築のお手伝いも可能です生成AIから画像処理まで幅広くお気軽にご相談くださいその他、アプリ・システム開発からハードの調達、DX支援など幅広くご対応いたします','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:18:35.888841','2024-06-09 07:23:31.976792',NULL,NULL,'お問合せください','製品画像7.jpeg'),
(191,'株式会社aix','1000万円','2018年6月','50名','プライバシー保護とデータ活用の両立を実現するため、先進的な匿名化技術を利用しプライバシーに敏感なリテール業界など様々な業界に向けたAI画像・映像分析ソリューションを提供しています。','個人情報保護型RetailCareサービス','-リテールAIテックで新たな顧客体験と価値を創造-「RetailCare」は顧客と運営データをリアルタイムで分析し、効率的な店舗管理を実現する。','その他',NULL,NULL,true,NULL,'["\n                \n                Deeping Sourceの技術でどのようにプライバシーを守りますか？              \n独自の匿名化技術を通じて個人識別情報を除去し、プライバシーを厳格に保護しながら、原本と同等の性能を持つAI学習用データを提供します。", "\n                \n                どの業界で利用できますか？              \n小売、モビリティー、自動運転、インフラ、オフィス、医療、セキュリティなど個人のプライバシー情報が含まれたデータと関連のあるすべての業界で利用可能です。", "\n                \n                どのような特許技術を持っていますか？              \n世界初のAI用データ匿名化技術を含む、約90件以上の特許を保有しています。", "\n                \n                Deeping Sourceの技術を導入する主なメリットは何ですか？              \nプライバシーを守りながらリアルタイムでのデータ分析を可能にし、業務の効率化、顧客体験の向上、売上増加に貢献します。また、非可逆的な匿名化プロセスによりセキュリティも強化されます。", "\n                \n                カメラとエッジデバイスの設置場所はどう決めるべきですか？              \n顧客の動向や行動パターンに沿って、設置場所の検討が必要です。店舗の設備環境に合わせたサポートを提供します。", "\n                \n                店舗におけるAIエッジデバイスとカメラ設置後のメンテナンスはどのように行われますか？              \n定期的なソフトウェア更新と異常発生時のハードウェア点検が必要です。問題が発生した場合は、サポートチームが迅速に対応します。ハードウェアの故障がない場合、ネットワークカメラへの遠隔操作での対応が可能です。", "\n                \n                SEAL処理とは何ですか？              \nSEAL処理は、映像やその他メディアデータから個人識別情報を匿名化し、AI学習に適した形でデータを保持する技術です。", "\n                \n                SEAL処理されたデータの安全性はどのように保証されますか？              \n非可逆的な匿名化処理により、元のデータへの復元が不可能なため、高度な情報の安全性保証されています。", "\n                \n                SEAL処理を行うために特別なハードウェアが必要ですか？              \n専用のエッジデバイスが必要な場合もありますが、データのみを提供いただき、処理後のデータを送付することも可能です。詳細はお問い合わせください。"]',NULL,'2024-05-28 10:18:37.580544','2024-06-09 07:23:32.045691',NULL,NULL,'お問合せください','製品画像12.jpeg'),
(192,'サイバネットシステム株式会社','9億9,500万円','1985年（昭和60年）4月','357名','サイバネットは、製造業の研究開発・設計関係部門、大学・政府の研究機関等へ、CAE、ICT、AR/VR、IoT、デジタルツイン、ビッグデータ、AI分野における先進的な製品・ソリューションを提供しています。','BIGDAT@Analysis','サイバネットシステム株式会社が提供する「BIGDAT@Analysis」は直感的なユーザーインターフェースで、専門知識がない方でも、簡単な操作でビッグデータの可視化・分析を行うことができるツールです','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:18:40.080089','2024-06-09 07:23:32.100918',NULL,NULL,'詳細については別途お問い合わせください','製品画像24.jpeg'),
(193,'ワークライフログ株式会社','105,132,111円','2019年4月','10名','ワークライフログ株式会社はパソコンログ解析AI「ワークライフログ」の研究開発・提供を行っています。','ワークライフログ','ワークライフログはパソコンログから業務内容を推測し、業務量や業務手順を可視化。より効率的な働き方を実現する業務管理プラットフォームです。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:18:42.605932','2024-06-09 07:23:32.155381',NULL,NULL,'お問合せください','製品画像27.jpeg'),
