(199,'株式会社エーエヌラボ','1,000万円','2007年5月','約50人','AIソリューションの開発・提供','7セグ画面OCR','株式会社エーエヌラボが提供する「7セグ画面OCR」は、7セグ等のデジタル数値に特化した独自の画像AIｰOCRによって、機器の液晶画面の計測値をカメラで読み取り、デジタルデータとして記録するサービスです','その他',NULL,'200000',true,true,'["\n                \n                どんな端末で利用できますか              \n推奨機器のスペックは以下です。\r\n1）スマートフォンの場合\r\n・iPhone/Androidどちらも可\r\n・カメラ：HD以上の解像度\r\n・5年以内に販売されている機種\r\n\r\n2)PCの場合\r\n・カメラ：HD以上の解像度\r\n・CPU：Duo以上の性能を持つもの", "\n                \n                社用の携帯（iPhone/Android）にインストールは可能ですか              \nはい、iPhone対応しておりますので、ご使用いただけます。\r\nお客様側で都合の良い機器を準備して頂き、弊社がそれらの機器にソフト・アプリをインストールする形になります。", "\n                \n                特殊な業務内容なので、OCRがどこまで使えるかあるかわかりません              \nまずはお客様の業務内容をヒアリングさせていただき、効果的な活用方法をご提案させて頂きます。無料トライアル期間もありますので、お気軽にお問合せください。", "\n                \n                ITやAIｰOCR技術のことがよくわかりませんが、相談可能でしょうか              \nお客様のやりたいことをどう実現していけるか、どのような段取りが必要か、といったこと全てについてご相談に乗ります。\r\nまた、必要に応じて仕様書作成や設計などの行程も弊社で実施いたします。", "\n                \n                導入までどれくらいかかりますか              \n最短1か月でご利用いただけます。\r\nビジネスの企画から開発までを含め3ヶ月ぐらいかかることもあります。"]',NULL,'2024-05-28 10:18:53.399014','2024-06-09 07:23:32.562933',true,200000,'5万円~/月（税別） ※ユーザ数、使用量やカスタマイズ要望に応じて変動します。','製品画像27.jpeg'),
