(203,'サイエンスパーク株式会社','4,000万円','1994年5月21日','-','サイエンスパークは、デバイスドライバ関連の開発を軸にハードウェア、ファームウェア、アプリケーションまで、全ての分野をクロスオーバーさせた事業展開を行っています。また、AI・画像処理のスペシャリストによる高い技術と知見に支えられた下記事業も行っています。・AI環境構築(HPCの調達とセットアップ)・AI教師データ作成・AI機械学習のパラメータ調整と精度評価・AIを使用したアプリケーション開発・画像処理アルゴリズム開発・画像処理技術を使用したアプリケーション開発・その他研究開発・試作開発支援','AI・DXコンサルティングサービス','まずは無料相談から可能です。サイエンスパーク会社名が提供する「AI・DXコンサルティングサービス」は、無料相談からAI・DXプロジェクト全般をサポート。開発や運用といったエンジニアリングサービスも提供します。','その他',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:19:02.108128','2024-06-09 07:23:32.818445',NULL,NULL,'相談：無料 要件定義：10~50万円 AI化可能性確認：50~100万円 試作開発：100~500万円 開発/運用・保守：別途お見積り','製品画像26.jpeg'),
(204,'株式会社バベル','1億円','2017年8月25日','25名','コア・テクノロジーであるAIオートメーション技術を各分野に実装したプロダクトとサービスを提供','ailead（エーアイリード）','株式会社バベルが提供する「ailead（エーアイリード）」は、既存の業務フローを変えずに、営業活動を可視化・最適化を通じて、生産性向上を実現できるサービスです。','その他',NULL,'なし',true,true,'["\n                \n                対応しているWeb会議ツールは何ですか？              \n現在対応しているのWeb会議ツールは、Zoom、GoogleMeet、MicrosoftTeamsです。", "\n                \n                無料のZoomアカウントでもaileadで録画できますか？              \nZoom、GoogleMeetをご利用の方は、プランに関わらずaileadをご利用いただけます。ただし、aileadが参加者としてカウントされるため、無料のZoomアカウントの場合は会議時間が40分に制限されます。", "\n                \n                録画を開始する方法を教えて下さい。              \nailead上での会議予約、または連携したGoogleカレンダー上での予定作成の場合は自動で録画が開始されます。ご自身以外が開始した会議の途中でも、URLを入力することで録画を開始できます。", "\n                \n                録画した動画を編集することはできますか？              \n録画した動画をailead上でトリミングしてチームに共有することができます。また、録画した動画をダウンロードしてご自身の動画編集ソフトで編集していただくことも可能です。", "\n                \n                どんなセキュリティ対策をしていますか？              \naileadは、国際規格に基づく情報セキュリティマネジメントシステム（ISMS）認証を取得しています。", "\n                \n                文字起こしの精度はどのくらいですか？              \n商談デモの文字起こし精度比較を実施したところ、aileadは94％の精度を記録しています。"]',NULL,'2024-05-28 10:19:05.127050','2024-06-09 07:23:32.877904',NULL,NULL,'各種３つの料金プランあり  ※営業担当者へご相談ください','製品画像30.jpeg'),
