(210,'株式会社電通国際情報サービス','81億8,050万円','1975年（昭和50年）12月11日','3,117名（2020年12月末現在）','コンサルティングサービス受託システム開発ソフトウェア製品（自社開発ソフトウェア）の販売／サポートソフトウェア商品（国内外ベンダーのソフトウェア）の販売／サポートアウトソーシング・運用保守サービス情報機器販売・その他','TexAIntelligence','株式会社電通国際情報サービスが提供する「TexAIntelligence」は、最新のNLP(自然言語処理)技術により文書の自動分類・類似検索・要約が行えるAIソリューションです。クラウド・お客様自社サーバの両方に対応し、APIによって既存システムとの連携も容易です。これまであきらめていた社内文書の活用を、TexAIntelligenceで実現しませんか？','月額',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:19:18.875256','2024-06-09 07:23:33.195615',NULL,NULL,'ライセンス　月額 400,000円～','製品画像15.jpeg'),
