(212,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','顔認識・表情の感情認識解析AIモデル改善コンサルティング','FastLabel株式会社が提供するAIモデル開発・コンサルティングは、感情解析AIの要件定義、PoC、AI倫理を守る権利クリアなデータセット作成・素材データ収集、学習データ・教師データ作成（アノテーション）、モデル開発までを一気通貫でサポートし、お客様のモデル認識精度改善にフルコミットします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \n大変申し訳ございませんが、一概に費用をご提示することができません。一度ご面談の上で概算のお見積りをお出しします。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はAI開発・コンサルティングだけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:19:21.221332','2024-06-09 07:23:33.311382',NULL,NULL,'お問合せください','製品画像20.jpeg'),
