(216,'株式会社Nelson','500万円','2010年5月','～10名','株式会社NelsonはゲーミングPC提供、業務ソフト開発、セキュリティ製品提供、モバイル端末修理を行う総合IT企業です。高品質な製品と迅速なサービスでお客様のニーズに応えます。','MessagePostbooster','SNS投稿の時間と労力を削減して、お店の知名度と集客力を向上させましょう！負担を減らして業務の効率化を実現します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:19:26.923915','2024-06-09 07:23:33.628362',NULL,NULL,'お問合せください','製品画像9.jpeg'),
(217,'感性AI株式会社','-','2018年 5月 25日','-','​私たちは独自のＡＩで、人の言葉の感性を精緻に可視化・定量化しています。‟感覚を表現する言葉”は人によって違いますが、同じものさしで比較することで、消費者のニーズに的確に応える商品の開発や​サービスの提供を可能にします。','感性AIアナリティクス','ネーミング、キャッチコピー、パッケージがご自身のPCで1分で評価可能。月額6万円～と低コストでありながら、「親しみ」「高級な」「安心感のある」など全43項目を何度でも分析・評価可能。国立大学法人電気通信大学知財を基に開発しています。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:19:29.378028','2024-06-09 07:23:33.728601',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(218,'株式会社comipro','300万円','2021年9月1日','-','ＡＩ（人工知能）に関するシステム販売及びコンサルティングに関する業務','comiproAI','株式会社comiproが提供する「comiproAI」は、表情(かお)のAI解析に特化したユーザー調査システムです。動画・映像・広告において消費者の「集中力」や「興味の度合い」「視線」を解析することで、コンテンツがどのように見られているかを知ることができます。','その他',NULL,NULL,NULL,NULL,'["\n                \n                デスクトップアプリへのインストールは必要ですか？              \nインストールの必要はなく、ブラウザアプリで使用いただけます。", "\n                \n                どのような場面で使用できますか？              \nYouTubeまたはZoomをご使用の際にAI解析が可能です。", "\n                \n                外部ツールと連携可能でしょうか？              \nGoogle・YouTube・Zoomと連携可能です。"]',NULL,'2024-05-28 10:19:31.684334','2024-06-09 07:23:33.805593',NULL,NULL,'お問合せください','製品画像10.jpeg'),
(219,'株式会社エフ・コード','241,384,626円','2006年3月15日','-','株式会社エフ・コードは、創業以来十数年に渡って蓄えたCX領域のデータ解析・ノウハウをコアとして、広範なデジタルサービスを展開することでお客様のDXを実現します。','hachidoriLINE広告','国内で数社しか存在しないLINE社による2つの認定パートナーであるhachidoriだからこそのご提案です。','その他',NULL,'100000',NULL,NULL,'[]',NULL,'2024-05-28 10:19:34.067533','2024-06-09 07:23:33.858541',true,100000,'お問合せください','製品画像17.jpeg'),
(220,'株式会社wevnal','2000万円','2011年4月','/','インターネット広告代理事業（各種運用型広告、クリエイティブ、メディア）／Chatbot事業','BOTCHANforLP','株式会社wevnalが提供する「BOTCHANforLP」は、ユーザーがFacebook広告をクリックすると「Messenger」にチャットボットが出現して、商品やサービス内容に関するユーザーからの質問に対して、メッセージ形式でリアルタイムに会話をさせることができる「対話型広告」を導入いたします。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:19:36.633272','2024-06-09 07:23:33.922065',NULL,NULL,'お問合せください','製品画像2.jpeg'),
(221,'株式会社データグリッド','1億円','2017年7月5日','53人（2021年5月末時点、パートタイム含む）','株式会社データグリッドは、生成AI、特にGAN（敵対的生成ネットワーク）や拡散モデルなどをコア技術をとした画像・動画生成ソリューションやデータ基盤サービスを製造業やアパレル、教育などの多様な業界に対して提供している京都大学発のAIスタートアップです。','カスタム生成AI・合成データソリューション','2017年より生成AIに特化して事業を展開しているデータグリッドは、画像・動画生成AIを中心に様々な独自の生成AIを活用し、自動運転用データ、EC画像、LiDARデータ、衛星画像、インフラ設備劣化データなど多種多様な教師データ・シミュレーションデータの生成や、各社のデータに特化した生成AIの開発、生成AIのシステム組み込みなどをサービスとして提供しております','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:19:38.086159','2024-06-09 07:23:33.982340',NULL,NULL,'お問合せください','製品画像21.jpeg'),
(222,'株式会社データグリッド','1億円','2017年7月5日','53人（2021年5月末時点、パートタイム含む）','株式会社データグリッドは、生成AI、特にGAN（敵対的生成ネットワーク）や拡散モデルなどをコア技術をとした画像・動画生成ソリューションやデータ基盤サービスを製造業やアパレル、教育などの多様な業界に対して提供している京都大学発のAIスタートアップです。','AnomalyGenerator','不良品画像生成AIを活用して多様な学習データ、網羅的な評価データを生成することで、不良品のデータ不足課題を解決し、外観検査システムの早期立ち上げと精度向上を実現します。','その他',NULL,NULL,true,NULL,'["\n                \n                画像の解像度の制約はありますか？対応する画像の拡張子を教えてください。              \nAIの種類によって対応する解像度が異なりますが、そのうち1つは解像度の制約は約5000pixel程度で、もう１つは1000pixel程度です。画像の拡張子は、bmp,png.jpeg/jpg,tiffに対応しております。", "\n                \n                画像生成にかかる時間はどれくらいですか？              \n画像の解像度に依存しますが、1枚1秒から数秒程度です。", "\n                \n                何枚の画像を学習データに加えると精度向上が期待できますか？              \n精度向上に必要な枚数はケース・バイ・ケースですが、一例として20枚程度の不良データに対して100枚程度の不良データを追加したところ、約10%の見逃し率と誤検知率をともに0%にできたという事例がございます。", "\n                \n                ある製品の不良部を別の製品に移植することはできますか？              \nはい、ある製品の不良部を別の製品に移植することができます。不良データが蓄積されていないような新製品の立ち上げ時に特に有効です。", "\n                \n                市販の外観検査ソフトウェアにも合成データを利用できますか？              \nはい、合成データは市販の外観検査ソフトウェアにも利用できます。市販の外観検査ソフトウェアの水増し（データ拡張）機能に加えて、合成データを活用することで撮像データだけを使う場合に比べて精度が向上したという事例が多数報告されています。", "\n                \n                どのようなプロパティを変化させることができますか？              \n不良部の大きさ、回転角度、形状、色、輝度などのプロパティを変化させることができます。", "\n                \n                合成データを評価データに使うことは可能ですか？              \nはい、生成した合成データは評価データとしてご利用することも可能です。", "\n                \n                ルールベース検査にも使えますか？              \nルールベース検査用途に人為的には用意するのが難しい、評価用の網羅的な（様々なプロパティを変化させた）不良データを合成することが可能です。", "\n                \n                良品画像は生成できますか？              \n不良品画像のかわりに良品画像をAIの入力することで、良品画像も生成することができます。", "\n                \n                必要なPCのスペックはどれくらいですか？              \nクラウドサービスなのでお使いのPCのスペックの制約はございません。"]',NULL,'2024-05-28 10:19:39.571649','2024-06-09 07:23:34.037455',NULL,NULL,'お問合せください','製品画像6.jpeg'),
(223,'VNEXTJAPAN株式会社','約4,300万円','2008年1月','約460名','VNEXTは15年以上、IT総合サービス会社として東京・ハノイ・ダナンで多角的な事業を展開。AIやブロックチェーンに特化したグループ会社も設立し、高品質で柔軟な開発サービスを提供しています。','AI受託開発・導入支援','VNEXTJAPAN株式会社が提供する「AI受託開発・導入支援」は15年以上の経験と多数の開発実績から得た知見とノウハウを活かし、高品質なプロダクトでお客様のAI導入を支援。コンサルティングからPoC、開発〜テスト、実装、運用・保守までをワンストップで提供。','年間',NULL,NULL,true,NULL,'["\n                \n                開発期間はどのくらいになりますか？              \nシステムの規模によりますが、小規模で2~3ヶ月程度、大規模で6~10ヶ月程度になることが多いです。\r\nひとつのシステム開発に限らない基幹システムの全面リプレイスなど、数年かけたプロジェクトも対応いたします。", "\n                \n                費用はどのくらいかかりますか？              \nシステムの規模によりますが、数百万円から数千万円の規模の開発実績が多いです。\r\nお見積りについてはお気軽にご相談ください。"]',NULL,'2024-05-28 10:19:42.172181','2024-06-09 07:23:34.113716',NULL,NULL,'相談：無料 エンジニア単価（オフショア）：45万円〜 専属チーム構築（ラボ型）：90万円〜 PoC：100万円〜 年間割引（1年以上の契約の方）：5〜10%割引 ※詳細はお問い合わせください','製品画像29.jpeg'),
