(225,'株式会社neoAI','5,600万円（資本準備金を含む）','2022年8月','-','株式会社neoAIは、「時代のうねりを日本の成長に転換する」をVisionに掲げる東京大学松尾研究室発の生成AIスタートアップです。','DreamIconBusiness','DreamIconは画像の特徴を学習し、20種類以上のテーマに沿ったアイコン画像を生成するサービスです。約30000枚のアイコン画像をユーザーに提供する中で培った画像生成AI技術を御社のビジネスにご活用いただけます。','月額',NULL,NULL,true,true,'["\n                \n                無料トライアルがしたいのですが可能ですか？              \nAIの品質をご確認いただけるものをいくつかご用意しております。お打ち合わせにてご案内いたします。", "\n                \n                画像生成AIの開発をお願いしたいのですが可能でしょうか？              \n可能です。お打ち合わせにて、ヒアリング・ディスカッションをさせていただけますと幸いです。"]',NULL,'2024-05-28 10:19:46.298075','2024-06-09 07:23:34.277570',NULL,NULL,'月額50,000円~','製品画像19.jpeg'),
(226,'ミライドリ株式会社','-','-','-','営業自動化システムの開発・販売営業代行業務','営業革命','日本国内のWEBサイトをAIが選別して貴社サービスのオファーメールを自動送信','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:19:48.952883','2024-06-09 07:23:34.349955',NULL,NULL,'お問合せください','製品画像15.jpeg'),
