(228,'HubSpotJapan株式会社','500万円','2016年2月','約2,745名','HubSpotは、顧客を企業の推奨者に転換する「インバウンド手法」基づき、永続無料のCRMと、マーケティング、セールス、カスタマーサービスを管理・実践できる単一プラットフォームを提供しています。','HubSpotMarketingHub','HubSpotJapan株式会社が提供する「HubSpotMarketingHub」は、トラフィックを増やし、リードを顧客に転換し、ROIも測定できる、オールインワンのマーケティングプラットフォームです。','月額',NULL,'0',NULL,true,'["\n                \n                Marketing Hubでは、どのようなレポート機能を利用できますか？              \nマルチタッチ収益アトリビューションレポートを使用すると、すべてのマーケティング活動を該当する成約案件に関連付けることができます。そのため、マーケティングがどれだけ収益に貢献したかを正確に把握し、チーム全体の功績を証明することができます。また、カスタムレポートを作成し、MarketingHub内の測定指標やCRM内のレコード、連携済みアプリからのさまざまなデータを追跡することが可能です。HubSpotアカウントには柔軟な複数のダッシュボードが含まれているため、すべてのデータを1か所で参照でき、関係者間で簡単にレポートを共有できます。", "\n                \n                自社のMarketing Hubアカウント上でデータをカスタマイズできますか？              \nはい。MarketingHubのEnterpriseエディションで利用できるカスタムオブジェクトは、個々のビジネスに適応する柔軟性を備え、高度な制御に対応できます。カスタムオブジェクトでは、オブジェクト名や保持するプロパティーの設定、他のオブジェクトとの関連付けを自由に行うことができます。"]',NULL,'2024-05-28 10:19:53.937366','2024-06-09 07:23:34.490837',NULL,NULL,'月額 6,000円～	','製品画像26.jpeg'),
(229,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','AccountEngagement(旧Pardot)','株式会社セールスフォース・ジャパンが提供する「AccountEngagement(旧Pardot)」は、マーケティングの各段階で有力な見込み顧客を獲得し、営業担当者にスマートに情報を伝達します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:19:55.181702','2024-06-09 07:23:34.566525',NULL,NULL,'お問合せください','製品画像22.jpeg'),
(230,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','MarketingCloudEinstein','株式会社セールスフォース・ジャパンが提供する「MarketingCloudEinstein」は、適切な時に適切なチャネルを通じて、最適なコンテンツを、それにふさわしい顧客にパーソナライズします！','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:19:57.579666','2024-06-09 07:23:34.632955',NULL,NULL,'お問合せください','製品画像18.jpeg'),
(231,'クラウドサーカス株式会社','150,000千円','2021年7月1日','233名','クラウドサーカスは、東証一部上場のスターティアホールディングスのグループ会社として、デジタルマーケティング事業を担っています。現在、「CloudCIRCUS」のブランド名のもと、11つのプロダクトを展開し、情報発信から集客、顧客体験価値の向上、解約防止・リピート増までの各種機能をカバー。','BowNow（バウナウ）','クラウドサーカス株式会社が提供する「BowNow（バウナウ）は、無料から使えるマーケティングオートメーションツールです。導入者数13,000社以上の国内MAシェアNo.1を誇ります。','月額',NULL,'100000',NULL,true,'["\n                \n                本当に無料で使えますか？              \n基本機能は無料でお使いいただけます。有料プランのご利用には別途お申し込み手続き（ご契約）が必要となります。自動で課金されるような仕組みではございませんのでご安心ください。", "\n                \n                自社で活用できるか不安です。              \n実際にご導入いただいている企業様の中でも、マーケティング専任部署がある企業は50％程度と、BowNowはこれからマーケティングを始めたいと思っている方に最適なツールです。\r\n活用をご支援するコンテンツもございますのでご安心ください。", "\n                \n                導入に必要なものはなんですか？              \nCloudCIRCUSアカウント発行フォームに入力いただく基本情報のみです。ご活用に際しては貴社Webサイトへタグを埋め込んでいただく必要がございます。"]',NULL,'2024-05-28 10:20:00.099060','2024-06-09 07:23:34.697324',true,100000,'月額12,000円～','製品画像22.jpeg'),
(232,'Markefan株式会社','990万円','2018年7月13日','５名','AIを標準装備した初めてのマーケティングオートメーション製品を提供します。','Markefan（マーケファン）','・「柔軟性」・「拡張性」・「ROI向上」を実現します。Markefan株式会社が提供する「Markefan（マーケファン）」は、AIを標準搭載したMA製品です。','年間',NULL,'100000',NULL,true,'[]',NULL,'2024-05-28 10:20:01.286521','2024-06-09 07:23:34.771460',true,100000,'年額 600,000円～','製品画像18.jpeg'),
(233,'株式会社シーエーシー',' 4億円','2014年4月1日','1128名 （2022年12月31日現在）','CACは、デジタルテクノロジーを用いて、顧客や社会の将来に良い影響を与える、価値あるサービスと製品を提供し、デジタルイノベーションに貢献します。','表情感情解析AI「Affdex」','世界最大級の顔画像データベースとFACS理論に基づく表情分析で感情を可視化する','その他',NULL,'なし',NULL,NULL,'["\n                \n                FACSとは何ですか。              \nFACSはFacialActionCodingSystem（顔面動作符号化システム)の略であり、PaulEkmanとWallaceV.Friesenによって１９７８年に開発された、人間の顔の動きを視認可能にする表情理論のことです。", "\n                \n                このシステムは何が検知可能ですか。              \nAffdexは下記の項目を検知できます。\r\n・23種類の表情（0～100の数値で表示されます）\r\n・10種類の感情（0～100の数値で表示されます）\r\n・2種類の特殊指標\r\n①Valence（－100～100の数値で表示されます）\r\n②Engagement（0～100の数値で表示されます）", "\n                \n                人を特定した感情認識は可能ですか？              \n人の特定はできません。Affdexは感情認識に特化した技術です。人の特定した感情認識を実現したい場合、他社の人認識技術と組み合わせてご利用頂く必要があります。", "\n                \n                赤ちゃんや動物の感情を検知可能ですか？              \n赤ちゃんおよび動物にはそれぞれ専用なFACSが存在しています。\r\n但し、Affdexは上記２種類のFACSを導入してないため、３歳以下の赤ちゃん、または動物の感情認識としてご利用いただけません。", "\n                \n                検出精度の限界はありますか。              \nはい、あります。Affdexを利用する際、下記の条件を満たさない場合は、感情の検出精度が下がります。\r\n・画面解像度の縦ピクセルの10％以上、且つ、顔のサイズが30×30ピクセル\r\n・頭部位置（ポーズ）：正面から、±25度までの回転（ピッチ、ヨー、ロール）\r\n・顔が部分的に隠されていないこと。例えば、マスクをしている、サングラスをしている、髪の毛で顔が隠れている、帽子を深くかぶっている場合は検知できないことがあります。\r\n・光が明るすぎない、暗すぎないこと。", "\n                \n                個人差に対応していますか？              \nAffdexはAffectiva社が蓄積されているデータベースに基づき、個人差に関係なく有効な分析をしています。", "\n                \n                日本人の感情は検知しにくいのではないですか？              \n文化的背景によって、感情を出しにくい人種はありますが、出た感情に関しては、分析結果は同じになります。", "\n                \n                うそ発見器として利用できますか？              \n「うそ」を検知するものではありません。周辺環境、ジェスチャーや話の内容によって、判断する必要があるため、Affdexの技術単体では「うそ発見器」としてご利用いただけません。", "\n                \n                日本の事例ありますか？              \nはい、ございます。", "\n                \n                Affdexを使用するのに必要なハードウェアおよびソフトウェア要件は何ですか？              \nPC,PCカメラ（もしくは外付けカメラ）が必須となります。\r\n※詳細の動作要件は「サービス紹介ページ」をご参照ください。"]',NULL,'2024-05-28 10:20:03.774543','2024-06-09 07:23:34.847580',NULL,NULL,'問合せください','製品画像7.jpeg'),
(234,'audioコーパス株式会社','-','2022年7月','-','「音声認識のブースターに」を企業理念に、音声認識AIに学習させるデータ製作を専門とする会社です。プロフェッショナルな書き起こし仕様とアノテーション仕様を融合させ、音声認識エンジンの支援を行っています。','audioコーパスデータセット','audioコーパス株式会社が提供する「audioコーパスデータセット」は、発話音声および書き起こしテキストに、タグなどを付与したデータセットのパッケージ商品となります。お好きな発話カテゴリよりお買い求めいただけます。','その他',NULL,'0',NULL,true,'[]',NULL,'2024-05-28 10:20:04.972086','2024-06-09 07:23:34.966445',NULL,NULL,'1分当たり350円（※データセット内容：wav/txt/eaf）','製品画像27.jpeg'),
(235,'株式会社シーエーシー',' 4億円','2014年4月1日','1128名 （2022年12月31日現在）','CACは、デジタルテクノロジーを用いて、顧客や社会の将来に良い影響を与える、価値あるサービスと製品を提供し、デジタルイノベーションに貢献します。','音声感情解析AI　Empath','シーエーシーが提供する「Empath」は、音声等の物理的な特徴量から人間の感情を独自のアルゴリズムで判定する日本製の感情解析AIです。数万人の音声データベースを元に喜怒哀楽や気分の浮き沈みを判定します。現在50か国、4,300ユーザーのご利用実績があります。','その他',NULL,NULL,NULL,NULL,'["\n                \n                感情解析の仕組みは？              \n感情解析は5つの感情（平常、喜び、哀しみ、怒り、元気度）を出力しています。\r\n開発にあたり、40,000人の音声データを集めて、十数人のの評価者がそれら全ての音声を聞き喜怒哀楽四つの感情ラベルを振りました。そのうち過半数以上の評価者に同じラベルが振られた音声データを教師データと定義し、その音声群の共通する音響特徴（ピッチ、パワー、スピード等）を機械学習で抽出し、感情推定するエンジンを作りました。", "\n                \n                方言は対応できているか？              \n方言についても学習データの中で吸収ができております。\r\n現状様々な方言のお客様がお電話をされるコールセンターでご活用いただいております。", "\n                \n                リアルタイムでの解析は可能か？              \nリアルタイムでの感情解析ができるエンジンとなっています。\r\n実際のリアルタイム解析についてはシステム構築をする際の設計によりますのでご理解ください。", "\n                \n                チューニングはできる？              \nチューニングも別途費用を頂戴して行うことができます。\r\n感情解析だけでなく、口論の検知や盛り上がり度の検知など多くの実績がありますのでお問い合わせください。", "\n                \n                既存のサービスとの連携はできる？              \n既存サービス側でのカスタマイズが可能であれば、多くのプラットフォームと連携可能となります。\r\nサービス側での画面設計などが必要ですので、まずは、サービス提供ベンダーにお問い合わせください。"]',NULL,'2024-05-28 10:20:07.886613','2024-06-09 07:23:35.038986',NULL,NULL,'お問合せください','製品画像11.jpeg'),
(236,'株式会社シーエーシー',' 4億円','2014年4月1日','1128名 （2022年12月31日現在）','CACは、デジタルテクノロジーを用いて、顧客や社会の将来に良い影響を与える、価値あるサービスと製品を提供し、デジタルイノベーションに貢献します。','BelugaBoxSaaS','CACが提供する「BelugaBoxSaaS」は感情・音響解析を元に、コールセンターの通話の解析を行います。音声感情解析AI「Empath」を活用し、オペレータ、顧客双方の音声を解析。運営に役立つデータを見つけ出します。','その他',NULL,'500000',true,NULL,'["\n                \n                どのように感情解析をしていますか？              \n言葉の意味内容ではなく音響特徴から感情解析をしています。", "\n                \n                どのような感情を解析できますか？              \n落ち着き、怒り、喜び、悲しみと発話者が元気かどうかが解析できます。また、顧客が満足したかどうかも測定可能です。", "\n                \n                感情解析のチューニングはできますか？              \n別途費用が掛かりますがチューニング可能です。", "\n                \n                システム連携実績はありますか？              \nAmazonConnect、AWS、Azure、AVAYA、Cte1SaaS、INNOVERA、Omnis等と連携実績があります。", "\n                \n                AIモデルのカスタマイズは可能ですか？              \n別途費用が掛かりますがAIモデルのカスタマイズは可能です。アウトバウンドコール時のホットリード予測モデルや、解約意思推定モデルなど過去実績があります。"]',NULL,'2024-05-28 10:20:10.394401','2024-06-09 07:23:35.102312',true,500000,'基本利用料：　85,000円/月（600,000分まで解析可能）※ 従量課金：　　1分あたり0.2円（基本利用料金を超えた部分から課金）  オプション利用料 ①品質評価の自動スコアリング機能　30,000円/月 ②オペレータのメンタル支援機能　　30,000円/月  ※ Web socket接続によるリアルタイム解析は95,000円で利用可能。','製品画像18.jpeg'),
(237,'株式会社PKSHACommunication','100万円','2021年5月12日','117名','PKSHACommunicationは顧客接点の高度化・効率化領域にソリューションとプロダクトを提供、人の業務を効率化、能力を拡張していく形で多様な形でのビジネス支援や企業の課題を解決しています。','PKSHASpeechInsight','株式会社PKSHACommunicationが提供する「PKSHASpeechInsight」は、システム開発不要、PCにアプリをインストールするだけで簡単に導入が出来ます。また、ACW効率化だけでなく、オペレーターのモニタリングサポート・応答品質向上にも活用出来ます。','その他',NULL,NULL,true,true,'["\n                \n                何席から導入できますか？              \n10席から導入可能です。", "\n                \n                共有のPCを使ってる場合、席のカウントはどうなりますか？              \n端末＝席とお考えください。", "\n                \n                Macでも使えますか？              \n利用は可能です。ただし、ソフトフォン連携が出来ない場合があります。"]',NULL,'2024-05-28 10:20:12.974834','2024-06-09 07:23:35.157261',NULL,NULL,'別途お問い合わせ','製品画像24.jpeg'),
(238,'株式会社AID','-','2020年2月','-','企業規模や業界・業種を問わず、お客様とAI技術を繋ぐ製品「Package20」・「Builder」の提供、及びAIアルゴリズムの受託開発・コンサルティングなどを手掛けています。','AIアルゴリズム「Package20」','性別・年齢等を識別する「顧客属性推定」、乗り物や人などを検出する「物体検知」、店舗内の混雑状況などを把握するための「滞在人数カウント」、工場現場での安全性チェックに有効な「ヘルメット検知」など、様々な商用シーンで活用いただけるAIアルゴリズム20種をパッケージ化して提供しています。ご利用は、ソラコム製AIカメラ「S+Camera」にAIアルゴリズム「Package20」をインストールいただくだけです。','その他',NULL,'なし',NULL,NULL,'["\n                \n                AIは難しいイメージがあります。私でも使えるでしょうか？              \nまずは試してみてください。AI技術の導入には、様々な試行錯誤が必要です。", "\n                \n                ソースコードを見ることは可能ですか？              \nS+Camera向けのAIアルゴリズムは、tgz形式で配布しております。解凍することで、ソースコードを見ることができます。", "\n                \n                AIの性能はどの程度保証できますか？              \n株式会社AIDは、「Package20™」に含まれるAIアルゴリズムの性能を一切保証いたしません。加えて、株式会社AIDは、Package20™に起因する様々な過失、直接・間接損害等を補償いたしません。※「Package20™」中のAIアルゴリズムの特定の目的用への高性能化をご希望の場合、個別にお問い合わせください。"]',NULL,'2024-05-28 10:20:15.370793','2024-06-09 07:23:35.216118',NULL,NULL,'9,800円(税込み)','製品画像21.jpeg'),
(239,'株式会社pluszero','1億円','2018年7月10日','正社員数：44名　全社員数：127名','AI・自然言語処理・ソフトウェア・ハードウェア等の各種テクノロジーを統合的に活用したソリューション提供・開発・保守・運用および販売、ならびに受託及びそれらに付帯するコンサルティング業務','自然言語処理','株式会社pluszero独自のエンジンを活用し、意味に踏み込んだ自然言語解析が可能です。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:20:17.707647','2024-06-09 07:23:35.277117',NULL,NULL,'お問合せください','製品画像8.jpeg'),
