(241,'一般社団法人　社会整備サポート協会','1000万円','2012年4月','/','「カスタマイズ」と「ホワイトボックス化」で貴社のAI推進をサポートします。・AIモデルのカスタマイズ構築・AIモデルの内製化・システム制作','満足度向上モデル','【このサービス導入で得られるメリット】・大量の文章を要約（全て読む必要無し）・大量の文章を属性ごとにポジティブネガティブに分類（打ち手が分かる）・大量の文章を似たもの同士に分ける（グループ毎に対策を変えられる）','月額',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:20:22.818573','2024-06-09 07:23:35.407499',NULL,NULL,'モデル構築（約３ヶ月程度）月額 400,000円～ モデル構築後の保守（約１２ヶ月程度）月額 100,000円～','製品画像13.jpeg'),
