(244,'VITALIFYAsiaCo.,Ltd.','$100,000','2008年5月','従業員数154名','ベトナムホーチミンでAI開発とスマートフォン及びWEB開発に強いオフショア開発会社です。','MALFaceEmotion','VITALIFYAsiaCo.,Ltd.が提供する「MALFaceEmotion」は、スマホやPCのカメラで撮影した人物の顔表情から、感情を解析し数値化する（SDK）です。','年間',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:20:27.505239','2024-06-09 07:23:35.650282',NULL,NULL,'SDK単体提供: $300/月ダッシュボード利用: $200/月・最低契約期間 6 ヶ月〜・ログ保存期間:１年間・シングルアカウントのみ対応 ※複数アカウントの管理をご希望の場合には、別途ご相談ください。※2週間無料でお試し頂けます。※カスタマイズ導入のご相談も可能です。','製品画像25.jpeg'),
