(247,'株式会社インフォディオ','1億円','2002年7月',' 97名（2023年2月現在）','■AI/ITソフトウェアプロダクト・クラウドサービスの開発・販売スマートOCR、DenHo[導入先]法務省　統計センター（総務省）　国税庁　県警察金融機関等　数百社　■ソフトウェア開発・システムインテグレーション[実績]国税庁　株式会社JTB　みずほ銀行　株式会社エヌ・ティ・ティ・データ等※敬称略','brox','見つけられない迷子のファイルはもういません。紙文書もドキュメントファイルも横断的に全文検索。brox(ブロックス)は蓄えた情報を活用へと導きます。','その他',NULL,NULL,NULL,NULL,'["\n                \n                AI-OCRの利用に費用はかかりますか？              \nAI-OCRは無制限でご利用いただけます。", "\n                \n                文書の自動分類機能（タグの自動付与）はどのような仕組みですか？              \nドキュメント内に存在する特定の文字列をシステムが見つけてタグを自動付与します。\r\n対象となる文字列はユーザーによる設定が可能です。", "\n                \n                スマートフォンで撮影した文書の中身も全文検索の対象ですか？              \nスマートフォンで撮影した写真は、ゆがみ補正や台形補正による画像処理を行いOCR変換されるため、高精度なデータ化が可能であり、問題なく全文検索を行うことができます。", "\n                \n                AI-OCRの文字認識精度はどれくらいですか？              \n活字で99.8%、手書き文字で99.8%となります。搭載されているAI-OCRエンジンは官公庁や金融機関でも数多くの採用実績のある「スマートOCR」と同じものが搭載されています。", "\n                \n                トライアルは可能ですか？              \n無料でクラウド上のデモサイトでお試しいただくことが可能です。\r\nオンプレミス機でのトライアルをご希望の場合はご相談ください。"]',NULL,'2024-05-28 10:20:35.467380','2024-06-09 07:23:35.849984',NULL,NULL,'お問合せください','製品画像23.jpeg'),
