(249,'株式会社NTTドコモ','949,679百万円（2023年3月31日現在）','1992/7/1','7,903名（当社グループ47,151名）（2023年3月31日現在）','通信事業携帯電話サービス（5Gサービス、LTE（Xi）サービス、FOMAサービス）、光ブロードバンドサービス、衛星電話サービス、国際サービス、各サービスの端末機器販売などスマートライフ事業動画配信・音楽配信・電子書籍サービス等のdマーケットを通じたサービス、金融・決済サービス、ショッピングサービス、生活関連サービスなどその他の事業補償サービス、法人IoT、システム開発・販売・保守受託など','gooSearchSolution','「gooSearchSolution」はECサイト向けのサイト内検索です。AIを活用してユーザーの行動ログを解析し、自動で検索結果の改善を行います。ポータルサイト「goo」で蓄積したノウハウや「表記ゆれ辞書」が、人手では対応できないロングテール部分の改善を行い0件ヒット率やコンバージョン率を改善します。','月額',NULL,NULL,true,NULL,'["\n                \n                表記ゆれ辞書だけの導入は可能ですか？              \n可能です。\r\n表記ゆれ辞書APIのご提供をさせていただきます。", "\n                \n                今まで手作業で作ってきた表記ゆれ辞書があるのですが、goo Search Solution導入後も、そのまま活用することは可能ですか？              \n可能です。今まで作成していただいた辞書をそのまま辞書登録する形で、gooSearchSolutionで自動生成される辞書と合わせてご利用いただけます。", "\n                \n                自動で表記ゆれ辞書が生成されると言いますが、どのくらい生成されるのですか？              \nログの分量によって異なってくるため一概には言えませんが（ログの量が多ければ多いほど、多くの辞書が生成されます）、ポータルサイト「goo」で自動生成される辞書が日々追加されますので、貴社のログからの生成以外でも表記ゆれをカバーすることができます。"]',NULL,'2024-05-28 10:20:39.474717','2024-06-09 07:23:36.039072',NULL,NULL,'月額制（個別お見積り）','製品画像23.jpeg'),
(250,'株式会社amplifiedai','/','2017/02/21','11','独自開発のAIを搭載した特許調査プラットフォームAmplifiedを提供。各国特許庁に採用される確かな精度、誰もが使えるUI/UXを備え、調査工数を短縮。人間が高度な分析に集中できる環境を作ります。','Amplified','株式会社amplifiedaiが提供する「Amplified」は、特許番号、発明提案、技術明細を入力するだけで、世界中の特許を読み込んだAIが類似文献リストを即表示。ユニークなAI対話型インターフェースで、調査中にもユーザーの意図を理解しながら、人間が見つけられない文献まで発見します。','月額',NULL,'なし',NULL,true,'[]',NULL,'2024-05-28 10:20:40.787268','2024-06-09 07:23:36.161570',NULL,NULL,'月額 20,000円〜','製品画像23.jpeg'),
(251,'住友電工情報システム株式会社','4.8億円','1998年10月1日','600名','住友電工情報システムは、住友電工グループの一員として培ってきた技術・経験・ノウハウ・実績をベースに、グループ外のお客様にも最適なソリューションやパッケージソフト製品をご提供している会社です。','QuickSolution','住友電工情報システム株式会社が提供する「QuickSolution」は、数百TB規模でも高速セキュア検索できる純国産エンタープライズサーチ（企業内検索システム）です。RAG対応により社内用生成AIとしての活用も可能です。','その他',NULL,'2500000',true,true,'["\n                \n                社内のファイルサーバの全文検索は可能ですか？              \n社内に分散されたファイルサーバを横断的に検索できます。企業内検索システムの「QuickSolution」なら、インストール後すぐに稼動でき、アクセス権限も充実しています。", "\n                \n                検索できるデータについて教えください              \nオンプレミスからクラウドまで保管場所を選ばず横断検索でき、多様なデータ形式に対応しています。", "\n                \n                全文検索の検索方式は何ですか？              \n形態素解析をベースにN-gram方式を併用したQSハイブリッド方式を採用しています。QSハイブリッド方式は、N-gram方式の特長である検索漏れが発生しないという点に加え、検索ノイズについても独自アルゴリズムによる抑制および辞書の補完的併用により、さらにノイズが入りにくくなっています。"]',NULL,'2024-05-28 10:20:43.190293','2024-06-09 07:23:36.290482',true,2500000,'初期費用の20%','製品画像8.jpeg'),
