(254,'株式会社イクシーズラボ','/','2017年1月1日','/','15年以上のAI研究と多くの商用実績で培った知見を取り入れ開発された、AI会話エンジン「CAIWA」をベースに、AIの各種技術の応用研究、サービス提供を行っています。','CAIWAServiceCoReDA','株式会社イクシーズラボが提供する「CAIWAServiceCoReDA」は、専⾨分野における製品情報の取得やECサイトなど多数ある製品の絞り込み検索に貢献します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:20:51.316378','2024-06-09 07:23:36.574709',NULL,NULL,'お問合せください','製品画像13.jpeg'),
