(256,'Advancy株式会社','1500万円','2023年3月','10人程度','Advancyは、AIとデジタルトランスフォーメーションの統合ソリューションを提供し、各種ビジネスプロセスの強化と新たな価値創造をサポートしています。データ分析とAI開発を通じて、企業のデジタル変革を加速させることを目指しています。','AI革新を実現する『ChatGPT経営戦略ワークショップ』','AIの力で経営革新をリード『ChatGPT経営戦略Lab』は、生成AIの力を活用し、経営判断の精度を高め、ビジネスモデルを革新するための研修プログラムです','その他',NULL,NULL,NULL,NULL,'["\n                \n                ChatGPT経営戦略Labを導入すると、具体的にどのような改善が見込めますか？              \nAIを活用することで、データに基づいた迅速な意思決定、戦略策定の精度向上、およびイノベーションの促進が期待できます。これにより、市場への適応速度が高まり、競争優位性を確立することが可能になります。", "\n                \n                 製品の導入に際して、事前に準備することはありますか？              \n導入前には、貴社のビジネスモデルや現在直面している課題についての情報共有が必要です。これにより、研修が貴社に最も適した形でカスタマイズされます。", "\n                \n                研修の効果を測定する方法はありますか？              \n研修後のフォローアップとして、参加者の意思決定能力の向上、実際の戦略策定におけるAIの活用度、新しいアイデアの導入率など、具体的な指標を用いて効果測定を行います。", "\n                \n                既存のCRMやERPシステムとの連携は可能ですか？              \nはい、ChatGPT経営戦略Labは、貴社の既存のCRMやERPシステムとシームレスに連携できるように設計されています。これによりデータの一元管理と効果的な活用が実現されます。"]',NULL,'2024-05-28 10:20:55.155945','2024-06-09 07:23:36.726514',NULL,NULL,'お問合せください','製品画像23.jpeg'),
(257,'株式会社AVILEN','5176万円','2018年8月','正社員：54名 (2023年12月末時点) AVILEN DS-Hub：237名 (2023年12月末時点)','「データとアルゴリズムで、人類を豊かにする」を掲げ、「テクノロジー活用アビリティ強化」と「AI搭載ソフトウェアによる課題解決」をはじめとしたAIソリューションを提供しています。','AIビジネス研修','株式会社AVILENが提供する「AIビジネス研修」はAIの知識がゼロからでも始められ、AIリテラシー向上～AI導入の企画・推進までマスターできる研修です。','ユーザー',NULL,'なし',true,true,'["\n                \n                自社の課題・状況に合わせてプログラムをカスタムできますか？              \n他の人材育成研修を組み合わせたカスタマイズにも対応していますので、お気軽にご相談ください。", "\n                \n                研修の詳細がわかるサービス資料はありますか？              \n研修の詳細（講座の流れ・料金体系・申し込み方法）をまとめた資料をご用意しています。ご希望の方は、資料請求フォームからお申し込みください。", "\n                \n                研修開始日時の指定はできますか？              \nはい。貴社の希望の日程でいつでも開始できます。ディスカッション会も日時指定可能です。", "\n                \n                研修はオンライン上で全て完結しますか？              \nはい。講義資料ダウンロードや課題提出、テスト、質問サポートなども全てオンラインで行えます。", "\n                \n                見積書や請求書、発注書等は発行してもらえますか？              \nはい、もちろんです。貴社のテンプレートでも構いません。", "\n                \n                オンラインではなく、会社や会場に来てもらって対面での集合研修は可能ですか？              \nはい、可能です。対面での研修では、講師による講義に加えてワークや集団ディスカッション会も実施できます。合わせて、復習用のオンライン研修も配布します。"]',NULL,'2024-05-28 10:20:57.733430','2024-06-09 07:23:36.825606',NULL,NULL,'・企画コース：33,000円（税込）/人 ・推進コース：44,000円（税込）/人 ・企画/推進セット：71,500円（税込）/人 ※各コース最低10名~受講可能','製品画像1.jpeg'),
(258,'AIinside株式会社','12億34百万円','2015年8月3日','134人(2023年6月末時点）','人工知能および関連する情報サービスの開発・提供','AIGrowthProgram','実務につながらなければ意味が無い。｢ビジネス現場がAIドリブンなDXを推進できる｣これが、実践型のDX人材輩出プログラム','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はいくらですか？              \nご利用する規模に合わせて各種プランをご用意しています。詳しくはお問い合わせください。", "\n                \n                トライアルでの受講は可能ですか?              \n個別相談のうえでご案内していますので、お問い合わせください。", "\n                \n                統計や機械学習の知識がなくても受講に支障はありませんか?              \n前提知識は不問です。AI未経験のかたでも、受講によってAI活用スキルが身につきます。", "\n                \n                実施する環境は、オンライン・オフラインどちらですか?              \n基本的にオンラインで実施していますが、オフラインでの実施もご相談を承ります。"]',NULL,'2024-05-28 10:20:59.304375','2024-06-09 07:23:36.887598',NULL,NULL,'お問合せください','製品画像7.jpeg'),
(259,'株式会社ABEJA','１億円','2012年9月10日','82名(2022年8月末時点)','ABEJAは最先端のテクノロジーをベースにして企業のイノベーション創出に貢献する企業です。従来の産業構造を変え、ひいては社会のありようをも変えていくことで、企業理念で掲げる「ゆたかな世界を、実装する」を追い求めていきます。','DX人材育成支援','株式会社ABEJAが提供する「DX人材育成支援」は、DXのプランニングとプロジェクト推進を担う「DX企画人材」を育成します。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:21:01.831810','2024-06-09 07:23:36.962195',NULL,NULL,'お問合せください','製品画像8.jpeg'),
(260,'一般財団法人高度人材育成機構','-',' 2022年4月1日','-','当法人は、社会で不足している高度スキルを持った高度人材の育成並びに当該スキル及び当該スキルを保持する高度人材の活用・普及と教育研修学習を振興することを目的とし、その目的に資するため、次の事業を行います。１．社会で不足している高度スキルを持った高度人材の育成の世界における動向、活用状況や今後の活用方法、ビジネスモデルなどの調査研究及び情報の提供。２．社会で不足している高度スキルを持った高度人材の育成の日本及び世界における教育研修学習の推進に寄与する表彰、認定及び啓発活動。３．社会で不足している高度スキルを持った高度人材の育成の普及及び教育研修学習の発展に関連する会議・セミナー・展示会などの開催。４．社会で不足している高度スキルを持った高度人材の育成及び指導のための学校の設置及び教材・書籍の提供。５．社会で不足している高度スキルを持った高度人材の育成に関わる人材の交流。６．社会で不足している高度スキルを持った高度人材のスキル評価、第三者認定などに関わる事業。７．その他前各号に関連する事業。','データサイエンス学科','TokyoiXは見習いではなく、独り立ちしたデータの専門家を目指す社会人向けのスクールです。同じ高い志を持った仲間と最高の空間で学び、働きながら短期間で、高度な学術的知識と実践能力を身につける最高の機会がここにあります。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:21:04.380970','2024-06-09 07:23:37.031957',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(261,'HEROZ株式会社',' 22.6億円（2020年4月末時点）',' 2009年4月','-','HEROZは、AI革命を起こし、未来を創っていきます。将棋AIの開発を通じて蓄積した深層学習を含む機械学習によるAI関連手法を固有のコア技術としています。現在は、将棋に限らず様々な課題を解決するAIを「HEROZKishin」として各産業に提供しています。','AI/DX顧問サービス','HEROZ株式会社が提供する「AI/DX顧問サービス」は、プロ棋士を凌駕するAIを開発し、世界を驚かせた経験豊富な経営層を中心に、ビジネス視点の発想力、最先端の技術力であらゆる企業と組織のDXをAIの力でサポートします。','月額',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:21:06.808336','2024-06-09 07:23:37.112139',NULL,NULL,'月額 500,000円','製品画像11.jpeg'),
