(265,'株式会社SIGNATE','2億80百万円（資本準備金1.8億円含む/2022年8月1日時点）','2017年5月1日','50名','SIGNATEは、国内最大8.6万人超のAI/データ人材コミュニティを運営し、DX人材育成サービスやAI開発/データ分析コンペ、国や自治体のDX/AI人材発掘・育成PJ等を展開しています。','SIGNATECloud','株式会社SIGNATEが提供する「SIGNATECloud」は、デジタルスキル標準に対応したDX人材育成サービスです。実践的な課題を通じて、社員のDXリテラシー＆推進スキルの計測・向上を支援します。','その他',NULL,NULL,NULL,true,'["\n                \n                データ活用スキル計測ではどんなスキルを計測できますか？              \nデータ活用に必要な基礎スキル（集計や加工等のデータ処理技術＆分布・関係性や推移等のデータ読解技術）を計測することができます。", "\n                \n                講座・コースではどんなスキルを学ぶことができますか？              \nデジタルスキル標準内の「DXリテラシー標準」と「DX推進スキル標準」で定義された知識・スキルを習得することができます。", "\n                \n                社内コンペティション機能のメリットを教えてください。              \nデータ分析の実務を経験することができるので、より実践的な学習機会となります。また、社内の優秀人材発掘にも繋がります。", "\n                \n                無料トライアルではどこまでを利用できますか？              \n一部講座に視聴制限はございますが、すべての機能を3名・10日間お試しいただくことができます。", "\n                \n                契約期間中の伴走支援やハンズオン研修等のオプションはありますか？              \nはい、ございます。教育効果の最大化及び実務に結びつける施策等、お客様のニーズに合わせて適切にご提案しますので、何でもお気軽にご相談ください。"]',NULL,'2024-05-28 10:21:15.745354','2024-06-09 07:23:37.325322',NULL,NULL,'お問合せください','製品画像2.jpeg'),
