(271,'EITAIテクノロジーズ株式会社','1000万円','2013年2月','-','『SmallSoftware,BigValue』を理念に、既存のIT資産・テクノロジーを有効活用するためのサービスを開発・販売するSaas企業です。','alivorte(アリヴォルテ)','EITAIテクノロジーズ株式会社が提供する「alivorte(アリヴォルテ)」は、メールでのお客様対応の品質向上に貢献することのできるクラウドサービスです。また、担当者ごとのメール対応状況(受信・返信・未返信の件数など)も可視化します。','ユーザー',90000,'なし',NULL,true,'[]',NULL,'2024-05-28 10:21:27.485182','2024-06-09 07:23:37.699769',NULL,NULL,'<年間利用料> 5名様まで： 9万円 6名様以降〜： 9万円 + 9,600円×利用人数−5','製品画像28.jpeg'),
(272,'iFLYTEKJAPANAISOLUTIONS株式会社','15,250万円 （資本準備金含め）','2020年1月8日','6名','iFLYTEKJAPANAISOLUTIONS株式会社は、世界最高レベルのAI技術でより良い世界を創造することを目標とし、最先端AIソリューションとAI技術製品を提供する会社です。','AIライティングレコーダーVOITER','iFLYTEKJAPANAISOLUTIONS株式会社が提供する「VOITER」は、会議や講義、取材など文字による記録が必要なシーンでの生産性に革命を起こす、録音と文字起こしの画期的なAIライティングレコーダーです。','月額',NULL,'なし',NULL,true,'[]',NULL,'2024-05-28 10:21:29.973148','2024-06-09 07:23:37.757990',NULL,NULL,'VOITER SR502J/SR302Pro：文字起こしサービス無料VOITER mini A1J：2年目以降 月額 ¥819(200時間/月)　※1年契約¥9,000','製品画像21.jpeg'),
(273,'株式会社ACES','1億円','2017年11月20日','58名','ACESは、アルゴリズムを用いて事業開発を行うAI事業会社です。AIアルゴリズムを用いて、属人化しているヒトの知見や業務をデジタル化する「AIトランスフォーメーション事業」を通して、「シンプルな社会」の実現を目指しています。','ACESMeet（エーシーズミート）','株式会社ACESが提供する「ACESMeet（エーシーズミート）」は東大松尾研発ベンチャーの高度なAI技術により、通話や商談の議事録を瞬時に作成・解析！営業チーム内の情報共有をなめらかにし、成果に直結する営業ノウハウの浸透を実現します。','その他',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:21:32.947370','2024-06-09 07:23:37.821212',NULL,NULL,'2つの料金プランあり ※営業担当社へお問い合わせください','製品画像9.jpeg'),
(274,'HubSpotJapan株式会社','500万円','2016年2月','約2,745名','HubSpotは、顧客を企業の推奨者に転換する「インバウンド手法」基づき、永続無料のCRMと、マーケティング、セールス、カスタマーサービスを管理・実践できる単一プラットフォームを提供しています。','HubSpotSalesHub','HubSpotJapan株式会社が提供する「HubSpotSalesHub」は、CRMと連動したパイプライン管理、日々の営業活動を効率化するミーティング調整機能などで営業サイクルを短縮化します。','月額',NULL,'0',NULL,true,'["\n                \n                契約したSales Hubアカウントはカスタマイズできますか？              \nはい。SalesHubのEnterpriseプランで利用できるカスタムオブジェクトは、個々のビジネスに適応する柔軟性を備え、高度な制御に対応できます。カスタムオブジェクトでは、オブジェクト名や保持するプロパティーの設定、他のオブジェクトとの関連付けを自由に行うことができます。関連付けられたデータの並べ替え、自動化、レポート作成もHubSpot上で行うことができます。さらに、650種類を超えるカスタム連携が公開されているアプリマーケットプレイスのアプリを利用すれば、現在お使いになっているツールとHubSpotを簡単に連携することも可能です。", "\n                \n                Sales HubはSalesforceのような他の営業ソリューションとどう違うのですか？              \n現在販売されているエンタープライズソフトウェアには企業買収を通じてプロダクトを組み合わせていった製品が少なくありませんが、SalesHubはお客さまのビジネスに役立つ製品を目標として、HubSpotプラットフォームを基盤としてゼロから開発されました。また、SalesHubのメリットは充実した機能と使いやすさを兼ね備えていることです。"]',NULL,'2024-05-28 10:21:35.506619','2024-06-09 07:23:37.903805',NULL,NULL,'月額 6,000円～','製品画像13.jpeg'),
(275,'株式会社アースリンク','1,586万円','1997年6月','/','アースリンクでは、リード獲得のための会話AIを始め、BtoB特化したマーケティング・インサイドセールス・フィールドセールスを支援するクラウドサービスやインサイドセールス代行のサービスを提供しております。','SakuraTALK','株式会社アースリンクが提供する『SakuraTALK』は、ロボットがシナリオに沿ってお客様と会話、担当者の名前を特定します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:21:39.214955','2024-06-09 07:23:37.978964',NULL,NULL,'お問合せください','製品画像26.jpeg'),
(276,'エス・アンド・アイ株式会社','4.9億円','1987年7月','230名','エス・アンド・アイ株式会社は、S&IのAI事業ブランドです。AI音声認識技術の活用とデータマネジメントを中心に、コンタクトセンターなどの応対業務における業務効率化やDX推進をご支援しています。','応対品質チェック支援サービス「AILog」','エス・アンド・アイ株式会社が提供する応対品質チェック支援サービス「AILog」は、コンプライアンスチェックにも最適！AILogは、応対内容から自動的に不適切な表現や伝え漏れを抽出し、応対品質の向上をサポートします。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:21:40.478493','2024-06-09 07:23:38.036296',NULL,NULL,'お問合せください','製品画像11.jpeg'),
(277,'株式会社オプティム','444百万円','2000年6月8日','398名','OPTiMは、AI・IoT・Cloud・Mobile・Roboticsを使った、新しい価値を創造し続け、あらゆる産業のDXを推進し、あらゆる人々に豊かでサステナブルな未来を実現するために事業を行っています。','OPTiMContract','OPTiMが提供する「OPTiMContract」は、AIが契約書の管理コストを削減してくれる契約書管理システムです。契約終了日や更新の自動通知、自動で管理台帳を作成してくれるといった、AIによるサポートが充実しているのが特徴です。','月額',NULL,'なし',true,true,'["\n                \n                管理できるデータの容量に制限はありませんか？              \nデータ容量の制限は一切ございません。", "\n                \n                紙で管理している契約書も管理できますか？              \n紙媒体でも電子データや電子契約同様に管理することができます。AI解析にも対応しております。", "\n                \n                どのようなファイル形式でアップロードできますか？              \nWord形式とPDF形式のファイルをアップロードすることができます。", "\n                \n                どのようなセキュリティ対策を行っていますか？              \nSSL証明書による暗号化通信、RDSによるDBの暗号化、第三者機関による脆弱性回避の認証取得などを実施しています。"]',NULL,'2024-05-28 10:21:42.955415','2024-06-09 07:23:38.099294',NULL,NULL,'スタータープラン：月額9,980円　（同時利用制限数：1名　月間アップロード上限：10件） ビジネスプラン：月額49,800円　（同時利用制限数：5名　月間アップロード上限：100件） エンタープライズプラン：ご利用料金はお問い合わせください','製品画像26.jpeg'),
(278,'アストロラボ株式会社','114,249,550円（資本準備金含まず）','2012年12月','15名','Saasサービス・大規模業務システムの開発・提供、ウェブサイト構築、SEO・リスティング広告などのマーケティング支援','どこでも契約書クラウド','アストロラボ株式会社が提供する「どこでも契約書クラウド」は、紙と電子の契約書を一元管理し、いつでもどこからでも探せて確認ができるクラウドサービスです。','月額',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:21:45.502112','2024-06-09 07:23:38.153414',NULL,NULL,'月額5,000円～','製品画像11.jpeg'),
(279,'株式会社LegalOnTechnologies','178.5億円（資本準備金含む。2022年6月時点）','2017年4月21日','379名（役員含む／2022年6月30日時点）','株式会社LegalOnTechnologiesは、「全ての契約リスクを制御可能にする」というミッションの元、契約業務を効率化するためのソフトウェアの開発・提供を行っています。','AI契約管理システム「LegalForceキャビネ」','株式会社LegalOnTechnologiesが提供するAI契約管理システム「LegalForceキャビネ」は、締結後の適切な契約管理をサポートする「AI契約管理システム」です。契約書の検索時間と管理工数は限りなくゼロになり、スマートな契約書管理を実現します。','その他',NULL,NULL,true,NULL,'["\n                \n                従来の契約書管理システムとどのような点が異なりますか？              \n締結済みの紙の契約書をスキャンしたPDFでも独自のOCRとAIにより、当事者名や自動更新の有無、契約期間などを自動抽出できます。また、全文検索も可能です。", "\n                \n                AIが契約書情報を誤って読み取ることはありますか？              \nスキャンしたPDFの画質が粗い場合や、印紙や印影と抽出する文字がかぶっている場合、手書き文字などは誤認識する場合がございます。誤認識された元ファイルなどの情報を可能な範囲で共有頂くことで今後の精度向上につなげております。", "\n                \n                導入時や導入後のサポートはありますか？              \n導入時にオンボーディングを実施させていただいております。また、チャットやメールでのサポートを受け付けております。"]',NULL,'2024-05-28 10:21:48.193573','2024-06-09 07:23:38.216053',NULL,NULL,'お問合せください','製品画像12.jpeg'),
(280,'株式会社PreferredNetworks','-','2014年3月','約300名','PreferredNetworks(PFN)は深層学習などの最先端の技術を最短路で実用化することで、これまで解決が困難であった現実世界の課題解決を目指しています。','PreferredNewtorksVisualInspection','PreferredNetworksが提供する「PreferrdNetworksVisualInspection」は、①不良箇所塗りつぶし作業が不要、②少量の学習データでも学習可能、③独自モデルによる高い精度で過検知を改善を特徴とするAI外観検査ソフトウェアです。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:21:49.708943','2024-06-09 07:23:38.289694',NULL,NULL,'お問合せください','製品画像2.jpeg'),
(281,'東日本電信電話株式会社','3,350億円','1999年7月1日','4,950人（NTT東日本グループ：35,500人）※3 ※3（2023.3.31時点）','東日本電信電話は、地域の未来を支えるソーシャルイノベーションカンパニーとして、情報通信技術やAIなどのデジタル技術を活用し、地域循環型社会に向けたイノベーションの実現に貢献しています。','AISecurityasilla','AIが違和感行動や人の手が必要な状態を検知！AIと既設防犯カメラで作る安心安全な施設運営をサポート！','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:21:52.184891','2024-06-09 07:23:38.353406',NULL,NULL,'お問合せください','製品画像10.jpeg'),
(282,'NautoJapan合同会社','-','2017年6月','-','Nauto（ナウト）は、米シリコンバレーに本社を置くAI開発企業です。「モビリティをもっと安全に、もっと効率的に」をミッションに、社用車の交通事故を削減するためのソリューションを提供しています。','法人向けAIドライブレコーダー「ナウト」','-国内700社以上が導入済み-NautoJapan合同会社が提供する「ナウト」は、AI＋ドライブレコーダー＋クラウドの組み合わせで交通事故を未然に防止。さらには運転の傾向を「見える化」し、ドライバーの安全意識向上や安全運転指導の効率化も実現。','その他',NULL,NULL,true,NULL,'["\n                \n                料金体系はどのようになっていますか？              \n車載機を購入し、サービス利用料のみ月々お支払いいただくプランと、車載機をリースし、リース料金とサービス利用料を月々お支払いいただくプランがあります。", "\n                \n                月々のサービス利用料以外に、通信料やその他のランニングコストは発生しますか？              \n定額の月額料金以外は発生しません。通信料はサービス利用料に含まれており、ユーザーの追加や映像の手動取得などによる追加料金が別途発生することもありません。", "\n                \n                契約期間は何年ですか？              \n原則3年です。（お取引先の代理店によっては早期解約時のキャンセル料などが設定されています。）", "\n                \n                補助金の利用は可能ですか？              \n各種補助金の適用可否は案件ごとに異なります。詳細はお問い合わせください。"]',NULL,'2024-05-28 10:21:53.717890','2024-06-09 07:23:38.530377',NULL,NULL,'お問合せください','製品画像18.jpeg'),
(283,'アースアイズ株式会社','5,950万円','2015年9月16日','-','人工知能搭載カメラ（防犯、事故防止）の開発及び販売ソフトウェアの開発及び販売コンピューターの電子情報の管理及び保管コンピューターの電子情報の解析、分析及び加工電気通信事業','AI防災、危険予知システム','「発見＞通知」の、アースアイズAIソリューション','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:21:56.268457','2024-06-09 07:23:38.619182',NULL,NULL,'お問合せください','製品画像10.jpeg'),
