(285,'フォルシア株式会社','1億円（資本準備金含む）','2001年3月','139名 （2024年3月1日現在）','フォルシアは『検索』領域で培ったデータ処理の高度な技術的ノウハウを中心に、企業のデータ利活用に関わるDX課題解決の一環としてAI技術を利用した画像認識ソリューションを展開しています。','AI画像認識システム','-画像認識技術を活用した業務効率化を実現-フォルシア株式会社が提供する「AI画像認識システム」はAI×画像認識の設計・開発から運用までワンストップでのご支援が可能です。個別課題に即した最適なソリューションをお求めの企業様をサポートいたします。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:21:59.308570','2024-06-09 07:23:38.756378',NULL,NULL,'お問合せください','製品画像7.jpeg'),
(286,'Daedalus株式会社','1000万円','2020年8月7日','-','弊社はAIを世の中に浸透させ、人々がより自分らしく生きる「余裕」を持てる世界を創造することをミッションとして、機械学習を軸とした企業のプロダクト開発・運用のご支援をしています。','Daedalus（ダイダロス）の画像認識エンジン開発サービス','Daedalus（ダイダロス）の画像認識エンジン開発サービスは、御社の課題に合わせた画像認識・解析AI技術を提案します。コンサルティング～開発案件まで一気通貫してソリューションを提供可能です。','その他',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:22:01.815644','2024-06-09 07:23:38.871461',NULL,NULL,'ご要件に応じて要御見積もり','製品画像2.jpeg'),
(287,'Fiby株式会社','100万円','2019年8月','20名','伴走型AI開発・コンサルティングサービス','先端技術を最短経路で実装AI受託開発・導入支援','Fiby株式会社が提供する「AI受託開発・導入支援」サービスは、お客様の課題を解決するための最適な提案を、豊富な実績と高い技術力で実現します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:22:04.302715','2024-06-09 07:23:38.951250',NULL,NULL,'お問合せください','製品画像5.jpeg'),
(288,'株式会社エーエヌラボ','1,000万円','2007年5月','約50人','AIソリューションの開発・提供','物流チェッカー','株式会社エーエヌラボが提供する「物流チェッカー」は、出入りするトラックや荷物を監視カメラ映像から、荷物の種類と量、移動の軌跡、空きブロック位置をAIが自動判定・記録するサービスです。','その他',NULL,NULL,true,true,'["\n                \n                サービス利用には、どんな機器が必要ですか？              \nカメラとPCが必要です。\r\n監視カメラがすでに設置済みであれば、そのカメラ映像でも導入可能です。\r\n\r\n推奨機器のスペックは以下です。\r\n・カメラ：HD以上の解像度\r\n・PCのCPU：Duo以上の性能を持つもの\r\n\r\nなお、カメラには1ブロック（撮影したいエリアや対象物）がきれいに途切れなく1画面（画角）内に映る位置に設置する必要があります。複数ブロックカウントしたい場合は、カメラも複数設置が必要です。\r\n\r\nPoC段階では弊社からカメラとPCの貸し出しが可能です。\r\n高速のネットワーク環境がある際は、PCの代わりに、弊社のクラウド環境を利用していただくことも可能です。\r\n", "\n                \n                社用の携帯（iPhone/Android）にインストールは可能ですか？              \n2024年2月時点では未対応ですが、対応可能ですので、お問い合わせください。\r\n", "\n                \n                業務内容の機密性から、インターネット上にカメラ画像を出せません。それでも、このサービスを利用できますか？              \nはい。オンプレミス環境内でも利用いただけます。その際は、お客様の環境内に弊社のPCを設置させていただきます。お客様の環境に合わせて調整させていただきます。", "\n                \n                特殊な業務内容なので、画像AIがどこまで使えるかあるかわかりません              \nまずはお客様の業務内容をヒアリングさせていただき、効果的な活用方法をご提案させて頂きます。無料トライアル期間もありますので、お気軽にお問合せください。", "\n                \n                無料トライアル/PoC検証をしたいです。何か準備が必要ですか              \n特別な準備は必要ありません。\r\n監視カメラが設置済みであれば、その映像を一部弊社に提供ください。\r\nカメラがない場合は、弊社の用意したカメラ（スマホ）で、現場を撮影させていただきます。\r\n詳しくは問い合わせください。ご説明させていただきます。", "\n                \n                ITや画像AI技術のことがよくわかりませんが、相談可能でしょうか              \nお客様のやりたいことをどう実現していけるか、どのような段取りが必要か、といったこと全てについてご相談に乗ります。\r\nまた、必要に応じて仕様書作成や設計などの行程も弊社で実施いたします。", "\n                \n                導入までどれくらいかかりますか              \n最短1か月でご利用いただけます。\r\nビジネスの企画から開発までを含め3ヶ月ぐらいかかることもあります。"]',NULL,'2024-05-28 10:22:06.973061','2024-06-09 07:23:39.030350',NULL,NULL,'利用プラットフォームやカメラ台数、必要なチューニングの量によって別途見積となります。','製品画像15.jpeg'),
(289,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','動画・画像解析AIモデル開発・コンサルティング','FastLabel株式会社が提供するAIモデル開発・コンサルティングは、要件定義からモデル開発までを一気通貫でサポートし、精度改善KPI設定、課題洗い出しから実行までお客様のモデル精度改善にフルコミットします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \n大変申し訳ございませんが、一概に費用をご提示することができません。一度ご面談の上で概算のお見積りをお出しします。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はAI開発・コンサルティングだけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:22:09.516957','2024-06-09 07:23:39.126308',NULL,NULL,'お問合せください','製品画像3.jpeg'),
(290,'株式会社オンザウェイ','6000万円','1991年1月4日','50名','オンザウェイは「現場のコミュニケーションをサポートする」をコンセプトに、無線機やAIカメラを通してお客様の現場の成功を最優先に考え、「共に育つ」というフィロソフィーを日々実践しています。','TERASAIカメラソリューション','〜短期間のレンタルも可能！手軽で身近なAIツールです！〜株式会社オンザウェイが提供する「TERAS」はカメラの映像をAIが分析し通過・滞留した人数を自動でカウントします。また、予め設定した閾値に基づきスマホやPCのアプリへ通知することも可能です。','月額',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:22:10.801271','2024-06-09 07:23:39.246586',NULL,NULL,'単日利用：80,000円～ 週間利用：100,000円～ 月間利用：200,000円～ 年間利用：150,000円～（月額） ※利用料金は、期間や台数に加えタイアップ契約の有無などにより大幅に変化します','製品画像27.jpeg'),
