(292,'ミーク株式会社','1000万円','2019年3月','58名','IoTサービス事業者及びDXを推進する企業向けに、NoCodeIoT/DXPlatform『MEEQ（ミーク）』を展開し、低価格（月額143円（税込）から）かつ高品質なモバイル通信回線やコーディング不要で利用可能なデータプラットフォーム等を提供しています。　また、数少ないトリプルキャリア（NTTドコモ、ソフトバンク、KDDI）に対応したMVNE事業者として、多くの大手MVNO事業者にネットワークおよび業務システム、業務支援等を提供しています。','MEEQ','MEEQ（ミーク）は、直感的なコンソール画面を通じて、簡単にIoT向け通信サービスを購入／決済／登録／管理ができるNoCodeIoT/DXPlatformです。','月額',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:22:15.886234','2024-06-09 07:23:39.399326',NULL,NULL,'月額130円（税抜き）から','製品画像2.jpeg'),
(293,'アステリア株式会社','22億7,534万円','1998年9月1日','112名','アステリア株式会社は、企業・組織内外のさまざまなデータを「つなぐ」ソフトウェアを開発・販売。主力製品のデータ連携ツール国内シェアNo.1の「ASTERIAWarp」などを提供しています。','新Gravio','Gravioとは、複数現場の様々な情報をノーコードで収集・統合し、活用までをワンストップで実現できるプラットフォームです。データ収集用デバイス、クラウドでのデータ格納・管理、可視化までをトータルで提供、様々なデータの活用が肝となる現場DX実現において、高い拡張性とシンプルな展開を両立します。','月額',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:22:17.216822','2024-06-09 07:23:39.500420',NULL,NULL,'Gravio Free｜無償提供 Gravio Business｜月額 88,000円（年額プランあり）Gravio Business Pro｜ 月額 132,000 円 （年額プランあり） Gravio Business Pro ライセンス｜お問合せください','製品画像22.jpeg'),
(294,'VNEXTJAPAN株式会社','約4,300万円','2008年1月','約460名','VNEXTは15年以上、IT総合サービス会社として東京・ハノイ・ダナンで多角的な事業を展開。AIやブロックチェーンに特化したグループ会社も設立し、高品質で柔軟な開発サービスを提供しています。','画像認識・解析「V-AI」','VNEXTJAPAN株式会社が提供する画像認識・解析「V-AI」は、独自の画像処理技術を搭載したAIで95〜99%の高精度な画像認識・解析ソリューションを提供しています。製造現場のDX化、交通インフラ管理、顧客行動の可視化・データ化など、ビジネスAIであらゆる課題を解決します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:22:20.241225','2024-06-09 07:23:39.602026',NULL,NULL,'お問合せください','製品画像12.jpeg'),
(295,'VNEXTJAPAN株式会社','約4,300万円','2008年1月','約460名','VNEXTは15年以上、IT総合サービス会社として東京・ハノイ・ダナンで多角的な事業を展開。AIやブロックチェーンに特化したグループ会社も設立し、高品質で柔軟な開発サービスを提供しています。','AI-OCR・V-OCR','VNEXTJAPAN株式会社が提供する「AI-OCR・V-OCR」は、独自の画像処理技術を搭載したAIで95〜99%の高精度なOCRエンジンを提供しています。ニーズに合わせたカスタマイズも可能なため、貴社だけのOCRを開発できます。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:22:22.999070','2024-06-09 07:23:39.688292',NULL,NULL,'お問合せください','製品画像28.jpeg'),
