(297,'株式会社マクニカ','111億9,426万8千円（2023年3月31日現在）','1972年10月30日','4,187名（2023年3月31日現在）','半導体・集積回路などの電子部品の輸出入、販売、開発、加工、電子機器並びにそれらの周辺機器及び付属品の開発、輸出入、販売、その他','施設警備の効率化・高度化icetana','「icetana」は、既設の防犯カメラ映像から独自のAI画像解析技術で「いつもと違う」さまざまな異常を検知し、警備業務の効率化・高度化を支援するシステムです。','その他',NULL,NULL,true,NULL,'["\n                \n                使用できるカメラはなんですか？              \nネットワークカメラ（IPカメラ）であれば、メーカーやスペックを問わずご使用いただけます。", "\n                \n                サーバーはオンプレミスですか？              \n基本的にはオンプレミスでの運用をご提案しておりますが、ご要望に応じてクラウドへの対応も可能です。"]',NULL,'2024-05-28 10:22:28.106433','2024-06-09 07:23:39.822615',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(298,'DAILabs株式会社','1000万円','2023年1月26日','6名','DAILabsは、全ての企業がAIで業務効率を改善できるよう、人工知能（AI）コンサルティングサービスとソフトウェア開発をおこなっています。','DAILabsの研究開発サービス','DAILabsが提供するAI研究開発サービスは、業務効率を向上させ、新規価値を創出するためのAI構築を迅速に実現させます。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:22:29.464559','2024-06-09 07:23:39.918254',NULL,NULL,'お問合せください','製品画像19.jpeg'),
(299,'株式会社エーエヌラボ','1,000万円','2007年5月','約50人','AIソリューションの開発・提供','低コスト・短納期のAI受託開発','実現可能性の検証・コンサルからデータ収集・開発・システムインテグレーションまでワンストップ対応！株式会社エーエヌラボが提供する「低コスト・短納期のAI受託開発」は、お客様のニーズにピッタリ合った画像AIソリューション開発します。200件以上の実績。無料トライアルもあり、初めての方でも安心してお任せください！','その他',NULL,NULL,true,true,'["\n                \n                どんな端末で利用できますか              \nPC（オンプレミス）・スマホ・タブレット・インターネット環境があれば、あらゆる端末でご利用いただけます。また、インターネット接続ができない場合も、御社内に専用環境を用意いただくことで利用可能です。", "\n                \n                利用には高性能なカメラが必要ですか              \n特にカメラの指定はありません。スマートフォンのカメラでもご利用いただけます。", "\n                \n                画像AIエンジンのみを使いたいのですが可能でしょうか              \nはい、可能です。", "\n                \n                画像アノテーションのみの依頼は可能でしょうか              \nはい、可能です。", "\n                \n                画像はあるが画像解析に使える品質・量があるかわかりません              \n画像データを拝見させていただき、判断させて頂きます。無料トライアル期間もありますので、お気軽にお問合せください。", "\n                \n                動画からも商品識別できますか              \nはい、動画からも商品識別可能です。", "\n                \n                ITや画像AIのことがよくわかりませんが、相談可能でしょうか              \nお客様のやりたいことをどう実現していけるか、どのような段取りが必要か、といったこと全てについてご相談に乗ります。\r\nまた、必要に応じて仕様書作成や設計などの行程も弊社で実施いたします。", "\n                \n                導入までどれくらいかかりますか              \n最短1か月でご利用いただけます。\r\nビジネスの企画から開発までを含め「3ヶ月から6ヶ月程度」のお客様が多いです。\r\nこのうち、コンサル1～2ヶ月、サービス設計1~2ヶ月、開発期間は1~2ヶ月ほどです。弊社既存のAIモデルを用いてすぐに課題解決ができる場合もあります。まずはお問合せください。"]',NULL,'2024-05-28 10:22:31.875311','2024-06-09 07:23:39.997502',NULL,NULL,'処理枚数に応じた従量課金（クラウドソリューション）、オンプレミス対応、エンジンの一括提供など、ご要望に応じて柔軟に対応します。データ処理のみ希望する場合は、目安として写真一枚あたり数円程度とお考えください。','製品画像7.jpeg'),
