(301,'日本テレビ放送網株式会社','60億円','昭和27(1952)年10月15日','1,361人（2022年4月1日現在）','放送法による基幹放送事業及び一般放送事業、メディア事業、その他放送に関連する事業','BlurOn','知らないうちに法令違反/プライバシーの侵害をしていませんか?日本テレビとNTTデータの共同開発により実現した、自動モザイクAI　BlurOn①放送業界でも実証されている高い精度②大量の映像・画像データも迅速に処理可能③テレビ番組でも導入、NTTデータによる安心のセキュリティ','その他',NULL,NULL,NULL,true,'[]',NULL,'2024-05-28 10:22:36.839038','2024-06-09 07:23:40.151425',NULL,NULL,'お問合せください','製品画像28.jpeg'),
