(325,'株式会社ニューロープ','46,510,000円','2014年1月10日','/','株式会社ニューロープは、ファッションに特化した人工知能を開発・展開するベンチャーです。Eコマースや店舗をもっと便利にするために、画像解析やトレンド分析などのソリューションを提供しています。','ファッションAI「#CBKscnnr（カブキスキャナー）」','株式会社ニューロープが提供するファッションAI「#CBKscnnr（カブキスキャナー）」は、アパレルの専門知識や300人以上のモデルセンスなどを人力でデータ化したファッションに特化したAI','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:23:31.674794','2024-06-09 07:23:42.062298',NULL,NULL,'お問合せください','製品画像24.jpeg'),
(326,'株式会社BAP','500万円','1st Mar , 2016','149名','BAPの強みは、スマートフォン、ウェブサイト、ゲームなどアプリケーション開発力の高さです。私たちはゲーム開発やビジネスシステムなどの要件定義に基づいてプロジェクトの成功に貢献します。特にブロックチェーン技術については、仮想通貨、スマートコントラクト、取引所の開発を世界的にリードしており、ICO、新しい仮想通貨の開発、仮装通貨取引所の作成などの分野で多くの実績があります。','SMARTFASHION（スマートファッション）','株式会社BAPが提供するSMARTFASHION（スマートファッション）は、スマートフォンなどのカメラで全身の写真を正面から撮影すると、AI・人工知能が自動的に服のサイズを判断！','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:23:32.970460','2024-06-09 07:23:42.133203',NULL,NULL,'お問合せください','製品画像18.jpeg'),
(327,'株式会社ネクストシステム','80,750,000円','2002年8月28日','57名','誰もが豊かで快適で便利な未来社会を創るために、AI（DeepLearning）・AR・VRなど最新の技術を駆使した研究・開発の他、iOS・Android・ウェブなどのソフトウェア開発を行なっています。','VisionPose（ビジョンポーズ）','株式会社ネクストシステムが提供するVisionPose（ビジョンポーズ）は、深度センサに依存せず複数人の骨格座標（30箇所）をWEBカメラだけで検出するシステムです。','その他',NULL,'0',true,NULL,'["\n                \n                開発用ライセンスとは何に使用しますか？              \nVisionPoseSDKを使用した製品やアプリケーションを開発するために必要な、ネクストシステムが発行しているライセンスです。\r\nStandardSDK、Single3DSDKをご購入の際に送付いたします。", "\n                \n                リリース用ライセンスとは何に使用しますか？              \n開発用ライセンスを用いて制作された製品やアプリケーションを販売（配布）する時に必要な、ネクストシステムが発行しているライセンスです。\r\nリリース用ライセンス単品での販売は行っておらず、開発用ライセンスをご購入いただいたお客様のみに販売しています。", "\n                \n                各ライセンスのアクティベーション以降はオンライン接続は必要でしょうか？              \n開発用ライセンスは起動の度にアクティベーションが走りますので、インストール後も開発マシンはオンライン接続の必要があります。\r\nリリース用ライセンスは初回アクティベーションのみオンライン接続されている必要がありますが、2回目以降は必要はありません。"]',NULL,'2024-05-28 10:23:35.347579','2024-06-09 07:23:42.210290',NULL,NULL,'398,000円','製品画像29.jpeg'),
(328,'株式会社エムティーアイ','5,107百万円','1996年8月12日','1,156名','モバイルサービス事業「ヘルスケア」「フィンテック」「音楽・電子書籍」「生活情報」「エンターテインメント」など、毎日の暮らしを楽しく便利にする多彩なサービスを提供しています。','FEEDER（フィーダー）','株式会社エムティーアイが提供するFEEDER（フィーダー）は、AI＋OCRで撮影した領収書を「ConcurExpense」と自動連携し、今までの約半分の時間で経費精算が可能に、作業時間50%削減','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:23:36.572284','2024-06-09 07:23:42.265440',NULL,NULL,'お問合せください','製品画像17.jpeg'),
