(330,'株式会社PFU','150億円','1960年11月1日 ','4,207名（PFUグループ、2023年5月現在） ','イメージスキャナー、エンベデッドコンピュータなどのハードウェアおよび、セキュリティ・文書管理などのソフトウェアやサービス、ITインフラ構築や他企業と提携したマルチベンダーサービスなど','DynaEye11','株式会社PFUが提供する「DynaEye11」は、インストールしたPC内でOCRを完結するオンプレミス型のAI-OCRソフトウェアです。大量の帳票を正確・安全・高速にデータ化し、高精度な文字認識で業務システムへのデータ入力を効率化します。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:23:41.287273','2024-06-09 07:23:42.369579',NULL,NULL,'お問合せください','製品画像13.jpeg'),
(331,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','AI-OCRモデル精度改善コンサルティング','FastLabel株式会社が提供するAI-OCRモデル改善コンサルティングは、独自AI-OCRの要件定義、PoC、AI倫理を守る権利クリアなデータセット作成・素材データ収集、学習データ・教師データ作成（アノテーション）、モデル開発までを一気通貫でサポートし、お客様のモデル認識精度改善にフルコミットします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \nご支援の範囲に応じて、数十万〜数百万のご費用感となるケースが多くなっております。\r\n要件に従い、個別にお見積りをいたしますので、お気軽にお問い合わせください。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はAI開発・コンサルティングだけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:23:42.638221','2024-06-09 07:23:42.419682',NULL,NULL,'お問合せください','製品画像18.jpeg'),
