(333,'TokyoTechies株式会社','4150万円','2017年9月','東京　25名','TokyoTechiesはまだ見たことのないAI製品を皆様と共に研究、開発をしております。システム構築、セキュリティも事業の柱なので、ワンストップでシステム全体の構築が可能です。','TTOCR','当社のインテリジェントOCRにより、退屈なデータ入力が不要になりますTokyoTechies株式会社が提供する「TTOCR」は日本語の認識力が非常に高く高精度なエンジンです。あなたの特定の要求にも答えることができる様にカスタマイズできます。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:23:46.833239','2024-06-09 07:23:42.583709',NULL,NULL,'お問合せください','製品画像4.jpeg'),
