(335,'株式会社オプティム','444百万円','2000年6月8日','398名','OPTiMは、AI・IoT・Cloud・Mobile・Roboticsを使った、新しい価値を創造し続け、あらゆる産業のDXを推進し、あらゆる人々に豊かでサステナブルな未来を実現するために事業を行っています。','OPTiM電子帳簿保存','OPTiMが提供する「OPTiM電子帳簿保存」は、電子帳簿保存法・インボイス精度に対応して、請求書・領収書・注文書などの取引情報を一元管理する電子帳簿保存サービスです。取引年月日・取引金額・取引先をAIが自動入力し、項目管理できる点が特徴です。','月額',NULL,'なし',true,true,'["\n                \n                管理できるデータの容量に制限はありませんか？              \nデータ容量の制限は一切ございません。", "\n                \n                紙で管理している帳票書類も管理できますか？              \n紙媒体でも電子データや電子契約同様に管理することができます。AI解析にも対応しております。", "\n                \n                どのようなファイル形式でアップロードできますか？              \nWord形式とPDF形式のファイルをアップロードすることができます。", "\n                \n                どのようなセキュリティ対策を行っていますか？              \nSSL証明書による暗号化通信、RDSによるDBの暗号化、第三者機関による脆弱性回避の認証取得などを実施しています。"]',NULL,'2024-05-28 10:23:51.781607','2024-06-09 07:23:42.721452',NULL,NULL,'スターターS1：月額9,980円　（同時利用制限数：3名　月間アップロード上限：100件） スターターS2：月額19,980円　（同時利用制限数：5名　月間アップロード上限：500件） スターターS3：月額29,800円　（同時利用制限数：10名　月間アップロード上限：1,000件） ビジネスB1：月額34,800円　（同時利用制限数：15名　月間アップロード上限：1,500件） ビジネスB2：月額39,800円　（同時利用制限数：20名　月間アップロード上限：2,000件） ビジネスB3：月額49,800円　（同時利用制限数：30名　月間アップロード上限：3,000件） エンタープライズ：ご利用料金はお問い合わせください','製品画像23.jpeg'),
(336,'株式会社インフォディオ','1億円','2002年7月',' 97名（2023年2月現在）','■AI/ITソフトウェアプロダクト・クラウドサービスの開発・販売スマートOCR、DenHo[導入先]法務省　統計センター（総務省）　国税庁　県警察金融機関等　数百社　■ソフトウェア開発・システムインテグレーション[実績]国税庁　株式会社JTB　みずほ銀行　株式会社エヌ・ティ・ティ・データ等※敬称略','スマートOCR','スマートOCRとは紙の文書や帳票をスキャン・撮影された画像データからテキストデータを抽出するクラウド型業務効率化支援ソリューションです。スマートOCRでは、AIによるディープラーニングを活用し、従来のOCRでは難しかった、手書き文字や非定型帳票などにも対応した高精度の読取を実現します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:23:54.463282','2024-06-09 07:23:42.782897',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(337,'リコージャパン株式会社','25億円','1959年5月2日','18,887名（2021年4月1日現在）','さまざまな業種におけるお客様の経営課題や業務課題の解決を支援する各種ソリューションの提供。複合機（MFP）やプリンターなどの画像機器や消耗品およびICT関連商品の販売と関連ソリューションの提供サポート＆サービス（画像機器やICT関連商品の保守、ネットワーク構築・保守、ICT運用業務代行）システムインテグレーションおよびソフトウェア設計・開発','RICOH受領請求書サービス','リコージャパン株式会社が提供する「RICOH受領請求書サービス」は、受領した請求書の記載情報をAI×OCRで自動データ化。お使いの会計システムや銀行支払システムと連携できるので、入力業務の効率化、ミス削減を実現します。','月額',NULL,NULL,true,true,'["\n                \n                OCR結果の出力形式を教えてください。              \nCSV形式で出力されます。", "\n                \n                手書き文字は読み取れますか。              \n読み取り可能です。", "\n                \n                BPOサービスを利用する場合と利用しない場合の違いを教えてください。              \nBPOサービスを利用することで、OCR処理で正しく認識できない部分を人の目で確認し、データを補正いたします。\r\n（受付後2営業日程度のお時間いただきます。）", "\n                \n                請求書以外の帳票に対応していますか。              \n納品書に対応したRICOH受領納品書サービスをご用意しております。", "\n                \n                IT導入補助金の対象ですか。              \nはい、RICOH受領請求書サービス/RICOH受領納品書サービスはIT導入補助金の対象です。導入費用の最大3/4の補助を受けられます。", "\n                \n                電子帳簿保存法には対応していますか？              \n「電子保存オプション」にお申込みいただくことで、2022年1月改正の電子帳簿保存法に対応した機能をご利用いただけます。"]',NULL,'2024-05-28 10:23:56.968474','2024-06-09 07:23:42.853190',NULL,NULL,'月額3,000円～（消費税別）  ＜オプション＞ ・BPOサービス利用（人の目によるデータ修正代行）：サービス利用料と併せて月額18,000円～（消費税別） ・電子保存オプション（改正電帳法に対応した電子保存）：＋月額300円～（消費税別）','製品画像10.jpeg'),
