(339,'株式会社EduLab','52億7129万円（2022年2月28日現在）','2015年3月31日','連結従業員数: 383人 （2022年2月28日現在）','学力測定技術およびテスト法の開発、能力検査・試験の開発・実施・分析、および教育サービスの提供次世代教育の開発支援のため教育ITソリューションとプラットフォームの提供やEdTech分野における新規事業の開発・投資関係会社の統括・経営管理・グループ戦略立案など','DEEPREAD','株式会社EduLabが提供する「DEEPREAD」は、業界トップクラスの水準の認識精度を兼ね備えた、ディープラーニングに基づく、AI（人工知能）を活用した手書き文字のデジタル化サービスです。業務効率化やデータベースの有効活用といった観点から、紙データのデジタル化に対する需要は年々拡大している一方で、従来型の「OCR（光学的文字認識）」技術では、活字についてはデジタル化できるものの、手書き文字の認識精度は低いという課題がありました。DEEPREADは独自の研究開発を経て、手書き情報の読み込み精度は業界トップクラスの水準で手書き文字のデジタル化を実現し、金融業界をはじめ幅広い業種にて活用いただいています。','その他',NULL,'03000000',NULL,true,'[]',NULL,'2024-05-28 10:23:59.675430','2024-06-09 07:23:43.000124',NULL,NULL,'クラウド：月5万円〜 オンプレ：月40万円〜','製品画像21.jpeg'),
(340,'LINEWORKS株式会社',' 55億2,000万円',' 2015年6月3日','-','ビジネス版LINE「LINEWORKS（ラインワークス）」は、トーク・カレンダー・掲示板・ビデオ会議など、仕事に便利なグループウェア機能が1つのアプリにそなわったビジネスコミュニケーションツールです。トーク機能は「LINE」の使いやすさをそのままに誰でも使いやすく、豊富な仕事用スタンプで気持ちが伝わるコミュニケーションが可能です。スマートデバイスでの利用を中心に設計されており、デスクワークが少ない「現場」ではたらく社員や、仕事の取引先とのコミュニケーションがスムーズになるほか、情報共有の円滑化や、PC利用がメインのバックオフィスの業務効率化など、ビジネスを一層加速させていきます。さらにLINEWORKSは、LINEユーザーとトークがつながる唯一のビジネスチャットです。また、公開されているAPIを通じてさまざまなITシステムとの連携ができるほか、LINECLOVA（AIシステム）の実装により、AIを活用したより良いはたらき方を引き続き追求していきます。','LINEWORKSOCR','LINEWORKS株式会社が提供する「LINEWORKSOCR」は、紙や画像に記載された文字、表をテキストデータへ変換、手軽に導入できる高精度AI-OCRです。','月額',NULL,'0',NULL,true,'[]',NULL,'2024-05-28 10:24:02.254547','2024-06-09 07:23:43.063667',NULL,NULL,'月額 0円～','製品画像29.jpeg'),
