(346,'株式会社エーエヌラボ','1,000万円','2007年5月','約50人','AIソリューションの開発・提供','書類チェッカー','株式会社エーエヌラボが提供する「書類チェッカー」は、各種書類（申込書や請求書など）の記入漏れや記入ミスをAIでチェックし、あらかじめ指定した条件でソーターでの振り分けを行うソリューションです。','その他',NULL,'3006000000',true,NULL,'["\n                \n                お見積もりは無料ですか？              \nはい、無料です。\r\nお見積もり後の２週間のお試し期間も無料です。\r\nその後正式発注をした段階で料金が発生します。", "\n                \n                打ち合わせなどは全て日本語ですか？              \nはい、日本語です。\r\n打ち合わせはもちろん、契約、仕様書など全て日本語で対応しております。", "\n                \n                オフショアなので開発に時間がかかりますか？              \nいいえ、ベトナム側で60人体制で開発をしておりますのでスピーディーな対応が可能です。\r\n日本、ベトナムの両方で日本語対応しており、お客様からの要望もスムーズに反映できます。"]',NULL,'2024-05-28 10:24:14.225509','2024-06-09 07:23:43.511900',NULL,NULL,'ソリューション一括提供の場合は要相談とさせてください。 処理枚数に応じた従量課金の場合は、ヒアリングのうえ別途お見積りとなりますが、目安として書類1枚あたり数円とお考え下さい。','製品画像2.jpeg'),
(347,'ベイシス・テクノロジー株式会社','/','2000年4月','/','弊社の使命は、多言語テキストから有益なインテリジェンスを引き出すことです。弊社のテキスト解析プラットフォームRosetteは、言語解析、深層学習など最先端の自然言語処理技術を活用して、情報検索、テキストマイニング等のソリューションの性能を飛躍的に向上させます。入力テキストの言語判別、非構造化テキストからの人名、社名、地名、日時などの自動抽出、多言語名称照合などの機能を備えています。日米をはじめ世界中の政府機関のほか、Amazon.com、Airbnbなど多くの企業でご利用いただいています。日本企業の海外展開、AML/KYCソリューション、インバウンド向けのサービスなど、様々な言語によるサービス展開をお手伝いいたします。','Rosetteテキスト解析プラットフォーム','ベイシス・テクノロジー株式会社が提供する「Rosetteテキスト解析プラットフォーム」は、多くの言語(機能に応じ20～40言語)に対応しています。','その他',NULL,NULL,true,true,'[]',NULL,'2024-05-28 10:24:16.563222','2024-06-09 07:23:43.594320',NULL,NULL,'お問合せください','製品画像22.jpeg'),
