(351,'株式会社フュートレック','100,000,000円','2000年4月','82名','フュートレックは、その時代に求められる商品を追求し、音声認識事業とデジタルマーケティング事業を主として、様々な価値ある製品やサービスをお客様に提供しています。','【異音検知】音のAI検査ソリューション','「音のAI検査」は、検査対象機器の正常状態との音の違いを数値として出力するソフトウェアです。点検・検品業務や状態監視を聴感検査に頼らない異常検知技術で自動化し、予知保全コストの低減を支援します。','その他',NULL,NULL,true,true,'["\n                \n                他社サービスとの違いは？              \nAIモデルの精度検証だけでなく、ものづくり現場の様々な制約条件を踏まえた上で具体的な実装イメージをご提案いたします。", "\n                \n                商用までの期間は？              \nお客様の状況にもよりますが、お問い合わせから現場でのご利用開始まで半年～1年程度いただいております。", "\n                \n                どういった音が検知できるの？              \nお客様環境によって様々な音がございますので、アセスメント～PoC期間を経て確認させていただいております。", "\n                \n                費用が発生するのはどこから？              \nプレ検証とレポートの作成、PoC以降の内容のご提案までは無料です。まずはお気軽にご相談ください。"]',NULL,'2024-05-28 10:24:24.818043','2024-06-09 07:23:43.889973',NULL,NULL,'お問合せください','製品画像14.jpeg'),
