(373,'HOUSEI株式会社','631百万円（6億3100万円）','1996年3月15日(金)','180名','HOUSEI株式会社は、出版社をはじめとする製造業・小売業などのシステムインテグレーションや顔認証技術によって、多分野におけるソリューション開発を行い、社会のDX支援事業を展開しています。','WelcomID','WelcomIDは、顔認証と検温を高速対応（0.3秒）。電子錠との連携もできる複合型端末です。認証結果に関わらず通過者の顔画像が日時とともに保管されるため、犯罪抑止効果も期待できます。','その他',NULL,NULL,true,NULL,'["\n                \n                すぐに導入可能ですか？              \n検温としての用途であれば、ご注文から1週間程度で納品可能です。", "\n                \n                保証はありますか？              \n機器は1年保証のセンドバック対応とさせていただいております。", "\n                \n                既存のドアにも取り付け可能ですか？              \n可能です。ほとんどのドアに対応可能ですが、工事前に現地調査（無料）をさせていただきます。", "\n                \n                自動ドアに取り付けは可能ですか？              \n可能です。自動ドアメーカーと弊社にて打ち合わせをさせていただきます。", "\n                \n                複数台の管理も可能ですか？              \n可能です。PCもしくはサーバーをご準備いただければ、複数管理用のソフトウェアにて管理できます。"]',NULL,'2024-05-28 10:25:16.448434','2024-06-09 07:23:45.446840',NULL,NULL,'お問合せください','製品画像19.jpeg'),
