(375,'Miletos株式会社','138万円','2016年6月','26名','Miletosは、AIテクノロジーでビジネスプロセスをレガシーからモダンなものへと変革させる会社です。','SAPPHIRE近郊交通費','Miletos株式会社が提供する「SAPPHIRE近郊交通費」は、通勤費・交通費の実費精算に伴う人事・経理処理を自動化。申請・承認のワークフローや通勤経路登録も可能です。「SAPPHIRE経費精査」は経費データ、勤怠データ、入管データなどからリスクの高い経費申請を洗い出し、経緯チェック工数の効率化と、統制の高度化を実現します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:25:20.882074','2024-06-09 07:23:45.605409',NULL,NULL,'お問合せください','製品画像30.jpeg'),
