(378,'株式会社アスカコーポレーション','3,000万円','1995年4月','/','医薬・科学分野の翻訳／英文校正／テープ起こし／メディカルライティング／企画・編集／通訳','AIKOSciLingual','株式会社アスカコーポレーションが提供する「AIKOSciLingual」は、AI翻訳だけでなく、編集・共有、翻訳相談、依頼まで、ワンストップの翻訳プラットフォームです。','その他',NULL,'1000004000',true,true,'["\n                \n                対応している言語は？              \nSciLingualエンジンは日本語⇔英語、日本語⇔中国語（簡体字）に対応しています。\r\nAIKOSciLingualに搭載されているGoogle、Microsoftは以下の27言語に対応しています。\r\nアラビア語、ベンガル語、ドイツ語、英語、スペイン語、フランス語、ヒンディー語、インドネシア語、イタリア語、日本語、韓国語、モンゴル語、マレー語、ミャンマー語、ネパール語、オランダ語、ポーランド語、ポルトガル語、ルーマニア語、ロシア語、スウェーデン語、タイ語、タガログ語、トルコ語、ベトナム語、中国語(簡体字)、中国語(繁体字)", "\n                \n                中国語は簡体字だけでなく、繁体字にも対応できますか？              \n簡体字のみの翻訳となり、繁体字には対応していません。", "\n                \n                医学・医薬に関し、英語⇔中国語には対応していますか？              \n対応していません。必要な場合は「見積依頼」してください。"]',NULL,'2024-05-28 10:25:26.711549','2024-06-09 07:23:45.793644',NULL,NULL,'30,000円から','製品画像5.jpeg'),
(379,'株式会社十印','9,998万円','1963年3月','90名','株式会社十印（とおいん）は、創業の1963年より半世紀にわたって企業のグローバル化をお手伝いするために、企業向けのドキュメント制作・翻訳／ローカライズ・機械翻訳導入支援を行っています。','AI翻訳ツールT-tactAN-ZIN®(ティータクトアンジン)','株式会社十印が提供する「AI翻訳ツールT-tactAN-ZIN®(ティータクトアンジン)」は、国家プロジェクトがつくる高精度翻訳エンジンを搭載しています。簡単便利に翻訳に関わる業務を効率化できます。さらに、自社専用翻訳エンジンの作成・販売や、業界専用の翻訳エンジンを購入することもできます。','年間',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:25:27.906251','2024-06-09 07:23:45.964106',NULL,NULL,'年額 240,000円～','製品画像4.jpeg'),
