(382,'サイエンスパーク株式会社','4,000万円','1994年5月21日','-','サイエンスパークは、デバイスドライバ関連の開発を軸にハードウェア、ファームウェア、アプリケーションまで、全ての分野をクロスオーバーさせた事業展開を行っています。また、AI・画像処理のスペシャリストによる高い技術と知見に支えられた下記事業も行っています。・AI環境構築(HPCの調達とセットアップ)・AI教師データ作成・AI機械学習のパラメータ調整と精度評価・AIを使用したアプリケーション開発・画像処理アルゴリズム開発・画像処理技術を使用したアプリケーション開発・その他研究開発・試作開発支援','HPC+AI環境構築サービス','サイエンスパーク株式会社はこれまで研究機関にAI開発用PCをカスタマイズ・セットアップして納入してきた経験を活かし、「HPC+AI環境構築サービス」を開始しました。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:25:34.616379','2024-06-09 07:23:46.184592',NULL,NULL,'お問合せください','製品画像8.jpeg'),
(383,'イノテック株式会社','10,517百万円','1987年 (昭和62年) 1月5日','1,728（連結）、212（個別）','純国産の産業用PCのメーカーであることを強みに産業用利用でも耐えられる長期稼働・長期供給なハードウェアと、国産顔認証SDKをご提供し、開発者の工数減を推進します。量産対応はもちろんのこと、SDK無償かつMOQ1セットからのご提案が可能なスモールスタートに最適な製品です。','産業機器向けエッジ・オンプレ顔認証SDK','イノテック株式会社が提供するエッジ顔認証SDKは、長期稼働・長期供給可能な産業用PCとお使いいただけるもので、ソフトウェア・ハードウェアを純国産でまとめてご提案可能です。WindowsおよびLinuxに対応したSDKを用いて自由度高く、アプリ開発いただけます。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:25:36.941532','2024-06-09 07:23:46.268807',NULL,NULL,'SDK無償、MOQ1セットからご提案可能です。 SDKを用いて、お客様にてアプリケーションを開発いただくことを想定しております。 詳細はお問い合わせください。','製品画像8.jpeg'),
(384,'株式会社AID','-','2020年2月','-','企業規模や業界・業種を問わず、お客様とAI技術を繋ぐ製品「Package20」・「Builder」の提供、及びAIアルゴリズムの受託開発・コンサルティングなどを手掛けています。','エッジデバイス組込AIモデル開発受託','株式会社AIDが提供する「エッジデバイス組込AIモデル開発受託」は、特定用途が高く、高度なAI開発が必要な案件を中心に、お客様のご要望に応じたAI技術の導入提案、及びエッジデバイス向けAIアルゴリズムの開発受託を行います。NvidiaJetson、RaspberryPi、GoogleCoralTPU、ソラコムS+Camera、PanasonicVieureka等、多様なエッジデバイスに対応しており、可視光カメラに加え、赤外線、LiDARセンサーの活用経験も豊富にございます。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:25:39.293537','2024-06-09 07:23:46.398333',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(385,'HiCustomer株式会社',' 9,000万円','2017年12月','-','業務の自動化から、顧客体験の向上・新規事業開発まで。生成AIの可能性を最大限に引き出すための精度診断・プロトタイプ開発サービス。顧客専用ページを通じて商談や契約後の導入支援を効率化するデジタルセールスルーム『アーチ』。','生成AIの失敗リスクを低減–おまかせPoC','業務の自動化から、顧客体験の向上・新規事業開発まで。生成AIの可能性を最大限に引き出すための精度診断・プロトタイプ開発サービス','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:25:41.748800','2024-06-09 07:23:46.529246',NULL,NULL,'・プロトタイプ開発：100万円〜 ・ コンサルティング：30万円/月〜','製品画像3.jpeg'),
(386,'Advancy株式会社','1500万円','2023年3月','10人程度','Advancyは、AIとデジタルトランスフォーメーションの統合ソリューションを提供し、各種ビジネスプロセスの強化と新たな価値創造をサポートしています。データ分析とAI開発を通じて、企業のデジタル変革を加速させることを目指しています。','AIが変える未来：AdvancyAI/DXソリューション','データから新たな価値を創造する、あなたのAIパートナー「Advancy　AI/DX　ソリューション」は、画像認識、生成AI、ディープラーニング、チャットボットの導入支援により、企業のデータを活用して独自のビジネスソリューションを提供します。自動車産業における動体検査システムの自動化から、食材の余剰を利用した新規レシピ生成、大手金融機関の与信管理におけるディープラーニング技術の適用に至るまで、Advancyの技術は業界の枠を超えたイノベーションを実現します。これらの最先端ソリューションにより、ビジネスプロセスは効率化され、市場への適応速度が飛躍的に向上します。','その他',NULL,NULL,NULL,NULL,'["\n                \n                AdvancyのAI/DXソリューションはどのような業界で活用できますか？              \n当社のソリューションは多様な業界に適用可能です。製造業からサービス業、金融業界まで、幅広い業種のデータ分析とビジネスプロセス改善に対応しています。", "\n                \n                どのような課題解決が可能ですか？              \nAdvancyのソリューションは、業務効率化、データ駆動型意思決定の強化、新しいビジネスチャンスの探索など、多岐にわたる課題解決に寄与します。", "\n                \n                導入後のサポートはありますか？              \nはい、導入後も継続的なサポートと最適化を提供します。これにはAIモデルのモニタリング、性能向上のための再学習、モデルのチューニングが含まれます。"]',NULL,'2024-05-28 10:25:44.112039','2024-06-09 07:23:46.580414',NULL,NULL,'お問合せください','製品画像15.jpeg'),
(387,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','生成AI向け「LLM開発用日本語データセット作成代行サービス」','FastLabel株式会社が提供する「LLM開発用データセット作成代行サービス」はLLMに特化したプロフェッショナル人材を登用しており、日本語のQ&Aなどのデータをゼロから作成することで権利リスクがない高品質なデータセットをご提供いたします。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \n大変申し訳ございませんが、一概に費用をご提示することができません。一度ご面談の上で概算のお見積りをお出しします。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はデータ作成代行だけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:25:47.019395','2024-06-09 07:23:46.650968',NULL,NULL,'お問合せください','製品画像22.jpeg'),
(388,'株式会社neoAI','5,600万円（資本準備金を含む）','2022年8月','-','株式会社neoAIは、「時代のうねりを日本の成長に転換する」をVisionに掲げる東京大学松尾研究室発の生成AIスタートアップです。','AIモデル開発・コンサルティングサービス','株式会社neoAIが提供する「AIモデル開発・コンサルティングサービス」は、東京大学松尾研究所で共同研究に取り組むメンバー等がチームを組んでAI開発・データ分析を行います。AI戦略の策定や共同研究、講習会などお客様のニーズに合わせて、幅広くご支援いたします。','月額',NULL,'なし',true,NULL,'["\n                \n                AI開発のみをお願いしたいのですが可能でしょうか。              \n可能です。既に導入されているAIの精度向上といったご相談もお待ちしております。", "\n                \n                AI活用に十分なデータがないと思うのですが、相談可能でしょうか。              \n既存のAIモデルを用いて課題解決ができる場合もございますので、まずはお問合せください。"]',NULL,'2024-05-28 10:25:49.521027','2024-06-09 07:23:46.717441',NULL,NULL,'月額150万円〜400万円','製品画像15.jpeg'),
