(390,'株式会社SIGNATE','2億80百万円（資本準備金1.8億円含む/2022年8月1日時点）','2017年5月1日','50名','SIGNATEは、国内最大8.6万人超のAI/データ人材コミュニティを運営し、DX人材育成サービスやAI開発/データ分析コンペ、国や自治体のDX/AI人材発掘・育成PJ等を展開しています。','AIDevelopment','株式会社SIGNATEが提供する「AIDevelopment」は、AI開発をトータルでサポートし、最高精度のAI開発を実現します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:25:53.270630','2024-06-09 07:23:46.875575',NULL,NULL,'お問合せください','製品画像23.jpeg'),
