(392,'株式会社スカイディスク','-',' 2013年10月1日','-','AIを活用したDX支援','AI外観検査機','株式会社スカイディスクが提供する「AI外観検査機」は、アルゴリズムだけでなく、「AIが特徴を抽出しやすい画像データ収集方法」まで設計・開発します！','その他',NULL,NULL,NULL,NULL,'["\n                \n                他社の外観検査検証サービスとの違いは？              \nAIモデルの精度検証だけでなく、ものづくり現場の様々な制約条件を踏まえた上で具体的な実装イメージをご提案できるところです。\r\nアルゴリズムだけでは、「リアルに実装」することはできません。", "\n                \n                実装までの期間は？              \nお客様の状況にもよりますが、プロジェクトのご発注から実装まで半年〜1年程度いただいております。", "\n                \n                費用が発生するのはどこから？              \n簡易レポートの作成・プロジェクトのご提案までは無料です。まずはお気軽にご相談ください。"]',NULL,'2024-05-28 10:25:57.009194','2024-06-09 07:23:47.036261',NULL,NULL,'お問合せください','製品画像25.jpeg'),
