(394,'イノテック株式会社','10,517百万円','1987年 (昭和62年) 1月5日','1,728（連結）、212（個別）','純国産の産業用PCのメーカーであることを強みに産業用利用でも耐えられる長期稼働・長期供給なハードウェアと、国産顔認証SDKをご提供し、開発者の工数減を推進します。量産対応はもちろんのこと、SDK無償かつMOQ1セットからのご提案が可能なスモールスタートに最適な製品です。','国産顔認証AIソリューション','イノテック株式会社が提供する「国産顔認証AIソリューション」なら、年齢・性別・感情も認識できます。マスク、眼鏡、ヘルメットを着用していても個別認識可能な世界最高クラスの顔認証技術です。非接触で様々なサービスに応用可能な低コストな標準パッケージをご提案します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:26:01.806732','2024-06-09 07:23:47.159395',NULL,NULL,'お問合せください','製品画像17.jpeg'),
