(397,'MakinaRocksCo.,Ltd','48億ウォン','2017年12月','120名','機械学習技術とMLOpsプラットフォームを組み合わせて産業現場に特化したAIソリューションを提供しています。2023年には、CBInsightsの「AI100」に製造業分野で唯一選出されました。','MRXMotor','-MRXMotorで製造現場における「実感できるAI」を実現-産業用AI特化のMakinaRocksが提供する「MRXMotor」は、産業用モーターの故障を事前予測し寿命を計算することで、非稼働時間を短縮し、作業効率と生産性向上を実現するソリューションです。','その他',NULL,NULL,true,NULL,'["\n                \n                現状ではデータ収集が進んでいないのですが大丈夫でしょうか？              \nセンサーの設置から実際の分析までMakinaRocksが伴走しますのでご安心ください。", "\n                \n                社内にAIの専門家がいなくても問題ないでしょうか？              \n社内にAIの専門人材がいない場合でも、AI異常検知の導入プロセスを一歩ずつ進める体制を準備しております。", "\n                \n                AI企業って製造業のドメイン知識があるかが心配です              \n製造業のグローバル大企業からの投資＆プロジェクト実績があるMakinaRocksだからこそ、現場の実情に合わせたカスタマイズしたご提案が可能です。"]',NULL,'2024-05-28 10:26:07.767834','2024-06-09 07:23:47.452372',NULL,NULL,'お問合せください','製品画像2.jpeg'),
(398,'株式会社アクセルラボ','8千万円（80,000,000円）','2017/7/1','/','AIホーム、IoT機器、アプリの開発・販売、メディア運営','SpaceCore','株式会社アクセルラボ提供する「SpaceCore」はスマートライフ・プラットフォームです。スマートホーム化を起点に、業務の効率化と顧客との関係強化、収益アップを実現。不動産会社の他、民泊運営会社など様々な企業に導入されています。','その他',NULL,'なし',true,NULL,'["\n                \n                アプリはパソコンからも動かせますか              \nスマートフォンのみになります。", "\n                \n                アプリの動作に必要な端末スペックを教えてください              \niosまたはAndroidで、アプリがインストールできる端末であれば問題ございません。", "\n                \n                アプリはどこから入手できますか？              \nAppStoreまたはGoogleストアからインストール可能です。"]',NULL,'2024-05-28 10:26:10.128155','2024-06-09 07:23:47.520089',NULL,NULL,'物件により応相談','製品画像21.jpeg'),
