(400,'吉積情報株式会社','1,000万円','2005年9月6日','10名','「GoogleCloudによる働き方改革を世界中に広め、お客様の真のデジタルトランスフォーメーションを実現する」ことをミッションに、お客様の業務改革へのサービス導入やシステム開発の支援事業を行っています。','Cmosy','吉積情報株式会社が提供する「Cmosy」は、GoogleAIを使って、情報漏えいを未然に防ぎます。Cmosyは、Googleドライブの拡張サービスです。AI・人間のダブルチェックにより情報漏洩のリスクを軽減し、安心・安全にデータを共有することを実現します。','月額',NULL,'なし',true,true,'["\n                \n                Cmosyはすべての Google Workspace のプランで利用できますか?              \nはい、ご利用いただけます。\r\nただし共有ドライブがないBusinessStarterプラン（30GB）においては、ファイル送付、受け取り機能のみとなり、共有ドライブに付帯する機能はご利用いただけません。", "\n                \n                無料の大容量ファイル送付サービスと何が異なるのでしょうか？              \nパスワードをつけて相手にファイルを送付できるという点では同じですが、パソコンからのデータではなく、直接組織で使用・管理しているGoogleドライブのファイルを直接送れることが大きな違いです。また送受信の履歴はすべて管理者側で閲覧することが可能です。", "\n                \n                Google ドライブの社外への共有をすべて制限している場合でも、社外にデータ送付できるのですか？              \nはい、可能です。Cmosyを採用される多くの企業様は、すでにGoogleドライブの外部共有の制限を緩めることができない企業様です。そうした企業様に安全にかつ必要なファイルだけを社外送付させることを実現するサービスがCmosyです。"]',NULL,'2024-05-28 10:26:14.907150','2024-06-09 07:23:47.707137',NULL,NULL,'500円~/1ユーザー月額','製品画像14.jpeg'),
(401,'矢崎総業株式会社','31億9,150万円','1941年10月','239,753名（グループ法人・海外拠点を含む）','矢崎総業グループは、ワイヤーハーネス（自動車部品）において世界トップクラスのシェアを誇り、世界45の国と地域、従業員数約25万名、売上高約2兆円の規模を有しています。','YAZAKIの画像アノテーションサービス','80年を超える品質管理の実績が約束する、信頼性の高いアノテーションを提供します。','その他',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:26:17.248948','2024-06-09 07:23:47.759547',NULL,NULL,'分類：¥5～ 短形：¥10～ キーポイント： ¥7～ ※料金は要件によって異なるため、お見積もりください','製品画像20.jpeg'),
(402,'Advancy株式会社','1500万円','2023年3月','10人程度','Advancyは、AIとデジタルトランスフォーメーションの統合ソリューションを提供し、各種ビジネスプロセスの強化と新たな価値創造をサポートしています。データ分析とAI開発を通じて、企業のデジタル変革を加速させることを目指しています。','生成AIコンサルティングソリューション','LLMをはじめとする生成AIを、事業に紐づく形で最適化して導入いたします。開発の前に技術リサーチやフィジビリティ（実現性）検証をコンサルティング/アドバイザリー支援として提供しますので、最小のリスクでAIの技術検証ができます。東大系のコミュニティとのリレーションを背景に、大手企業様との共同研究などのより踏み込んだ取り組みも豊富に実績がございます。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:26:19.716224','2024-06-09 07:23:47.822068',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(403,'モビルス株式会社','438,827,039円（2023年8月31日現在）','2011年9月','/','モビルスは、テクノロジーでサポートを新しくする、TheSupportTechCompanyです。コンタクトセンター向けSaaSプロダクト（モビシリーズ）などのCXソリューションを提供しております。','MooA（ムーア）','応答効率を上げ、自己解決率を改善するオペレーション支援AI','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:26:22.208503','2024-06-09 07:23:47.886030',NULL,NULL,'お問合せください','製品画像2.jpeg'),
(404,'SREホールディングス株式会社','4,147,654千円','2014年4月','310名','リアルビジネスを内包することで実務有用性の高いテクノロジーソリューションを、不動産/金融/IT・ヘルスケア領域といった幅広いライフステージにおいて展開するライフテックカンパニー','生成AI活用コンサルティングサービス','生成AI技術を駆使し、企業のデジタル変革を支援。戦略策定からデータ分析、生成AI実装まで専門的かつ適切なアドバイスを提供し、お客様のビジネス効率化とイノベーションを実現します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:26:24.620402','2024-06-09 07:23:47.950101',NULL,NULL,'お問合せください','製品画像24.jpeg'),
(405,'株式会社スクーティー','2,898万円','2015年11月25日','-','・ベトナムオフショア開発・ラボ型開発サービス・生成AIコンサルティングサービス・ベトナム視察ツアーアテンドサービス・安全な環境でChatGPT「セキュアGAIforenterprise」・AIが接客「バーチャルアシスタント」','生成AIコンサルティングサービス','生成AIを活用した業務効率化や、新たなビジネスの価値創造をお考えでしたら、弊社の生成AIコンサルティングサービスをご利用ください！弊社の豊富な実務経験に基づく支援をいたします。ヒアリングは無料実施！','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:26:25.810145','2024-06-09 07:23:48.016163',NULL,NULL,'お問合せください','製品画像9.jpeg'),
(406,'株式会社Managetech','420万円','令和3年11月15日','10名','Managetechはあらゆるテクノロジーを駆使し、システム開発者が技術に熱中できる世界を実現します。','PromptHub','Managetechが提供する「PromptHub-プロンプトハブ」は高効率なプロンプトを作成し、システムへ組み込むなど業務サービス効率化のための生成AI活用を支援します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:26:28.287223','2024-06-09 07:23:48.102211',NULL,NULL,'お見積','製品画像5.jpeg'),
(407,'株式会社SIGNATE','2億80百万円（資本準備金1.8億円含む/2022年8月1日時点）','2017年5月1日','50名','SIGNATEは、国内最大8.6万人超のAI/データ人材コミュニティを運営し、DX人材育成サービスやAI開発/データ分析コンペ、国や自治体のDX/AI人材発掘・育成PJ等を展開しています。','SIGNATEデータ活用ソリューション','株式会社SIGNATEは国内最大約9万人の「AI/データ人材会員」と「企業」を繋げ、データ活用・AI開発における『人材不足』『知見不足』を解決します。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:26:31.003323','2024-06-09 07:23:48.165213',NULL,NULL,'お問合せください','製品画像22.jpeg'),
(408,'SREホールディングス株式会社','4,147,654千円','2014年4月','310名','リアルビジネスを内包することで実務有用性の高いテクノロジーソリューションを、不動産/金融/IT・ヘルスケア領域といった幅広いライフステージにおいて展開するライフテックカンパニー','AI導入・活用支援サービス','不動産や金融/IT/ヘルスケア事業などのリアルビジネスを内包しAI技術で自らDXを推進しているからこそ実現できる、実業の知見とAI技術を融合し現場で使えるAI実装によって課題を解決するサービスです。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:26:33.715125','2024-06-09 07:23:48.219057',NULL,NULL,'お問合せください','製品画像4.jpeg'),
(409,'MindtechGlobal','-','2018年5月1日','-','当社は、顧客のトレーニングデータを分析し、その分析と顧客のユースケースに基づいて追加の合成トレーニングデータを作成して、AIビジョンシステムのAIモデルのパフォーマンスを向上させる、市場をリードするDataOpsプラットフォームを提供します。','DataOpsプラットフォーム「Dolphin,Chameleon」','Mindtechが提供する「Dolphin」「Chameleon」DataOpsプラットフォームは、学習データを分析し、それを補う合成学習データを作成して、AIシステムのパフォーマンスを向上させます。','その他',NULL,NULL,NULL,NULL,'["\n                \n                AI システムには独自のカメラが搭載されていますが、Mindtech はそれをサポートできますか?              \nMindtechは、Chameleonで使用するカメラパイプラインを開発しました。解像度、視野、フレームレート、画像ノイズ、圧縮をすべてカメラパイプラインに追加して、現実世界の状況をより適切に表現できます。", "\n                \n                Mindtech はカメラ以外のセンサーをサポートしていますか?              \nはい-画像に加えてビデオシーケンスも提供できます。魚眼レンズのサポートを提供するために調整されたカメラがあります。さらに、LiDARおよびNIRセンサーもサポートしています。", "\n                \n                Chameleon で実行できるカメラの数に制限はありますか?              \nChameleonで実行できるカメラの数に制限はありません。ただし、カメラを追加するたびに処理時間が増加するため、ある段階では複数のChameleonプラットフォームを並行して実行して高速な結果を得る方が効率的になります", "\n                \n                サポートしていないユースケースはありますか              \n「Chameleonはユースケースにとらわれず、お客様のあらゆるユースケースについて喜んでフィードバックを提供します。ただし、弊社のお客様のほとんどは以下の市場のお客様です。　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　-安全性とセキュリティ\r\n-プロセスの自動化\r\n-交通機関\""]',NULL,'2024-05-28 10:26:36.286344','2024-06-09 07:23:48.269797',NULL,NULL,'データ パックの価格はイメージ数とアノテーションデータのご要求にもより大きく異なります。DataOps プラットフォームのライセンスの詳細および SaaS サービスの詳細については、Mindtech にお問い合わせください。','製品画像28.jpeg'),
(410,'富士ソフト株式会社','262億28万円','1970年（昭和45年）5月15日','単体：9,435名 （2023年12月末現在） 連結：17,921名 （2023年12月末現在）','富士ソフトは独立系Sierであり、自社開発AIや自社サービスのみではなく、様々な選択肢の中から最適なものを選択し組合せてお客様にご提供します。さらに、AI以外の技術との組合せでご要望に対応できます。','AI開発効率化ソリューション「自動アノテーションサービス」','-AIモデル開発の問題をAIで解決します-富士ソフトが提供する「自動アノテーションサービス」は、高品質なアノテーションデータを自動で作成し、かつ学習効果に応じてデータをレベル分けする機能「学習寄与度」によりAIモデル開発の効率化に貢献します。','その他',NULL,'なし',true,NULL,'["\n                \n                アノテーション可能なデータ種別は？              \n当サービスは物体検出用の画像や動画データに対応しており、アノテーションタイプはバウンディングボックスとなります。\r\n他のアノテーションタイプについても個別対応が可能ですので、お問い合わせください。", "\n                \n                アノテーションに対応可能なクラスは？              \n人、車、自転車、バイク、信号機など80種類のクラスに対応可能です。これ以外のクラスも対応可能ですので、お問い合わせください。", "\n                \n                学習データを提供する際のファイル形式は？              \nMP4、AVI、jpgのほかにも様々な形式に対応可能です。", "\n                \n                アノテーションされた学習データのファイル形式は？              \nCSV、XML、JSONやTXTなどほかにも対応可能です。", "\n                \n                オフショア等の国外に依頼することはあるか？              \n当社のアノテーションサービスはすべて国内で行っており、安全性や品質の観点から国外への依頼は行っておりません。\r\n国内の専門スタッフがデータのアノテーション作業を行い、厳格な品質管理のもとでサービスを提供しています。\r\nお客様のデータは国内で安全に取り扱われますので、安心してご利用いただけます。"]',NULL,'2024-05-28 10:26:37.633059','2024-06-09 07:23:48.326368',NULL,NULL,'個別見積り','製品画像23.jpeg'),
(411,'ピクスタ株式会社','325,777,000円（2023年3月末時点）','2005年8月','連結125名、単体79名（2023年09月末時点)','デジタル素材のオンラインマーケットプレイス「PIXTA」の運営家族・子ども向け出張撮影プラットフォーム「fotowa」の運営法人向け出張撮影サービス「PIXTAオンデマンド」の運営','画像・動画データ作成アノテーション','ピクスタの機械学習用画像・動画データ提供サービスは、データ収集とアノテーション代行をワンストップで提供。国内最大級の素材サイト『PIXTA』の強みを活かし、商用利用可能なデータでAI開発を支援します。','ユーザー',NULL,'なし',NULL,true,'[]',NULL,'2024-05-28 10:26:38.975893','2024-06-09 07:23:48.410122',NULL,NULL,'「日本人人物データセット」は、1,000点　90,000円（税抜）〜 オーダーメイドの場合はご要件に基づき、個別見積','製品画像18.jpeg'),
(412,'ソフトバンク株式会社','204,309百万円（2023年3月31日現在）','1986年（昭和61年）12月9日','/','移動通信サービスの提供、携帯端末の販売、固定通信サービスの提供、インターネット接続サービスの提供その中でTASUKIAnnotationサービスは、ソフトバンクの注力分野であるAIの開発を加速・支援するアノテーション事業・生成AI用データ構造化事業を行っています。','TASUKIアノテーションツール','ソフトバンク株式会社が提供する「TASUKIアノテーションツール」は、アノテーション作業の課題を解決し、効率的で確実な作業を実現するためのツールです。豊富な自動アノテーション機能やWeb同期作業、安心のセキュリティという特徴を備えており、アノテーションを内製で実施したいお客様の幅広いニーズに対応しています。','その他',NULL,NULL,NULL,true,'["\n                \n                TASUKI Annotationはどのような種類のデータをサポートしますか？              \nTASUKIAnnotationは画像ファイルをサポートしています。ファイル形式には、JPG、PNG、BMPが含まれます。", "\n                \n                TASUKI Annotationはどのモデルの教師データの作成が可能ですか？              \nセグメンテーション、画像分類、物体検出、姿勢推定の教師データの作成を効率的に行うことができます。\r\nまた、出力データフォーマットに関してはMSCOCO、YOLO、PASCALVOC、CVAT、LabelMeやセグメンテーションのマスク画像・CSVに対して対応をしております。", "\n                \n                なぜ短期間でのAI開発を実現できるのですか？              \nデータ作成を効率的に行えるだけでなく、データの作成状況やデータ品質の確認、中間でのダウンロードなども柔軟に行えます。これにより従来のAIモデル開発よりも短いサイクルでイテレーションを行うことができます。", "\n                \n                オンラインでの打ち合わせは可能でしょうか？              \n可能です。Zoomなどのツールを使用し、オンラインでのお打ち合わせを実施させていただきます。\r\n初回のご相談時もご発注後の定期的な打ち合わせもオンラインでの対応が可能です。", "\n                \n                データはどのような体制で管理されているのでしょうか？              \nソフトバンクのセキュリティ基準を満たしたシステム環境でお客様のデータは安全に管理されます。更に、2段階認証機能や接続先IP制限によりお客様の大事なデータを守ります。"]',NULL,'2024-05-28 10:26:41.533906','2024-06-09 07:23:48.495512',NULL,NULL,'お問合せください','製品画像3.jpeg'),
(413,'株式会社WorldStandard','-','2022年6月17日','-','オフショアBPO事業','高品質アノテーションラボサービスAnnotators','オフショア環境による圧倒的なコストパフォーマンス（2円～/Bbox）と数々のBPO業務から培ったプロジェクト体制による高品質なデータ作成を特徴としたアノテーションサービスです。','その他',NULL,NULL,true,NULL,'["\n                \n                どのようなアノテーションに対応していますか？              \n画像に対するアノテーションを得意としており、バウンディングボックス、セグメンテーションに対応しております。\r\nその他、画像分類や動画からの切り出しなどにも対応しておりますので、ぜひご相談ください。", "\n                \n                相談からお見積り提出までどれくらいかかりますか？              \n3日以内に対応いたします。スピード感を持った対応を重視しておりますので緊急の案件もお任せください。", "\n                \n                何枚から対応していますか？              \n基本的に最低依頼枚数は設けておりません。しかし多くいただけるほどコストメリットをご提供させていただけます。\r\nお見積りを依頼枚数別で出すことも可能でございます。", "\n                \n                急ぎの案件なのですが対応できますか？              \n案件状況に応じてご希望に沿った対応を心がけております。ご依頼から1週間以内でのご対応も可能でございますのでぜひご相談ください。"]',NULL,'2024-05-28 10:26:43.950317','2024-06-09 07:23:48.560115',NULL,NULL,'1Bbox2円～（ 案件の詳細をお伺いしお見積りいたします ）','製品画像23.jpeg'),
(414,'アッペンジャパン株式会社','500万円','2021年7月（本社の設立は1996年）','1,200名（全世界）','高機能なAIモデルを作成するためのトレーニングデータを提供します。音声、テキスト、画像、動画など様々なデータ生成や各種アノテーションデータを提供し、データ生成、アノテーションのための様々なプラットフォームも提供します。','AIモデル作成のためのトレーニングデータの生成・データアノテーション','音声データでは170カ国、235以上の言語や方言への対応実績があり、音声データの収録、文字起こしなどを行います。画像・動画についても人物や建物、故障や異常検知のための対象物の収録、各種パラメーターのアノテーションやラベルの付加を行います。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:26:45.167383','2024-06-09 07:23:48.648226',NULL,NULL,'別途お見積りによる （日本語の音声収録の場合、目安は1時間の音声収録あたり、スクリプトの提供なしで約1.5万円が目安。画像データ収録は対象物、収録場所により異なりますが、１イメージあたり1,000円がひとつの目安）','製品画像3.jpeg'),
(415,'ポールトゥウィン株式会社','3,000万円','1994年1月','約5,000人','当社は「デバッグ・検証」「ネットサポート」など幅広いサービス範囲において、「お客様のサービス・ライフサイクル」である企画、開発、リリース、運用、改善の各工程における課題に応じたソリューションサービスを提供しております。','AIアノテーションサービス','PTWが提供する「AIアノテーションサービス」は、お客様のご要望に柔軟に寄り添い、迅速で高品質なサービスを提供いたします。','その他',NULL,'0',true,NULL,'[]',NULL,'2024-05-28 10:26:46.407967','2024-06-09 07:23:48.753255',NULL,NULL,'-','製品画像17.jpeg'),
