(431,'株式会社リンク','1000万円','1987年11月18日','120名','クラウド/ホスティング・クラウド型テレフォニー・セキュリティプラットフォーム・マーケティング・なかほら牧場の5つの事業を中心とした質の高いサービスを提供しています。','BIZTEL（ビズテル）','電話はクラウドの時代へ。リンクが提供する「BIZTEL」はコールセンター業界で圧倒的なシェアを誇るクラウドPBXです。コールセンターシステム・スマートフォン内線化など豊富な機能をクラウドで提供しています。','その他',NULL,'150000',true,true,'["\n                \n                現在使用している電話番号の継続利用は可能ですか？              \n可能です。現在お使いの0120・0570などの番号、政令指定都市などであれば03・06など地域番号の継続利用も可能です。", "\n                \n                導入から利用開始までどのくらいの期間がかかるのでしょうか？              \n最短で5営業日でのご利用が可能です。お客様の環境によって変化しますので、詳しくはお問い合わせください。", "\n                \n                通話する際に固定電話端末は必要ですか？              \n必要ではありません。パソコン上で動作するソフトフォンや携帯電話端末をご利用いただいているお客様が多くいらっしゃいます。\r\nもちろん固定電話端末をご利用いただくことも可能です。また、オプションを追加いただければモバイル端末でもご利用いただけます。"]',NULL,'2024-05-28 10:27:22.638339','2024-06-09 07:23:50.506135',true,150000,'1席15,000円〜','製品画像28.jpeg'),
(432,'株式会社セールスフォース・ジャパン','4億円','2000年4月','/','セールスフォース・ジャパンは世界最大のCRM（顧客管理）ベンダー。大手企業から中堅・中小企業、スタートアップまで、SFA（営業支援）、カスタマーサポート、マーケティング、コマースまで包括的なCRMプラットフォームを提供することで、顧客とのエンゲージメントを支援しています。','ServiceCloud-コールセンター','Salesforceが提供する「ServiceCloud」は最高のカスタマーサービスを提供できるCRMプラットフォームです。顧客の問合せを一元管理し、自動化ツールでエージェントの生産性を向上。','月額',NULL,'0',true,true,'[]',NULL,'2024-05-28 10:27:23.738947','2024-06-09 07:23:50.578472',NULL,NULL,'参考料金（一部のみ掲載）月額料金　税別3,000円～','製品画像14.jpeg'),
(433,'株式会社インフォディオ','1億円','2002年7月',' 97名（2023年2月現在）','■AI/ITソフトウェアプロダクト・クラウドサービスの開発・販売スマートOCR、DenHo[導入先]法務省　統計センター（総務省）　国税庁　県警察金融機関等　数百社　■ソフトウェア開発・システムインテグレーション[実績]国税庁　株式会社JTB　みずほ銀行　株式会社エヌ・ティ・ティ・データ等※敬称略','DenHo','オフィスの紙帳票・PDFをいつでもどこでも検索・閲覧可能に！電子帳簿保存はこれ1つで簡単対応。','その他',NULL,NULL,NULL,NULL,'["\n                \n                JIIMA認証は取得していますか？              \n取得しております。DenHoは公益社団法人日本文書情報マネジメント協会（以下JIIMA）の令和3年度改正に対応した「電帳法スキャナ保存ソフト法的要件認証」と「電帳法電子取引ソフト法的要件認証」を取得しております。", "\n                \n                料金プランはどのようになっていますか？              \n1企業様につき月額9000円からご利用いただけます。詳細についてはお問い合わせ下さい。", "\n                \n                導入までにどれくらいかかりますか？              \n3営業日ほどでご利用の開始をしていただくことができます。", "\n                \n                オンプレでの提供は可能ですか？              \nクラウドのみでのご提供となっております。", "\n                \n                どのブラウザに対応していますか？              \nGoogleChromeを動作保証しております。", "\n                \n                社外からのアクセスを制限することは出来ますか？              \nユーザーIDごとにIPアドレスでの制限をかけることが可能です。", "\n                \n                タイムスタンプには対応していますか？              \n認定タイムスタンプにも対応しております。"]',NULL,'2024-05-28 10:27:26.318991','2024-06-09 07:23:50.724597',NULL,NULL,'お問合せください','製品画像7.jpeg'),
(434,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','建設業界向け日本人作業員の画像・動画データセット','FastLabel株式会社が提供する画像・動画データセットは、日本企業のAI開発のニーズを反映した権利クリアなデータセット、100万点超のストックフォトをオーダーメイドパッケージ、新規撮り下ろし・データ収集サービスで、スピーディーに必要なデータご提供します。','その他',NULL,NULL,NULL,NULL,'["\n                \n                費用はどのくらいですか？              \nご支援の範囲に応じて、数十万〜数百万のご費用感となるケースが多くなっております。\r\n要件に従い、個別にお見積りをいたしますので、お気軽にお問い合わせください。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はAI開発・コンサルティングだけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:27:28.701844','2024-06-09 07:23:50.803485',NULL,NULL,'お問合せください','製品画像29.jpeg'),
(435,'FastLabel株式会社','1億円','2020年1月23日','従業員数は72名（うち役員、正社員36名）','AI開発の各プロセスを包括的にサポートする「AIPaaS」を提供しております。AIPaaSには、データ収集、販売、アノテーション、データ管理、モデル構築、評価、MLOps構築、コンサルティングサービスなど、AI開発プロセスを一気通貫でカバーするプロダクトとサービスが含まれており、お客様のAI開発プロセスを高度化するための各種ご支援を行っております。','AI研究開発向け「データセット販売×収集代行サービス」','FastLabel株式会社が提供する「データセット販売×収集代行」は権利クリアな画像、動画、音声、テキストなど非構造データ全般に対応しております。感情音声や人物顔画像、LLMのデータセットのお問い合わせが増えてきております。まずは一度ご相談ください。','その他',NULL,NULL,NULL,true,'["\n                \n                費用はどのくらいですか？              \n大変申し訳ございませんが、一概に費用をご提示することができません。一度ご面談の上で概算のお見積りをお出しします。", "\n                \n                日本人の顔の画像データを新規撮影で500枚くらい欲しい場合、いくらくらいになるの？              \nまずはお見積りに必要な情報の不足分をご面談にてヒアリングさせていただきます。概算お見積りは最低でも3営業日頂戴いたしますので、お早めにお問い合わせください。", "\n                \n                まだ要件が決まってないのですが、相談しても良いのでしょうか？              \n要件が決まっていない時点からのお問い合わせがお勧めです。弊社が壁打ち相手となり、要件検討が早く進む場合が多いです。", "\n                \n                他の会社との違いは何ですか？              \n弊社はデータ収集の代行やデータセット販売だけではなく、AI開発における全てのフェーズでお客様をサポートできる会社です。例えば、データコンサルティング実施の上でデータの新規撮り下ろしを行い、アノテーションデータをお付けしてお渡しすることも可能です。"]',NULL,'2024-05-28 10:27:31.208471','2024-06-09 07:23:50.878148',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(436,'アストロラボ株式会社','114,249,550円（資本準備金含まず）','2012年12月','15名','Saasサービス・大規模業務システムの開発・提供、ウェブサイト構築、SEO・リスティング広告などのマーケティング支援','備品管理クラウド','アストロラボ株式会社が提供する「備品管理クラウド」は、会社の備品情報をまとめて管理できるクラウドサービスです。購入数や時期や稟議書はもちろん、現在の利用者や利用していない備品のありかまでを見える化し、無駄な再購入を防いで備品コストを削減し、眠っていた備品も大事に有効活用できるようになります。','月額',NULL,'なし',true,true,'[]',NULL,'2024-05-28 10:27:32.450945','2024-06-09 07:23:50.998641',NULL,NULL,'月額5,000円～','製品画像10.jpeg'),
(437,'株式会社S&A','10,000,000円','2012年11月13日','30名','コンピュータシステム及びソフトウェアの企画・開発・販売及び保守','ARROW','株式会社S&Aが提供する「ARROW」はシフト勤怠管理から、給与の自動計算、各種書類への自動転記機能を兼ね備えた労務管理システムです。直感的で使いやすい画面設計、誰でも簡単に扱える操作性で、労務管理上のあらゆる業務の効率化を目指しました。','月額',NULL,'0',true,true,'["\n                \n                クラウド型のシステムという事ですが、普通のシステムと何が違うのですか？              \nクラウド型のシステムとは、パソコンなどにソフトウェアをインストールするのではなく、インターネットで接続できるクラウド上のストレージにアクセスする事で利用できるシステムの事です。\r\nこのARROWは、打刻アプリケーション以外の全ての登録・利用情報をご利用者様ごとに割り振られたクラウド上のサーバーに保存しますので、インターネット環境さえあればパソコンやタブレット端末からいつでも、どこからでもシステムにアクセスすることができます。もちろん専用端末の導入なども必要ありません。保存された情報のバックアップ・セキュリティ機能もありますので安心かつ安全に勤怠情報の管理が行えます。", "\n                \n                ICカード打刻用の端末の貸し出しはできますか？              \nはい。タブレットとICカードリーダーを1セットあたり月額1,760円（税込）で貸出可能です。\r\n※無料トライアル期間中は機器の貸出も無料となります。\r\n※ICカードは市販の物をお買い求めください。", "\n                \n                ICカード打刻用のカードは専用のものを購入するのですか？              \nお手元にお持ちの交通系のカード（SuicaやICOCA等）やコンビニ等のカード（nanacoやEdy等）がご利用いただけます。\r\nお持ちで無い場合はFeliCaカードをご購入の上ご利用ください。"]',NULL,'2024-05-28 10:27:34.848855','2024-06-09 07:23:51.082396',NULL,NULL,'Aプラン 月額1,980円/店舗（税込2,178円/店舗） Bプラン 月額3,980円/店舗（税込4,378円/店舗） Cプラン 月額4,980円/店舗（税込5,478円/店舗）','製品画像22.jpeg'),
(438,'株式会社アイメソフト・ジャパン','400万円','2020年5月','50名 (Aimesoft JSCを含む)','マルチモーダルAIソフトウェアの研究・開発・販売及びコンサルタント事業','AimeTalk','株式会社アイメソフト・ジャパンが提供する「AimeTalk」は、音声合成や顔アニメーション生成などのAI技術と、RPA技術を組み合わせた自動プレゼンテーションシステムです。繰り返しの多い定型説明のプレゼンテーションや、製品紹介動画の作成など、幅広い用途でお使いいただけます。','月額',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:27:36.525548','2024-06-09 07:23:51.178419',NULL,NULL,'月額 1,000円','製品画像28.jpeg'),
(439,'Pole&Line合同会社','500万円','2015年2月','14名','採用支援、人事コンサルティングの提供、HRテックプロダクトの開発・提供。Pole&Lineは変革のためのHR支援をミッションに掲げ、人材領域での知見と顧客視点を最大限に活かし、WeekareをはじめとしたHR関連サービスの開発・販売、およびソリューションの提供を行うことで、DX時代における企業のHR課題の解決を支援しています。','Weekare','Pole&Line合同会社が提供する「Weekare」は、従業員の心の不調をきめ細やかに把握し、アラートの早期発見と対処をサポートするHRツールです。定期個別アンケートにより、潜在的コンディションや、心の移り変わりも早期発見できるため、従業員ひとり一人をきめ細やかにケアが可能です。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:27:38.923062','2024-06-09 07:23:51.257036',NULL,NULL,'お問合せください','製品画像16.jpeg'),
(440,'アッペンジャパン株式会社','500万円','2021年7月（本社の設立は1996年）','1,200名（全世界）','高機能なAIモデルを作成するためのトレーニングデータを提供します。音声、テキスト、画像、動画など様々なデータ生成や各種アノテーションデータを提供し、データ生成、アノテーションのための様々なプラットフォームも提供します。','AIモデル作成のためのトレーニングデータの生成・データアノテーションに特化した専用プラットフォーム','アッペンジャパン株式会社が提供する「AIモデル作成のためのトレーニングデータの生成・データアノテーションに特化した専用プラットフォーム」は、音声、テキスト、画像、動画、文字起こし・翻訳データ、建物等のランドマーク、3D点群データ等様々なデータを生成またはインポートし、複数の作業者の業務分担や進捗の管理を行う、管理機能を有し、AIを駆使した効率的なアノテーションを行える環境です。','その他',NULL,'なし',true,NULL,'[]',NULL,'2024-05-28 10:27:41.443420','2024-06-09 07:23:51.325436',NULL,NULL,'販売価格は近日中に発表いたします。','製品画像22.jpeg'),
(441,'Datatang株式会社','/','2020/2/1','グローバルで2,000名（日本、中国、アメリカ、韓国）','AI学習用データ提供サービス（自社データ・カスタマイズデータ）AIアノテーション・プラットフォームサービス','DatatangAI学習用データセット提供サービス','Datatang株式会社は、世界トップクラスのAIデータサービスプロバイダーです。AI(人工知能）の学習用データ整備に特化しております。画像、音声、テキスト、動画など2.5PB以上のアノテーション済みデータを保持、またカスタマイズデータの収集と自動化技術を利用したアノテーションサービスを提供しております。','その他',NULL,'なし',NULL,NULL,'[]',NULL,'2024-05-28 10:27:43.764245','2024-06-09 07:23:51.413769',NULL,NULL,'少量でもOK、ご要件に基づき、個別見積','製品画像11.jpeg'),
(442,'株式会社オプティマインド','-','2015年6月','-','世界トップクラスと評された組合せ最適化をコア技術とし、「世界のラストワンマイルを最適化する」というミッションを掲げ、モノの配送だけでなく、ヒトの移動、さらには街全体の移動の最適化を目指しています。','Loogia自動配車クラウド','最先端のアルゴリズムとビックデータ解析により実現した高精度な自動配車クラウド','その他',NULL,NULL,NULL,NULL,'["\n                \n                Loogiaの利用には、何が必要ですか？              \n以下の端末と情報が必要になります。\r\n\r\n端末｜管理者画面｜インターネットに接続できるパソコン、またはタブレット端末\r\n端末｜ドライバーアプリ｜インターネットに接続できるタブレット端末、またはスマートフォン\r\n\r\n情報｜デポ情報｜デポの名称*、ID、住所*\r\n情報｜ドライバー情報｜名前*、ID、勤務時間*、休憩時間\r\n情報｜車両情報｜名前*、ID、車種*、積載量\r\n情報｜配送先情報｜名前*、ID、住所*、時間指定、荷量、作業時間（滞在時間）*、優先度\r\n\r\n*は必須項目です", "\n                \n                最短何ヶ⽉からの契約が可能ですか？              \n最初の契約は最低3ヶ月契約からとなります。4ヶ月目以降は1ヶ⽉単位の契約が可能ですので、お客様の目的に合わせて、柔軟に期間を設定いただけます。", "\n                \n                対応エリアを教えてください。              \n日本全国対応しています。（離島を除く）", "\n                \n                ⼀般的なナビが出すルートとの違いは何ですか？              \n⼀般的なナビは２点間の経路を案内するのに対し、Loogiaは複数の拠点をどういう順番で回ると最適かを求めています。さらに、各２点間においても最適なルートを算出しています。", "\n                \n                カスタマイズや既存システムとの連携は可能ですか？              \nAPI連携にて可能な場合がございます。お気軽にご相談ください。", "\n                \n                配送先データはどうやってLoogiaに読み込ませますか？              \nエクセルやcsvでLoogiaへ一括登録する形が基本です。Loogia内で直接手入力いただくことも可能です。", "\n                \n                どんな会社が導入していますか？              \n業種に関わらず多くの企業に導入いただいておりますが、特に卸売・小売業界が多い傾向にあります。自社配送を効率化したいというニーズがあればぜひ気軽にお問い合わせください。", "\n                \n                荷量を考慮して配車計画ができますか？              \nできます。荷量は様々な単位（g、kg、t、ケースなど）に対応しておりますので、お客様で自由にカスタムいただくことが可能です。", "\n                \n                Loogia導入にあたり障壁はありますか？              \nお客様のご都合により様々ですが、配送先データの準備が障壁になる場合がございます。手作業のみで配車していたものをシステム化するにあたり時間がかかります。ただし、その際も弊社でデータ準備の支援を行っておりますので、今後の業務効率化のためにもぜひ前向きにご検討ください。"]',NULL,'2024-05-28 10:27:46.390144','2024-06-09 07:23:51.495299',NULL,NULL,'お問合せください','製品画像23.jpeg'),
(443,'一般社団法人　社会整備サポート協会','1000万円','2012年4月','/','「カスタマイズ」と「ホワイトボックス化」で貴社のAI推進をサポートします。・AIモデルのカスタマイズ構築・AIモデルの内製化・システム制作','リスク・リターン分析モデル','一般社団法人　社会整備サポート協会が提供する「リスク・リターン分析モデル」は、「守る先」と「攻める先」の両方が分かるので、フロント・バックオフィス両方に役立つモデルが手に入ります。','月額',NULL,'100000',NULL,NULL,'[]',NULL,'2024-05-28 10:27:47.684048','2024-06-09 07:23:51.567142',true,100000,'月額 50,000円～','製品画像4.jpeg'),
(444,'TDSE株式会社','8億3318万円','2013年10月17日','128名','ビッグデータ・人工知能（AI）を活用したソリューション提供及びAI製品（AIモジュールを含む）の提供','DXコンサルティングサービス','TDSE株式会社の「DXコンサルティングサービス」では、お客様のDXの取組状況に応じた３つのサービスを提供し、初期段階のDX準備フェーズから、複数のプロジェクトが並行して稼働しAIなどが実ビジネスで効果を発揮し続けるフェーズまでサポートいたします。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-28 10:27:50.135891','2024-06-09 07:23:51.640379',NULL,NULL,'お問合せください','製品画像9.jpeg'),
(445,'CylanceJapan株式会社','/','2016年5月','/','BlackBerryCylanceのAIソリューションは、脅威の防御、検出、および対応機能を提供し、情報に基づいた戦略的なセキュリティ上の判断を下す後押しをします。','CylancePROTECT🄬/CylanceOPTICS','CylanceJapan株式会社が提供する「CylancePROTECT🄬/CylanceOPTICS」は、人工知能（AI）と機械学習の技術を駆使して、実行される前にマルウェアを判定できます。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-28 10:27:51.625438','2024-06-09 07:23:51.707870',NULL,NULL,'お問合せください','製品画像15.jpeg'),
(446,'株式会社chipper','44,000,000円','2017年2月','24名','EC/D2Cを中心とするマーケティング総合支援を行う株式会社chipperでは、D2C支援事業、P2C支援事業、SaaS事業を展開しています。マーケティングとテクノロジーを融合させ、SaaS事業では、生成AIを利用したAIライティングツール「CreativeDrive」の提供を行っております。','SEO特化型のAI自動記事生成ツールCreativeDrive','株式会社chipperが提供する「SEO特化型のAI自動記事生成ツールCreativeDrive」は最新のAIテクノロジーと独自のSEOノウハウを掛け合わせることで、“誰でも”、“簡単”にWeb記事の執筆によるコンテンツマーケティングを可能にします。','月額',NULL,'なし',NULL,NULL,'["\n                \n                1つのアカウントで何人まで利用できますか？              \n1アカウント1人までのご利用とさせていただいており、申請が必要となります。1社で複数名ご利用される場合は、一度弊社までご相談ください。", "\n                \n                記事生成ではどのようなキーワードを入力すれば良いですか？              \nCreativeDriveでは、SEOで獲得したいキーワード(Googleで検索する)を入力することを推奨しております。", "\n                \n                ツール以外にSEOコンサルティング等の支援等ありますか？              \n弊社ではCreativeDriveの提供の他に、お客様の課題や予算に合わせた、SEOコンサルティングプラン（キーワード調査、コンテンツ施策の提案）や、AIライティング代⾏プランをご用意しております。詳しくは弊社までお問い合わせください。", "\n                \n                IT導入補助金は利用できますか？              \nCreativeDriveがIT導入補助金の対象ソフトウェア(通常枠)として採択されております。ご希望や詳細説明をご希望のお客様は、弊社までお問い合わせください。", "\n                \n                Creative Driveで生成した内容に関して著作権の懸念等はありませんか？              \n1.インターネット上のデータについて\r\nインターネット上に公開されているデータは、著作物として適用されることが少ないです。\r\n2.OpenAI(ChatGPT)の技術について\r\n私たちのサービスは、OpenAIのChatGPT技術を使用しています。\r\nこの技術は、ネット上のテキスト（著作物）をそのまま流用するのではなく、ネット上のテキストをトレーニングデータとして利用し、生成された言語モデルを基にコンテンツを生み出しています。\r\nこの点に関する規約はOpenAIに準拠しており、最近、OpenAIは著作権侵害訴訟で全面的に勝訴しています。\r\n参考文献　https://gigazine.net/news/20240214-openai-win-authors-copyright-lawsuit/\r\n3.自社のコピーチェック機能について\r\n自社では、上記の前提を踏まえつつ、リスクに配慮したコピーチェック機能を実装しております。また、現状においてネット上のテキストをダイレクトに流用したケースはありません。"]',NULL,'2024-05-29 12:46:26.173843','2024-06-09 07:23:51.807941',NULL,NULL,'・月額プラン　Standard　10,000円　Professional  25,000円　Premium. 50,000円・年額プラン　Standard　90,000円（7,500円/月）　Professional  225,000円（18,750円/月)　Premium. 450,000円（37,500円/月)※全て税込価格','製品画像29.jpeg'),
(447,'株式会社VARIETAS','1億円','2019年12月','約10名','AI面接官は、新卒採用の書類選考から二次面接までのプロセス全てをAIが代替し、各社の基準を満たした候補者に絞って選考できるサービスです。公正で効率的な採用を実現し、人手不足やコスト削減に貢献します。','ES選考・一次面接はAIが担当「AI面接官」','生成AIがES選考・一次面接を担当し、二次面接までを効率化株式会社VARIETASが提供する「AI面接官」は、新卒採用における書類選考から一次面接までAI面接官が対応し、自社にあった候補者をスクリーニングすることで、業務効率化・採用の質を高めるサービスです。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-29 12:46:26.564840','2024-06-09 07:23:51.914397',NULL,NULL,'お問合せください','製品画像10.jpeg'),
(448,'株式会社ネッコス','670万円','2019年4月1日','15名','AI組み込みやLINEミニアプリ等の受託開発','AI利用受託開発の実績があるネッコスのシステム開発','株式会社ネッコスが提供する「AI利用受託開発の実績があるネッコスのシステム開発」はネッコスのChatGPT活用提案/組み込み受託開発！活用方法からシステムへの組み込みの相談、またその後のランニングまでを一緒に伴走してビジネス拡大のお手伝いをいたします！','その他',NULL,'なし',true,true,'["\n                \n                すでにあるシステムにAIを導入可能ですか？              \n既存システムの改修による導入も対応可能です", "\n                \n                自社内で蓄積したデータを活用できますか？              \nAPI対応が必要になりますが既存データをAIで生かすことが可能です", "\n                \n                開発期間はどれぐらいになりますか？              \nご相談いただく内容によりますが３～６か月程度が平均的です"]',NULL,'2024-05-29 12:46:26.938316','2024-06-09 07:23:51.991170',NULL,NULL,'-','製品画像14.jpeg'),
(449,'株式会社Ballista','120万円','2022年8月1日','約40名','社会を変えるプロフェッショナルギルドの創出“を目的とし、社会課題を解決すべくコンサルティング業務や自社でのプロダクト開発を行うとともに人材活用サイト”Yoake”の運営を行っています。','AXPartners','株式会社Ballistaが提供する「AXPartners」は、ビジネスと技術の両面に精通したプロフェッショナルがパートナーとなって起点となる成功体験を創出し、利益を生み出すDXが自律的に加速している状態を具現化するための、唯一無二のスキームを提供します。','その他',NULL,NULL,NULL,NULL,'[]',NULL,'2024-05-29 12:46:27.130002','2024-06-09 07:23:52.063896',NULL,NULL,'お問合せください','製品画像1.jpeg'),
(450,'株式会社PreferredNetworks','-','2014年3月','約300名','PreferredNetworks(PFN)は深層学習などの最先端の技術を最短路で実用化することで、これまで解決が困難であった現実世界の課題解決を目指しています。','PreferredNetworksVisualInspection','PreferredNetworksが提供する「PreferredNetworksVisualInspection」は、①不良箇所塗りつぶし作業が不要、②少量の学習データでも学習可能、③独自モデルによる高い精度で過検知を改善を特徴とするAI外観検査ソフトウェアです。','その他',NULL,NULL,true,NULL,'[]',NULL,'2024-05-29 12:48:16.164835','2024-06-09 07:23:52.148943',NULL,NULL,'お問合せください','製品画像17.jpeg');
