COMMIT;


-- ai_productsテーブルの作成とデータ挿入
BEGIN;
CREATE TABLE IF NOT EXISTS "ai_products" (
    "id" SERIAL PRIMARY KEY,
    "company_name" VARCHAR DEFAULT NULL,
    "capital" VARCHAR DEFAULT NULL,
    "establishment_date" VARCHAR DEFAULT NULL,
    "employee_type" VARCHAR DEFAULT NULL,
    "business_description" TEXT DEFAULT NULL,
    "product_name" VARCHAR DEFAULT NULL,
    "description" TEXT DEFAULT NULL,
    "usage_fee_type" VARCHAR DEFAULT NULL,
    "usage_fee" INTEGER DEFAULT NULL,
    "initial_cost" VARCHAR DEFAULT NULL,
    "free_plan" BOOLEAN DEFAULT NULL,
    "trial" BOOLEAN DEFAULT NULL,
    "faq" TEXT DEFAULT NULL,
    "review" VARCHAR DEFAULT NULL,
    "created_at" TIMESTAMP NOT NULL,
    "updated_at" TIMESTAMP NOT NULL,
    "initial_cost_search" BOOLEAN DEFAULT NULL,
    "initial_cost_display" INTEGER DEFAULT NULL,
    "usag_fee_scrape" VARCHAR DEFAULT NULL,
    "image" VARCHAR
);

COMMIT;

